INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (1, 'After the first massacre in 1974, the townspeople suspected that the Sawyer family were responsible. A vigilante mob of enraged locals surrounded the Sawyer house, burning it to the ground and killing every last member of the family. Decades later a young woman named Heather learns that she has inherited a Texas estate from her grandmother. she decides to bring her friends along on the road trip to invesitgate her inheritance. On arrival she uncovers she has inherited a mansion but is yet to uncover the terrors that lurk in the basement below it. Written by Tom Thomas', '92 min', 'http://ia.media-imdb.com/images/M/MV5BMTQzMzAyNTE2N15BMl5BanBnXkFtZTcwNzM1NDg2OA@@._V1_SX214_.jpg', '4 January 2013 (USA)', 4.79999999999999982, 'Texas Chainsaw 3D', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (2, 'A former CIA operative turned political talk show host is hired by a corporate whistle blower to expose her company''s cover-up of a massacre in a South American village.', '106 min', 'http://ia.media-imdb.com/images/M/MV5BMTYxOTQ0NTUzOV5BMl5BanBnXkFtZTcwMjc5MDA2OA@@._V1_SY317_CR1,0,214,317_.jpg', '6 September 2013 (Spain)', 5.40000000000000036, 'A Dark Truth', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (3, 'It''s 1949 Los Angeles, and gangster Mickey Cohen has moved in, with the intention of controlling all criminal activity in the city. He has bought local judges and police, and no one is willing to cross him or testify against him. Everyone except Seargant John O''Mara, a former World War II soldier, whose goal is to settle with his family in a peaceful Los Angeles. Police Chief William Parker decides to form a special unit whose mission is to take down Cohen, and chooses O''Mara to lead the unit. O''Mara chooses 4 cops and asks another cop and vet, Jerry Wooters to join him but Wooters is not interested. But when he witnesses the murder of a young boy by Cohen''s people, he joins them, and they decide to take apart Cohen''s organization. Cohen wonders if a rival is going after him, but eventually he realizes it''s the cops. Written by rcs0411@yahoo.com', '113 min', 'http://ia.media-imdb.com/images/M/MV5BMTcwMjAyMTUzMl5BMl5BanBnXkFtZTcwODgxNzk1OA@@._V1_SY317_CR0,0,214,317_.jpg', '11 January 2013 (USA)', 6.70000000000000018, 'Gangster Squad', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (4, 'Malcolm and Kisha move into their dream home, but soon learn a demon also resides there. When Kisha becomes possessed, Malcolm - determined to keep his sex life on track - turns to a priest, a psychic, and a team of ghost-busters for help.', '86 min', 'http://ia.media-imdb.com/images/M/MV5BMTM1ODgyOTI0NF5BMl5BanBnXkFtZTcwODgyMDY3OA@@._V1_SX214_.jpg', '11 January 2013 (USA)', 4.79999999999999982, 'A Haunted House', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (5, 'Cecily, Reggie, and Wilfred are in a home for retired musicians. Every year, on October 10, there is a concert to celebrate Verdi''s birthday and they take part. Jean, who used to be married to Reggie, arrives at the home and disrupts their equilibrium. She still acts like a diva, but she refuses to sing. Still, the show must go on... and it does. Written by BrianoftheNorth', '98 min', 'http://ia.media-imdb.com/images/M/MV5BMTc2MTI0MzI5Ml5BMl5BanBnXkFtZTcwNzkzNjQ4OA@@._V1_SY317_CR4,0,214,317_.jpg', '1 March 2013 (USA)', 6.70000000000000018, 'Quartet', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (6, 'A high school boy desperate to escape the idiocy of the people in his hometown trys to create a way in which he can move to New York, attend the college of his dreams and do something other than live in the foot steps of his drunken, divorced mother. Along the way he blackmails his fellow students into contributing to his literary magazine and discovers what its like to feel accomplished. Does he get accepted into the college of his dreams? Is he going to make a difference and follow his life goal? Written by Jo J.', '90 min', 'http://ia.media-imdb.com/images/M/MV5BMTEyMDk3MzA2MTheQTJeQWpwZ15BbWU3MDIxODc3Nzg@._V1_SY317_CR0,0,214,317_.jpg', '11 January 2013 (USA)', 6.20000000000000018, 'Struck by Lightning', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (7, 'A former high school football star and one time college athlete, Jon has landed back in the place of his youth -- Fairhaven -- a small fishing village on the Massachusetts coast. Now in his early thirties, and with the promise of younger days seemingly washed ashore, Jon''s vague feelings of dissatisfaction are crystallized by a television interview with his football hero Tom Brady, who proclaims that, even after three super bowl wins, "There''s got to be something more than this." Jon recounts his epiphany to Sam, old friend and schoolmate who married early, fathered early, divorced early and never left town. Sam made his own peace with small town life years ago, and is happy enough just to provide a stable home for his loving daughter, Cara, while secretly still pining for his beautiful ex-wife Kate. Together, Jon and Sam anticipate the return of Dave, the third member of their once-indomitable trio. Having left town seven years ago and never looked back, Dave is finally returning to ... Written by Production', '81 min', 'http://ia.media-imdb.com/images/M/MV5BMTkyODExMTEzOV5BMl5BanBnXkFtZTcwMTg5NDA5OA@@._V1_SY317_CR5,0,214,317_.jpg', '11 January 2013 (USA)', 4.90000000000000036, 'Fairhaven', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (8, 'After her ex-husband Carlos shoots Celeste three times in the gut, it''s time to play dirty. In the fight for her godson, Rob, she hires three outlawed and redneck brothers to bring him back to her. But nothing can be that simple in the South. What begins as a small rescue mission rises to a southern battle royal. This odd team must shoot their way through gorgeous female assassins, Native American hunters, Federal agents, and a whole lot of metal coming after them, while protecting Celeste''s innocent child. Written by LLeju Productions and Films', '98 min', 'http://ia.media-imdb.com/images/M/MV5BMTM5NzE0ODIwMV5BMl5BanBnXkFtZTcwMzY5Mjg3OA@@._V1_SY317_CR0,0,214,317_.jpg', '15 June 2013 (Japan)', 6.09999999999999964, 'The Baytown Outlaws', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (9, 'Celebrity photographer Kevin Mazur gives an all access pass to life behind the velvet rope and in front of the camera.', '89 min', 'http://ia.media-imdb.com/images/M/MV5BMjgwNzc5NTExNl5BMl5BanBnXkFtZTcwMTIxMjA4OA@@._V1_SX214_.jpg', '11 January 2013 (USA)', 4.59999999999999964, '$ellebrity', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (10, 'Harry is an industrialist who loves his daughter Bijlee, and the bond they share with Harry''s man friday, Matru. Bijlee''s plan to wed the son of a politician, however, brings twists and turns in the lives of Matru, Bijlee and Mandola.', '151 min', 'http://ia.media-imdb.com/images/M/MV5BMTQyMzkxNjI5M15BMl5BanBnXkFtZTcwNDAzODY4OA@@._V1_SY317_CR2,0,214,317_.jpg', '11 January 2013 (India)', 5.90000000000000036, 'Matru ki Bijlee ka Mandola', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (11, 'On Christmas Eve at Tower Sky, an ultra-luxurious building complex, a White Christmas party is held to dazzle its equally high-end tenants and VIP guests. Dae-ho, the manager of the building and single father, is forced to cancel plans with his daughter Hana to work the event. His Christmas is saved when Yoon-hee, the food mall manager with a secret crush on Dae-ho, offers to babysit Hana during the party. Meanwhile, Young-ki the legendary fire chief of Yoido Station has finally promised his first holiday date night to his long suffering wife. The party is in full swing with the spectacular sight of two helicopters flying overhead just to spray snow on the partygoers and make everything perfect. When unthinkable disaster strikes, Dae-ho and Young-ki must summon all their strength and courage to save the lives of thousands but at what cost to themselves and their loved ones? Written by CJ Entertainment', '121 min', 'http://ia.media-imdb.com/images/M/MV5BMTU2NzIyNTY4Ml5BMl5BanBnXkFtZTcwNjM0MTA3OQ@@._V1_SY317_CR5,0,214,317_.jpg', '11 January 2013 (USA)', 6.20000000000000018, 'The Tower', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (487, 'A singer-songwriter hits the road with a self-appointed music revolutionary.', '98 min', 'http://ia.media-imdb.com/images/M/MV5BMjEwNjU4Mjc3M15BMl5BanBnXkFtZTcwNTQ0MzAyOA@@._V1_SY317_CR2,0,214,317_.jpg', '20 July 2012 (UK)', 5.70000000000000018, 'Brooklyn Brothers Beat the Best', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (12, 'In London, a military plane crashes leaving its highly classified contents strewn across the city. Completely unaware that the city is in lockdown, a group of people become trapped inside a storage facility with a highly unwelcome guest.', '87 min', 'http://ia.media-imdb.com/images/M/MV5BMTY4MjY3Njk4N15BMl5BanBnXkFtZTcwNDc3NjU3OA@@._V1_SX214_.jpg', '29 June 2012 (UK)', 4.29999999999999982, 'Storage 24', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (13, 'Maya is a CIA operative whose first experience is in the interrogation of prisoners following the Al Qaeda attacks against the U.S. on the 11th September 2001. She is a reluctant participant in extreme duress applied to the detainees, but believes that the truth may only be obtained through such tactics. For several years, she is single-minded in her pursuit of leads to uncover the whereabouts of Al Qaeda''s leader, Osama Bin Laden. Finally, in 2011, it appears that her work will pay off, and a U.S. Navy SEAL team is sent to kill or capture Bin Laden. But only Maya is confident Bin Laden is where she says he is. Written by Jim Beaver <jumblejim@prodigy.net>', '157 min', 'http://ia.media-imdb.com/images/M/MV5BMTQ4OTUyNzcwN15BMl5BanBnXkFtZTcwMTQ1NDE3OA@@._V1_SX214_.jpg', '11 January 2013 (USA)', 7.40000000000000036, 'Zero Dark Thirty', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (14, 'The senior partner of an investment brokerage Jeffrey has a breakdown and kills his two associates and his wife. Then he takes his three-year old daughter Victoria and the one-year old daughter Lilly and drives his car through a winding snowing road. He has a car accident and fall off a cliff, but he brings his daughters to an abandoned and isolated cabin to kill them, but the children are saved by a creepy ghostly creature. Five years later, Jeffrey''s brother Lucas finds the children that were raised without social relationship and claim that they have been raised by Mama. Lucas disputes the custody with the children''s grandmother but Dr. Dreyfuss, who is studying the girls, selects Lucas to take care of the children. Lucas lives with his girlfriend Annabel, who plays in a rock''n''roll band, and Victoria and Lilly moves to their house. Soon Lucas and Annabel find that the girls were not delusional and they are not alone in the house. Written by Claudio Carvalho, Rio de Janeiro, Brazil', '100 min', 'http://ia.media-imdb.com/images/M/MV5BMTM5MjIwNDAwMl5BMl5BanBnXkFtZTcwNzQyOTY0OA@@._V1_SX214_.jpg', '18 January 2013 (USA)', 6.20000000000000018, 'Mamã', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (15, 'Sheriff Owens is a man who has resigned himself to a life of fighting what little crime takes place in sleepy border town Sommerton Junction after leaving his LAPD post following a bungled operation that left him wracked with failure and defeat after his partner was crippled. After a spectacular escape from an FBI prisoner convoy, the most notorious, wanted drug kingpin in the hemisphere is hurtling toward the border at 200 mph in a specially outfitted car with a hostage and a fierce army of gang members. He is headed, it turns out, straight for Summerton Junction, where the whole of U.S. law enforcement will have their last opportunity to make a stand and intercept him before he slips across the border forever. At first reluctant to become involved, and then counted out because of the perceived ineptitude of his small town force, Owens ultimately accepts responsibility for the face off. Written by Production', '107 min', 'http://ia.media-imdb.com/images/M/MV5BODc4NjI0OTYwNl5BMl5BanBnXkFtZTcwOTYwODQ3OA@@._V1_SX214_.jpg', '18 January 2013 (USA)', 6.40000000000000036, 'The Last Stand', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (16, 'In New York City, detective Billy Taggart goes to court for the murder of the rapist Mikey Tavarez, but the Mayor Nicholas Hostetler and the Chief of Police Carl Fairbanks vanish with an important evidence and Billy is declared non-guilty by the judge but he leaves the police department. Seven years later, Billy is a private detective that lives his girlfriend Natalie Barrow, who is an aspirant actress and the sister of Mikey''s victim. His secretary Katy Bradshaw (Alona Tal) is trying to collect part of the debts to save their business. In the week of the elections, Hostetler summons Billy and offers US$ 50,000 to investigate his wife Cathleen Hostetler that he believes is having a love affair. Billy discovers that Cathleen is meeting Paul Andrews, who is the coordinator of the campaign of Jack Valliant, the opponent of Hostetler and favorite in the election. When Paul is found dead on the street, Billy finds that he had been double-crossed by Hostetler and he decides to investigate ... Written by Claudio Carvalho, Rio de Janeiro, Brazil', '109 min', 'http://ia.media-imdb.com/images/M/MV5BMTY4OTIwODg4Ml5BMl5BanBnXkFtZTcwNjg0MDY1OA@@._V1_SX214_.jpg', '18 January 2013 (USA)', 6.09999999999999964, 'Broken City', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (17, 'An 11-year-old boy gets a crash course in what it means to be a man when he spends a day with the ex-convict uncle he idolizes.', '94 min', 'http://ia.media-imdb.com/images/M/MV5BMTY2MjEzNDIzNV5BMl5BanBnXkFtZTcwMzkyMTQ0OA@@._V1_SY317_CR0,0,214,317_.jpg', '18 January 2013 (USA)', 5.29999999999999982, 'LUV', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (18, 'In a village on the French Opal Coast, a drifter engages in a perplexing relationship with a young woman who has suffered abuse.', '110 min', 'http://ia.media-imdb.com/images/M/MV5BOTIwNTQ4MzEyNl5BMl5BanBnXkFtZTcwNDcxODg3OA@@._V1_SY317_CR2,0,214,317_.jpg', '18 January 2013 (USA)', 6.20000000000000018, 'Fora, Satanás', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (19, 'The siblings Hansel and Gretel are left alone in the woods by their father and captured by a dark witch in a candy house. However they kill the witch and escape from the spot. Years later, the orphans have become famous witch hunters. When eleven children go missing in a small village, the Mayor summons Hansel and Gretel to rescue them, and they save the red haired Mina from the local sheriff that wants to burn her accusing Mina of witchcraft. Soon they discover that the Blood Moon will approach in three days and the powerful dark witch Muriel is the responsible for the abduction of children. She intends to use the children together with a secret ingredient in a Sabbath to make the coven of witches protected against the fire. Meanwhile Hansel and Gretel disclose secrets about their parents. Written by Claudio Carvalho, Rio de Janeiro, Brazil', '88 min', 'http://ia.media-imdb.com/images/M/MV5BMjA4MDQwODg2NV5BMl5BanBnXkFtZTcwNTc5ODc2OA@@._V1_SX214_.jpg', '25 January 2013 (USA)', 6.09999999999999964, 'Hansel & Gretel: Caçadores de Bruxas', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (20, 'Parker is a thief who has an unusual code. He doesn''t steal from the poor and hurt innocent people. He is asked to join 4 other guys one of whom is related to a known mobster. They pull off the job flawlessly and Parker wants to part ways with them. But because he refused to join them for another job they try to kill him. They dispose of his body but someone finds him and he is still alive and takes him to the hospital. After recovering he sets out to get back at the ones who tried to kill him, another one of his codes. He learns where they are and poses as a wealthy Texan looking to buy a house. So he hires a real estate agent, Leslie Rogers to show him around. He is actually trying to find out where they''re holed up. And when he finds it, he sets out on his plan to get them. But when they learn he is alive, they contact the mobster to take care of him. So he sends a killer to take care of him. Written by rcs0411@yahoo.com', '118 min', 'http://ia.media-imdb.com/images/M/MV5BMTk4MzM2NTQ1Nl5BMl5BanBnXkFtZTcwODIyODY1OA@@._V1_SX214_.jpg', '25 January 2013 (USA)', 6.09999999999999964, 'Parker', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (43, 'A graphic designer''s enviable life slides into despair when his girlfriend breaks up with him.', '86 min', 'http://ia.media-imdb.com/images/M/MV5BMTM5MjQ4NTkwNl5BMl5BanBnXkFtZTcwNjkxOTc5OA@@._V1_SX214_.jpg', '21 November 2013 (Portugal)', 4.79999999999999982, 'A Glimpse Inside the Mind of Charles Swan III', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (21, 'Ineffectual, ''has-been'' film-maker (Dennis Quaid) swindles his way into an interview with a film executive (Greg Kinnear) in order to pitch an outrageous and controversial comedy manuscript. After pitching the first of his thirteen offbeat fables, the dejected artist forces the rest of his disjointed allegory on the executive at gunpoint. He tells stories of a woman on a blind date with a man who has testicles growing from his neck, in another a smitten woman offers her neck to her boyfriend to ''poop'' on -as a sign of commitment and love. In yet another two parents take home-schooling to a whole new level of indecency, striving to give their isolated teenage son all the ''regular'' torment and humiliation of puberty by bullying, peer-pressuring and even seducing him themselves. An off-beat, elephant-in-the-room type film. Written by kwedgwood@hotmail.com', '94 min', 'http://ia.media-imdb.com/images/M/MV5BMTg4NzQ3NDM1Nl5BMl5BanBnXkFtZTcwNjEzMjM3OA@@._V1_SX214_.jpg', '25 January 2013 (USA)', 4.40000000000000036, 'Movie 43', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (22, 'Ranvir treads through the world of the Indian mafia in Turkey as he looks to avenge the death of his lover and partner in crime.', '150 min', 'http://ia.media-imdb.com/images/M/MV5BMjA4NzEzODQ3NV5BMl5BanBnXkFtZTcwMDMzMjg3OA@@._V1_SY317_CR2,0,214,317_.jpg', '25 January 2013 (USA)', 5.09999999999999964, 'Race 2', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (23, 'It''s a drug that promises an out-of-body experience with each hit. On the street they call it Soy Sauce, and users drift across time and dimensions. But some who come back are no longer human. Suddenly a silent otherworldly invasion is underway, and mankind needs a hero. What it gets instead is John and David, a pair of college dropouts who can barely hold down jobs. Can these two stop the oncoming horror in time to save humanity? No. No, they can''t. Written by David Wong', '99 min', 'http://ia.media-imdb.com/images/M/MV5BMTUyNzIyNzc0MV5BMl5BanBnXkFtZTcwOTM5ODg1OA@@._V1_SY317_CR0,0,214,317_.jpg', '25 January 2013 (USA)', 6.40000000000000036, 'John Dies at the End', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (24, 'The sequel to Yossi & Jagger finds Dr. Yossi Gutmann reminiscing about his love ten years after his death. However, as he encounters a group of young soldiers, one of them, Tom, reignites his romantic feelings.', '84 min', 'http://ia.media-imdb.com/images/M/MV5BMTQ4NzgwOTI3N15BMl5BanBnXkFtZTcwNjM3NjQ5OA@@._V1_SX214_.jpg', '17 May 2012 (Israel)', 6.70000000000000018, 'Yossi', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (25, 'In the center of the story is the life of the indigenous people of the village Bakhtia at the river Yenisei in the Siberian Taiga. The camera follows the protagonists in the village over a period of a year. The natives, whose daily routines have barely changed over the last centuries, keep living their lives according to their own cultural traditions. The expressive pictures are accompanied by original sound bites quoting the villagers. Written by Eike Wolf / Head of Corporate Communications, Studio Babelsberg', '90 min', 'http://ia.media-imdb.com/images/M/MV5BMTM3ODM0NTQ1MF5BMl5BanBnXkFtZTcwMzAxMTM5OA@@._V1_SY317_CR4,0,214,317_.jpg', '15 November 2012 (Germany)', 7.59999999999999964, 'Happy People: A Year in the Taiga', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (26, 'If a political candidate is personally flawed, but stands to make a positive difference in millions of lives, would you help him win? That question looms over the life of "true believer" Paul Turner (Rob Lowe), a savvy strategist sharply maneuvering politicians out of scandal and into public office. With the help of a bright young assistant (Jamie Chung) and a seedy operative (Richard Schiff), Turner spins every news cycle and a shrewd reporter (Julie Bowen) on behalf of his clients: a philandering Kentucky governor (Eric McCormick), a blackmailed California senator (David Harbour), and an idealistic doctor turned gubernatorial candidate (Carrie-Anne Moss). When the ugly side of Turner''s work begins to haunt him, he learns that even in the bloodiest of battles, sometimes you have to fight clean. Written by IFC Films', '100 min', 'http://ia.media-imdb.com/images/M/MV5BMTQ2MDU4NjM1MV5BMl5BanBnXkFtZTcwNjQ3MzY5OA@@._V1_SY317_CR0,0,214,317_.jpg', '28 January 2013 (USA)', 4.59999999999999964, 'Knife Fight', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (27, 'Four friends hit the road to LA to compete in the Cyberbowl Video Game Championship, but will they be able to compete with the worst hangovers of their lives?', '97 min', 'http://ia.media-imdb.com/images/M/MV5BMTM5OTczNjU4MV5BMl5BanBnXkFtZTcwMjE0OTM3OA@@._V1_SX214_.jpg', '25 January 2013 (USA)', 4.59999999999999964, 'Noobz', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (28, 'With much of the world''s population now an undead horde, R is a young and oddly introspective zombie. While fighting with and feeding on a human scavenger party, R meets Julie and feels an urge to protect her. What happens next is the beginning of a strangely warm relationship that allows R to begin regaining his humanity. As this change spreads through the local undead population like a virus, Julie and R eventually have to face a larger issue when the very nature of their friendship is challenged. Caught between the paranoid human forces and the ferocious "Bonies", zombies who are a mutual threat, R and Julie must find a way to bridge the differences of each side to fight for a better world no one thought possible. Written by Kenneth Chisholm (kchishol@rogers.com)', '98 min', 'http://ia.media-imdb.com/images/M/MV5BMTQ4MjY2MjMzOV5BMl5BanBnXkFtZTcwMDUxNzIwOQ@@._V1._CR43,43.16667175292969,1298,1960.9999542236328_SX214_.jpg', '1 February 2013 (USA)', 6.90000000000000036, 'Warm Bodies', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (29, 'After watching their respective partners die, a New Orleans hitman and a Washington D.C. detective form an alliance in order to bring down their common enemy.', '92 min', 'http://ia.media-imdb.com/images/M/MV5BMTM4NzUyMjk2NV5BMl5BanBnXkFtZTcwOTUxNDc5OA@@._V1_SY317_CR2,0,214,317_.jpg', '1 February 2013 (USA)', 5.70000000000000018, 'Bullet to the Head', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (30, 'After 28 years, Val gets out of prison, and his friend Doc picks him up. The local mob boss, Claphands, wants Val dead (Claphands'' son died in a robbery and he blames Val) and Doc has until morning to kill him. It''s a long night: Val wants to party - they visit a cat house, Val needs Viagra, they break into a pharmacy. After midnight, they pick up Hirsch, their old wheelman, drive the city in a stolen car. They visit the cat house, help a woman in distress, bury a body, and eat at Doc''s hangout, a café where the waitress, Alex, is cheerful. The sun rises, Claphands wants Val dead, and Val, who has figured out his fate, is resigned. Is there anything left to take care of? Written by <jhailey@hotmail.com>', '95 min', 'http://ia.media-imdb.com/images/M/MV5BMTgwNjgyOTExMV5BMl5BanBnXkFtZTcwNTIzODA1OA@@._V1_SX214_.jpg', '1 February 2013 (USA)', 6.5, 'Stand Up Guys', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (31, 'A documentary featuring interviews with all surviving former heads of Shin Bet, the Israeli security agency whose activities and membership are closely held state secrets.', '101 min', 'http://ia.media-imdb.com/images/M/MV5BMTYyMDg3NjYyMl5BMl5BanBnXkFtZTcwOTcyNDY4OA@@._V1_SX214_.jpg', '19 June 2013 (Belgium)', 7.40000000000000036, 'The Gatekeepers', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (32, 'Building on the terror of The Haunting in Connecticut, this tale traces a young family''s nightmarish descent into a centuries-old Southern hell. When Andy Wyrick moves his wife Lisa and daughter Heidi to a historic home in Georgia, they quickly discover they are not the house''s only inhabitants. Joined by Lisa''s free-spirited sister, Joyce, the family soon comes face-to-face with a mystery born of a deranged desire ... a haunting secret rising from underground and threatening to bring down anyone in its path. Written by Lionsgate', '100 min', 'http://ia.media-imdb.com/images/M/MV5BMTk0MTA0NDAwOF5BMl5BanBnXkFtZTcwMDQ0NzQ4OA@@._V1_SX214_.jpg', '14 March 2013 (Singapore)', 4.90000000000000036, 'The Haunting in Connecticut 2: Ghosts of Georgia', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (33, 'The history of Sound City and their huge recording device; exploring how digital change has allowed ''people that have no place'' in music to become stars. It follows former Nirvana drummer and Foo Fighter David Grohl as he attempts to resurrect the studio back to former glories. Written by Joe', '108 min', 'http://ia.media-imdb.com/images/M/MV5BMTc4MjkyODg4MF5BMl5BanBnXkFtZTcwNTk1NjM4OA@@._V1_SX214_.jpg', '18 January 2013 (USA)', 7.70000000000000018, 'Sound City', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (34, 'Three-time New York City Mayor (1978-1989) Ed Koch was combative, funny, and blunt. He was also intensely private. ''Koch'' gives us a contemporary history of the world''s greatest city, and an intimate portrait of the 86-year old former mayor, as he confronts his own mortality and legacy. The film examines issues still relevant today - race, homelessness, AIDS, and gay rights - and gives us a window into the trials and tribulations of the nation''s most famous mayor in the world''s most wondrous city. Written by Anonymous', '100 min', 'http://ia.media-imdb.com/images/M/MV5BMTU2MDM1OTY2M15BMl5BanBnXkFtZTcwMTcyODM4OA@@._V1_SX214_.jpg', '8 October 2012 (USA)', 5.09999999999999964, 'Koch', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (35, 'Sandy Patterson (Jason Bateman) gets a nice call confirming his name and other identifying information. The next thing he knows, a spa in Florida is reminding him of his appointment and his credit cards are maxed out. With his identity stolen, Sandy leaves his wife, kids and job to literally bring the thief to justice in Colorado. Keeping tabs on the other Sandy (Melissa McCarthy) and run-ins with bounty hunters is harder than he was expecting, and ultimately the cross-country trip is going to find both Sandys learning life tips from one another. Written by napierslogs', '111 min', 'http://ia.media-imdb.com/images/M/MV5BMTY3NzM5MTk2Nl5BMl5BanBnXkFtZTcwMDQ4MjQ3OA@@._V1_SX214_.jpg', '8 February 2013 (USA)', 5.59999999999999964, 'Identity Thief', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (36, 'Emily Taylor, despite being reunited with her husband from prison, becomes severely depressed with emotional episodes and suicide attempts. Her psychiatrist, Jonathan Banks, after conferring with her previous doctor, eventually prescribes an experimental new medication called Ablixa. The plot thickens when the side effects of the drug lead to Emily killing her husband in a "sleepwalking" state. With Emily plea-bargained into mental hospital confinement and Dr. Banks'' practice crumbling around him, the case seems closed. However, Dr. Banks cannot accept full responsibility and investigates to clear his name. What follows is a dark quest that threatens to tear what''s left of his life apart even as he discovers the diabolical truth of this tragedy. Written by Kenneth Chisholm (kchishol@rogers.com)', '106 min', 'http://ia.media-imdb.com/images/M/MV5BMTc2MzY0NDAwOF5BMl5BanBnXkFtZTcwMTE1Mzc4OA@@._V1_SY317_CR0,0,214,317_.jpg', '8 February 2013 (USA)', 7.09999999999999964, 'Side Effects', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (37, 'As the Allies sweep across Germany, Lore leads her siblings on a journey that exposes them to the truth of their parents'' beliefs. An encounter with a mysterious refugee forces Lore to rely on a person she has always been taught to hate.', '109 min', 'http://ia.media-imdb.com/images/M/MV5BMjMxMDA5MDUwNl5BMl5BanBnXkFtZTcwNTM1NjM5OA@@._V1_SY317_CR1,0,214,317_.jpg', '20 June 2013 (Portugal)', 7.09999999999999964, 'Lore', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (38, 'Maverick is a hot pilot. When he encounters a pair of MiGs over the Persian Gulf, his wingman is clearly outflown and freaks. On almost no fuel, Maverick is able to talk him back down to the Carrier. When his wingman turns in his wings, Maverick is moved up in the standings and sent to the Top Gun Naval Flying School. There he fights the attitudes of the other pilots and an old story of his father''s death in combat that killed others due to his father''s error. Maverick struggles to be the best pilot, stepping on the toes of his other students and in a different way to Charlie, a civilian instructor to whom he is strongly attracted. Written by John Vogel <jlvogel@comcast.net>', '110 min', 'http://ia.media-imdb.com/images/M/MV5BMTY3ODg4OTU3Nl5BMl5BanBnXkFtZTYwMjI1Nzg4._V1_SY317_CR3,0,214,317_.jpg', '16 May 1986 (USA)', 6.70000000000000018, 'Top Gun', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (39, 'Iconoclastic, take-no-prisoners cop John McClane, for the first time, finds himself on foreign soil after traveling to Moscow to help his wayward son Jack - unaware that Jack is really a highly-trained CIA operative out to stop a nuclear weapons heist. With the Russian underworld in pursuit, and battling a countdown to war, the two McClanes discover that their opposing methods make them unstoppable heroes. Written by Guy from Estonia', '98 min', 'http://ia.media-imdb.com/images/M/MV5BMTcwNzgyNzUzOV5BMl5BanBnXkFtZTcwMzAwOTA5OA@@._V1_SX214_.jpg', '14 February 2013 (USA)', 5.29999999999999982, 'A Good Day to Die Hard', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (40, 'Teenager Ethan Wate is obsessed with his urge to finish high school and go on to college in order to leave behind the small town of Gatlin, South Carolina behind, until a mysterious girl begins to inhabit his dreams. When he meets Lena Duchannes, a newcomer who has just enrolled in his school, Ethan knows she is the girl in his dreams. Lena is rejected by the rest of her classmates for being the granddaughter of Macon Ravenwood, whom the town''s superstitious residents consider to be a devil-worshiper. But Ethan gives her a ride anyway and they fall in love. Lena reveals to her new boyfriend that she is a witch, and that on her sixteenth birthday she will be claimed by either the forces of light or of darkness. She will remain in the light, but only if she does not remain in love with Ethan. To make matters worse, her evil mother, Sarafine, is casting spells to push Lena to the dark side. Ethan joins her in a search to find a magic spell to save their doomed love. Will the lovers ... Written by Claudio Carvalho, Rio de Janeiro, Brazil', '124 min', 'http://ia.media-imdb.com/images/M/MV5BMTQyMjYwODMwMl5BMl5BanBnXkFtZTcwODUwNzY5OA@@._V1_SY317_CR0,0,214,317_.jpg', '14 February 2013 (USA)', 6, 'Beautiful Creatures', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (41, 'When a mysterious young woman named Katie appears in the small North Carolina town of Southport, her sudden arrival raises questions about her past. Beautiful yet self-effacing, Katie seems determined to avoid forming personal ties until a series of events draws her into two reluctant relationships: one with Alex, a widowed store owner with a kind heart and two young children; and another with her plainspoken single neighbor, Jo. Despite her reservations, Katie slowly begins to let down her guard, putting down roots in the close-knit community and becoming increasingly attached to Alex and his family. But even as Katie begins to fall in love, she struggles with the dark secret that still haunts and terrifies her . . . a past that set her on a fearful, shattering journey across the country, to the sheltered oasis of Southport. With Jo''s empathic and stubborn support, Katie eventually realizes that she must choose between a life of transient safety and one of riskier rewards . . . and ... Written by Nicholas Sparks', '115 min', 'http://ia.media-imdb.com/images/M/MV5BMTg4MzcxODA3OV5BMl5BanBnXkFtZTcwMTYzNDkwOQ@@._V1_SX214_.jpg', '14 February 2013 (USA)', 6.5, 'Safe Haven', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (42, 'Military dictator Augusto Pinochet calls for a referendum to decide his permanence in power in 1988, the leaders of the opposition persuade a young daring advertising executive - René Saavedra - to head their campaign. With limited resources and under the constant scrutiny of the despot''s watchmen, Saavedra and his team conceive of a bold plan to win the election and free their country from oppression. Written by FICV', '118 min', 'http://ia.media-imdb.com/images/M/MV5BMTM3ODAzNjcwMV5BMl5BanBnXkFtZTcwMTUzMjc4OA@@._V1_SY317_CR0,0,214,317_.jpg', '21 February 2013 (Portugal)', 7.40000000000000036, 'Não', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (44, 'The story takes place on planet Baab where admired astronaut Scorch Supernova (Brendan Fraser) is a national hero to the blue alien population. A master of daring rescues, Scorch pulls off astonishing feats with the quiet aid of his nerdy brother, Gary (Rob Corddry), head of mission control at BASA. Written by Websurfer', '89 min', 'http://ia.media-imdb.com/images/M/MV5BMTQyMTk4NjkyMl5BMl5BanBnXkFtZTcwMzA2OTY4OA@@._V1_SX214_.jpg', '15 February 2013 (USA)', 5.70000000000000018, 'Escape from Planet Earth', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (45, 'In Tokyo, a young prostitute develops an unexpected connection with a widower over a period of two days.', '109 min', 'http://ia.media-imdb.com/images/M/MV5BODAyMjQ4NzE1OF5BMl5BanBnXkFtZTcwMTQzMDYwOQ@@._V1_SX214_.jpg', '26 September 2013 (Portugal)', 6.79999999999999982, 'Like Someone in Love', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (46, 'Spies, cops, holy fools and well-armed children cross paths on a day of danger, mystery and possible transformation. ''The Power of Few'' unfolds over twenty minutes on one New Orleans afternoon, experienced through the lives of five unusual characters who unknowingly are connected to an extraordinary smuggling operation as religious conspiracy collides with urban crime. Written by Anonymous', '96 min', 'http://ia.media-imdb.com/images/M/MV5BMjIzMzI0MjYxM15BMl5BanBnXkFtZTcwNjU0NTY5OA@@._V1_SX214_.jpg', '15 February 2013 (USA)', 4.90000000000000036, 'The Power of Few', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (47, 'Construction company owner John Matthews learns that his estranged son, Jason, has been arrested for drug trafficking. Facing an unjust prison sentence for a first time offender courtesy of mandatory minimum sentence laws, Jason has nothing to offer for leniency in good conscience. Desperately, John convinces the DEA and the opportunistic DA Joanne Keeghan to let him go undercover to help make arrests big enough to free his son in return. With the unwitting help of an ex-con employee, John enters the narcotics underworld where every move could be his last in an operation that will demand all his resources, wits and courage to survive. Written by Kenneth Chisholm (kchishol@rogers.com)', '112 min', 'http://ia.media-imdb.com/images/M/MV5BNTM4MTYzNjA3Nl5BMl5BanBnXkFtZTcwMzcyNDA5OA@@._V1_SX214_.jpg', '22 February 2013 (USA)', 6.5, 'Snitch', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (48, 'As the Barret family''s peaceful suburban life is rocked by an escalating series of disturbing events, they come to learn that a terrifying and deadly force is after them.', '97 min', 'http://ia.media-imdb.com/images/M/MV5BMTcxNDE1OTgyOF5BMl5BanBnXkFtZTcwMTEyMzMxOQ@@._V1_SX214_.jpg', '22 February 2013 (USA)', 6.20000000000000018, 'Dark Skies', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (49, 'One afternoon, on a typical day at work, Adib is confronted with devastating news: His eldest daughter, Muna, has gone missing in Damascus. Now Adib, who has not been back in over 20 years, must return to Syria and deal with his secret past in order to find her. Inescapable is a thriller about a father''s desperate search for his daughter and the chaos of the Middle East he left behind. Written by Ruba Nadda', '93 min', 'http://ia.media-imdb.com/images/M/MV5BMTczMjIzOTA1NF5BMl5BanBnXkFtZTcwMDEwMDcwOQ@@._V1_SX214_.jpg', '22 February 2013 (USA)', 4.79999999999999982, 'Inescapable', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (50, 'A drama set in New Mexico during WWII, centered on the relationship between a young man and an elderly medicine woman who helps him contend with the battle between good and evil that rages in his village.', '106 min', 'http://ia.media-imdb.com/images/M/MV5BMTc4MzM0NDkxNl5BMl5BanBnXkFtZTcwNDUwMzk0OA@@._V1_SX214_.jpg', '22 February 2013 (USA)', 5.90000000000000036, 'Bless Me, Ultima', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (51, 'Three friends growing up in India at the turn of the millennium set out to open a training academy to produce the country''s next cricket stars.', '120 min', 'http://ia.media-imdb.com/images/M/MV5BMTgwNTAwMjEzMF5BMl5BanBnXkFtZTcwNzMzODY4OA@@._V1._CR10,12.166671752929688,793,1053.000015258789_SY317_CR12,0,214,317_.jpg', '22 February 2013 (India)', 7.70000000000000018, 'Kai po che!', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (52, 'Sent to the market by his uncle to sell their horse and buy thatch for their roof, Jack meets the beautiful Princess Isabelle whom he rescues her from ruffians. He returns home only with a handful of beans given to him by a monk who claimed they were sacred but that does little to impress his uncle who tosses them away. In the night the Princess arrives having run off to keep from marrying Roderick who is clearly only interested in becoming king. Soon the beans take root with a giant stalk carrying away the princess and Jack''s house. He soon sets off on an adventure with the king''s guards to rescue the princess only to find that a mythical land filled with giants really exists. Written by garykmcd', '114 min', 'http://ia.media-imdb.com/images/M/MV5BMjE1NDMxMjI0OV5BMl5BanBnXkFtZTcwMjQyMDExOQ@@._V1_SX214_.jpg', '1 March 2013 (USA)', 6.29999999999999982, 'Jack the Giant Slayer', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (53, 'When Straight-A college student Jeff Chang''s two best friends take him out for his 21st birthday on the night before an important medical school interview, what was supposed to be a quick beer becomes a night of humiliation, over indulgence and utter debauchery. Written by Relativity', '93 min', 'http://ia.media-imdb.com/images/M/MV5BMjI0NTExOTI0N15BMl5BanBnXkFtZTcwMDA0ODE3OA@@._V1_SX214_.jpg', '1 March 2013 (USA)', 5.70000000000000018, '21 & Over', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (54, 'Seventeen year-old Nell Margaret Sweetzer is found completely insane when trying to explain her possession by the demon called Abalam. After medical and psychological treatment, she is sent to the Deveraux transition house in New Orleans managed by Frank Merle, who helps her to start a new life. She finds a job as a hotel housekeeper, befriends her new roommates, and develops a crush on her coworker, Chris. Soon, Nell comes to realize that she is haunted by people from her cult... and by the same evil force that once possessed her. When Nell meets Miss Cecile, she tells Nell that she has been following her since the hospital. Further, she discloses that she belongs to the sect Order of The Right Hand, and that they can protect her from the evil in an attempt to divert the prophecy of an apocalypse. Will Nell accept help, and be protected from the extremely powerful, evil force Abalam -- Or will she come to accept... herself? Written by Claudio Carvalho, Rio de Janeiro, Brazil', '88 min', 'http://ia.media-imdb.com/images/M/MV5BMTk5MjkxMjUxMF5BMl5BanBnXkFtZTcwODk5ODUwOQ@@._V1_SY317_CR0,0,214,317_.jpg', '1 March 2013 (USA)', 3.89999999999999991, 'The Last Exorcism Part II', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (55, 'India Stoker (Mia Wasikowska) was not prepared to lose her father and best friend Richard (Dermot Mulroney) in a tragic auto accident. The solitude of her woodsy family estate, the peace of her tranquil town, and the unspoken somberness of her home life are suddenly upended by not only this mysterious accident, but by the sudden arrival of her Uncle Charlie (Matthew Goode), whom she never knew existed. When Charlie moves in with her and her emotionally unstable mother Evie (Nicole Kidman), India thinks the void left by her father''s death is finally being filled by his closest bloodline. Soon after his arrival, India comes to suspect that this mysterious, charming man has ulterior motives. Yet instead of feeling outrage or horror, this friendless young woman becomes increasingly infatuated with him. Written by Fox Searchlight Pictures', '99 min', 'http://ia.media-imdb.com/images/M/MV5BMjI3MTM5ODI5MV5BMl5BanBnXkFtZTcwMjE1Mzc4OA@@._V1_SX214_.jpg', '1 March 2013 (UK)', 6.90000000000000036, 'Stoker', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (302, 'A romantic comedy that brings together three disparate characters who are learning to face a challenging and often confusing world as they struggle together against a common demon: sex addiction.', '112 min', 'http://ia.media-imdb.com/images/M/MV5BMjA5MzI3ODcxMF5BMl5BanBnXkFtZTcwODY5MTc4OQ@@._V1_SX214_.jpg', '17 October 2013 (Portugal)', 6.40000000000000036, 'Thanks for Sharing', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (56, '''Ed Harris'' plays the captain of a Cold War Soviet missile submarine who has secretly been suffering from seizures that alter his perception of reality. Forced to leave his wife and daughter, he is rushed into a classified mission, where he is haunted by his past and challenged by a rogue KGB group (led by David Duchovny) bent on seizing control of the ship''s nuclear missile. With the fate of humanity in his hands, Harris discovers he''s been chosen for this mission in the belief he would fail. ''Phantom'' is a suspense submarine thriller about extraordinary men facing impossible choices. Written by RCR Media Group', '98 min', 'http://ia.media-imdb.com/images/M/MV5BMTQ0OTA5MDgzM15BMl5BanBnXkFtZTcwMDM3NTU3OQ@@._V1_SY317_CR5,0,214,317_.jpg', '1 March 2013 (USA)', 5.70000000000000018, 'Phantom', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (57, 'A documentary that investigates incidents of hunger experienced by millions of Americans, and proposed solutions to the problem.', '84 min', 'http://ia.media-imdb.com/images/M/MV5BOTg1NTk5MDU0N15BMl5BanBnXkFtZTcwNzA0ODE4OA@@._V1_SX214_.jpg', '1 March 2013 (USA)', 6.40000000000000036, 'A Place at the Table', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (58, 'When the mother of his infant son unexpectedly passes away, struggling actor Mark grapples with fatherhood and his inability to grow up. And when he sparks with a single mother, he learns how his choices have real-life consequences.', '89 min', 'http://ia.media-imdb.com/images/M/MV5BOTc3MjIyNzI1OV5BMl5BanBnXkFtZTcwMTA5MDY1OA@@._V1_SX214_.jpg', '21 January 2012 (USA)', 5.29999999999999982, 'The End of Love', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (59, 'It''s to music what the bagel is to food - a Jewish staple that has transcended its origins and become a worldwide hit. Bob Dylan sang it. Elvis, too. And that''s only the beginning when it comes to Hava Nagila. Follow the infectious party song on its fascinating journey from the shtetls of Eastern Europe to the cul-de-sacs of America in this hilarious and surprisingly deep film. Featuring interviews with Harry Belafonte, Connie Francis, Glen Campbell, Leonard Nimoy, Regina Spektor and more, HAVA NAGILA (THE MOVIE) takes viewers from Ukraine and Israel to the Catskills, Greenwich Village and Hollywood, using the song as a springboard to explore Jewish history and identity and to spotlight the cross-cultural connections that can only be achieved through music. Written by Anonymous', '75 min', 'http://ia.media-imdb.com/images/M/MV5BMTk2MTc1MTE5N15BMl5BanBnXkFtZTcwNzU4MDg5OA@@._V1_SX214_.jpg', '17 October 2013 (Netherlands)', 3.70000000000000018, 'Hava Nagila: The Movie', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (60, 'As Ishaan, a music producer who has commitment issues with the women in his life, feels a connection with Gauri, his next-door neighbor, he begins to learn the importance of relationships.', '', 'http://ia.media-imdb.com/images/M/MV5BMTkxOTY3NjkxMF5BMl5BanBnXkFtZTcwNzExMzYxOQ@@._V1_SY317_CR2,0,214,317_.jpg', '1 March 2013 (India)', 4.20000000000000018, 'I, Me aur Main', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (61, 'A film about the life and relationships of the early 20th American educator, editor, and journalist Leonie Gilmour, the mother of the acclaimed artist and architect Isamu Noguchi.', '102 min', 'http://ia.media-imdb.com/images/M/MV5BMjI1NTYxMDEwNl5BMl5BanBnXkFtZTcwODgzMDQwOQ@@._V1_SY317_CR4,0,214,317_.jpg', '2012 (USA)', 4.29999999999999982, 'Leonie', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (62, 'Archaeologist Dr. Michael Stone looked for the lost medallion his entire life, and now his son Billy has taken up the search. Amazingly, the medallion ends up in Billy''s hands and a spontaneous wish in a precarious situation takes Billy and his best friend Allie, back 200 years to what they realize is a very different Aumakua Island. When Billy and his friends are not jumping off waterfalls, avoiding animal traps, crossing the ocean, sneaking through caves or escaping a prison they''re facing their nemesis Cobra, who wants nothing more than for them all to disappear. With no other way to get home, and the wellbeing of the entire island resting on his shoulders, Billy must discover the key to reclaiming the medallion and its tremendous power. One way or another, this adventure will change Billy, and life on the island, forever. Written by Anonymous', '97 min', 'http://ia.media-imdb.com/images/M/MV5BNzgyNjQzMjQ5Ml5BMl5BanBnXkFtZTcwODQzNTU3OA@@._V1_SY317_CR12,0,214,317_.jpg', '1 March 2013 (USA)', 4.29999999999999982, 'The Lost Medallion: The Adventures of Billy Stone', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (63, 'Oscar Diggs (James Franco), a small-time circus magician with dubious ethics, is hurled away from dusty Kansas to the vibrant Land of Oz. At first he thinks he''s hit the jackpot-fame and fortune are his for the taking. That all changes, however, when he meets three witches, Theodora (Mila Kunis), Evanora (Rachel Weisz), and Glinda (Michelle Williams), who are not convinced he is the great wizard everyone''s been expecting. Reluctantly drawn into the epic problems facing the Land of Oz and its inhabitants, Oscar must find out who is good and who is evil before it is too late. Putting his magical arts to use through illusion, ingenuity-and even a bit of wizardry-Oscar transforms himself not only into the great and powerful Wizard of Oz but into a better man as well. Written by Walt Disney Studios Motion Pictures', '130 min', 'http://ia.media-imdb.com/images/M/MV5BMjMyMzQ1ODM1MF5BMl5BanBnXkFtZTcwMjE2MTQxOQ@@._V1_SY317_CR0,0,214,317_.jpg', '8 March 2013 (USA)', 6.5, 'Oz the Great and Powerful', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (64, 'Victor, a rising gangland player, has infiltrated the crime empire run by ruthless kingpin Alphonse, with the single purpose of making Alphonse pay for destroying his once happy life. As he meticulously orchestrates his vengeance from his high-rise home, Victor watches and is watched by Beatrice, a mysterious young woman who lives in the apartment across from his. On the surface a fragile woman-child, Beatrice seethes with a rage of her own. When she uncovers Victor''s dark secrets, she threatens to expose him unless he helps her carry out her own campaign of retribution. Each fixated on avenging the past, they devise a violent and cathartic plan that could change their worlds forever. Written by FilmDistrict', '118 min', 'http://ia.media-imdb.com/images/M/MV5BMTM2NTU5NTIzMF5BMl5BanBnXkFtZTcwNjQ3MTM5OA@@._V1_SX214_.jpg', '8 March 2013 (USA)', 6.5, 'Dead Man Down', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (65, 'Alina and Voichita have been friends since their orphanage days. And they have been lovers since they became sexually mature. But despite their oath of mutual fidelity, Alina, who could not bear poverty any more, emigrated to Germany where she became a barmaid. Now she just could not take the estrangement from Voichita and today she is back to Moldavia with a view to taking Voichita along with her to Germany. The only trouble is that in the meantime her girlfriend has betrayed her in falling in love with... God! Voichita indeed now lives in a convent where she plans to make vows. The priest agrees, if somewhat reluctantly, to accommodate Alina before their (hypothetical) departure. He sees all too well that not only is the young woman materialistic but hostile and troublesome as well... Written by Guy Bellinger', '150 min', 'http://ia.media-imdb.com/images/M/MV5BMjIzOTYwNDc4M15BMl5BanBnXkFtZTcwNjU1NzcwOQ@@._V1_SX214_.jpg', '30 May 2013 (Portugal)', 7.5, 'Para Lá das Colinas', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (77, 'Jennifer''s thirtieth birthday party is supposed to be a special day. But what starts out as a day of celebration quickly spirals into a most ill-fated day Jennifer wishes she could forget, in this ensemble comedy set entirely in a kitchen.', '', 'http://ia.media-imdb.com/images/M/MV5BMTA4MTg0Nzk3MjZeQTJeQWpwZ15BbWU3MDc4MzA0MDk@._V1_SX214_.jpg', '14 August 2012 (USA)', 4.79999999999999982, 'The Kitchen', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (376, 'A chronicle of the tragic love affair between American poet Elizabeth Bishop and Brazilian architect Lota de Macedo Soares.', '118 min', 'http://ia.media-imdb.com/images/M/MV5BMzA1Mjk2NDM0MV5BMl5BanBnXkFtZTgwOTQ0OTk1MDE@._V1_SX214_.jpg', '16 August 2013 (Brazil)', 7.29999999999999982, 'Reaching for the Moon', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (66, 'The ABC''s OF DEATH is an ambitious anthology film featuring segments directed by over two dozen of the world''s leading talents in contemporary genre film. Inspired by children''s educational ABC books, the motion picture is comprised of 26 individual chapters, each helmed by a different director assigned a letter of the alphabet. The directors were then given free reign in choosing a word to create a story involving death. Provocative, shocking, funny and ultimately confrontational; THE ABC''s OF DEATH is the definitive snapshot of the diversity of modern horror. Drafthouse Films, Magnet Pictures and Timpson Films are proud to present this alphabetical arsenal of destruction orchestrated by what Fangoria calls "a stunning roll call of some of the most exciting names in horror across the world." Written by Anonymous', '123 min', 'http://ia.media-imdb.com/images/M/MV5BMjIzNTA0OTIxNV5BMl5BanBnXkFtZTcwMzA3MTM2Nw@@._V1_SY317_CR0,0,214,317_.jpg', '26 April 2013 (UK)', 4.79999999999999982, 'The ABCs of Death', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (67, 'Don''t Stop Believin'': Everyman''s Journey follows the real life rock-n-roll fairy tale story of Filipino Arnel Pineda, who was plucked from You Tube to become the front man for iconic American rock band, Journey, thereby becoming the latest performer to go from the Internet to real life celebrity. Having already overcome a life full of painful obstacles and now saddled with the immense pressures of leading a world renowned band and replacing a legendary singer, the film follows Arnel on this personal journey. Written by Anonymous', '113 min', 'http://ia.media-imdb.com/images/M/MV5BMTc3MDU4NTU0OV5BMl5BanBnXkFtZTcwNjg2NDYxOQ@@._V1_SY317_CR0,0,214,317_.jpg', '8 March 2013 (USA)', 6.40000000000000036, 'Don''t Stop Believin'': Everyman''s Journey', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (68, 'A story of love and understanding set amidst the tensions and uncertainties of the days immediately following the Japanese surrender at the end of World War II. On the staff of General Douglas MacArthur (Jones), the de facto ruler of Japan as Supreme Commander of the occupying forces, a leading Japanese expert, General Bonner Fellers (Fox) is charged with reaching a decision of historical importance: should Emperor Hirohito be tried and hanged as a war criminal? Interwoven is the story of Fellers'' love affair with Aya, a Japanese exchange student he had met years previously in the U.S. Memories of Aya and his quest to find her in the ravaged post-war landscape help Fellers to discover both his wisdom and his humanity and enable him to come to the momentous decision that changed the course of history and the future of two nations. Written by Production', '105 min', 'http://ia.media-imdb.com/images/M/MV5BMjI4OTcwMTY3N15BMl5BanBnXkFtZTcwMTI1MzcxOQ@@._V1_SX214_.jpg', '27 June 2013 (Portugal)', 6.29999999999999982, 'Emperor', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (69, '13-year-old Sinikka vanishes on a hot summer night. Her bicycle is found in the exact place where a girl was killed 23 years ago. The dramatic present forces those involved in the original case to face their past.', '118 min', 'http://ia.media-imdb.com/images/M/MV5BMTg4NjUwOTQ1NF5BMl5BanBnXkFtZTcwNTY4MjcxOQ@@._V1_SY317_CR0,0,214,317_.jpg', '9 August 2012 (Portugal)', 6.79999999999999982, 'O Silêncio', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (70, 'Superstar magicians Burt Wonderstone (Steve Carell) and Anton Marvelton (Steve Buscemi) have ruled the Las Vegas Strip for years, raking in millions with illusions as big as Burt''s growing ego. But lately the duo''s greatest deception is their public friendship, while secretly they''ve grown to loathe each other. Facing cutthroat competition from guerrilla street magician Steve Gray (Jim Carrey), whose cult following surges with each outrageous stunt, even their show is starting to look stale. But there''s still a chance Burt and Anton can save the act - both onstage and off - if only Burt can get back in touch with what made him love magic in the first place. Written by stefanstojkov', '100 min', 'http://ia.media-imdb.com/images/M/MV5BMTk3MDkxMDAyN15BMl5BanBnXkFtZTcwODY5NzQyOQ@@._V1_SX214_.jpg', '15 March 2013 (USA)', 5.90000000000000036, 'The Incredible Burt Wonderstone', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (71, 'Jordan Turner (Halle Berry) is an experienced 911 operator but when she makes an error in judgment and a call ends badly, Jordan is rattled and unsure if she can continue. But then teenager Casey Welson (Abigail Breslin) is abducted in the back of a man''s car and calls 911. And Jordan is the one called upon to use all of her experience, insights and quick thinking to help Casey escape, and not just to save Casey, but to make sure the man is brought to justice. Written by napierslogs', '94 min', 'http://ia.media-imdb.com/images/M/MV5BMjExNDkzNjAwOV5BMl5BanBnXkFtZTcwMDMzMzQwOQ@@._V1_SX214_.jpg', '15 March 2013 (USA)', 6.59999999999999964, 'The Call', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (72, 'London, 1962. Two teenage girls - Ginger and Rosa -- are inseparable; they play truant together, discuss religion, politics and hairstyles, and dream of lives bigger than their mothers'' frustrated domesticity. But, as the Cold War meets the sexual revolution, and the threat of nuclear holocaust escalates, the lifelong friendship of the two girls is shattered - by the clash of desire and the determination to survive. Written by Adventure Pictures', '90 min', 'http://ia.media-imdb.com/images/M/MV5BMTk4NjcwMzU3OV5BMl5BanBnXkFtZTcwNTUwOTQ3OA@@._V1_SY317_CR10,0,214,317_.jpg', '19 October 2012 (UK)', 6, 'Ginger & Rosa', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (73, 'A group of Yokohama teens look to save their school''s clubhouse from the wrecking ball in preparations for the 1964 Tokyo Olympics.', '91 min', 'http://ia.media-imdb.com/images/M/MV5BMjMzMzM2NTM2NV5BMl5BanBnXkFtZTcwNTk4OTYwOQ@@._V1_SX214_.jpg', '16 July 2011 (Japan)', 7.20000000000000018, 'From Up on Poppy Hill', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (74, 'Adam is a seemingly ordinary guy in a very extraordinary universe. He lives humbly trying to make ends meet, but his romantic spirit holds on to the memory of a girl he loved once upon a time from another world, an inverted affluent world with its own gravity, directly above but beyond reach... a girl named Eden. Their childhood flirtation becomes an impossible love. But when he catches a glimpse of grownup Eden on television, nothing will get in the way of getting her back... Not even the law or science! Written by Onyx Films', '100 min', 'http://ia.media-imdb.com/images/M/MV5BMTgzNzM4ODMwNV5BMl5BanBnXkFtZTcwNDU1MzEwOQ@@._V1_SX214_.jpg', '1 May 2013 (France)', 6.29999999999999982, 'Upside Down', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (75, 'Luciano is a Neapolitan fishmonger who supplements his modest income by pulling off little scams together with his wife Maria. A likeable, entertaining guy, Luciano never misses an opportunity to perform for his customers and countless relatives. One day his family urge him to try out for Big Brother. In chasing this dream his perception of reality begins to change. Written by lletaif', '116 min', 'http://ia.media-imdb.com/images/M/MV5BMjA0MTU4OTc2OV5BMl5BanBnXkFtZTcwNDU5NzQwOQ@@._V1_SX214_.jpg', '17 January 2013 (Portugal)', 6.5, 'Reality', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (76, 'Brit, Candy, Cotty, and Faith have been best friends since grade school. They live together in a boring college dorm and are hungry for adventure. All they have to do is save enough money for spring break to get their shot at having some real fun. A serendipitous encounter with rapper "Alien" promises to provide the girls with all the thrill and excitement they could hope for. With the encouragement of their new friend, it soon becomes unclear how far the girls are willing to go to experience a spring break they will never forget. Written by Muse Productions', '94 min', 'http://ia.media-imdb.com/images/M/MV5BNDE3MDQzMDA5OF5BMl5BanBnXkFtZTcwMTUxNTgxOQ@@._V1_SX214_.jpg', '22 March 2013 (USA)', 5.40000000000000036, 'Spring Breakers', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (78, 'Hip Hop legend Snoop Dogg teamed up with VICE on a spiritual journey to Jamaica to reflect on his past career, including his failures, loves, regrets and losses. With this journey, Snoop intends to reincarnate himself as a Pop Reggae artist by immersing himself in Rastafari, exploring musical and religious histories deeply rooted in Jamaica His pilgrimage begins with a jaunt to a mountain-side ganja farm run by Rastas, revealing the underbelly of the Jamaican drug market. Snoop then heads down to the troubled areas of Trenchtown and Tivoli Gardens; revealing a neglected ghetto population and rampant police brutality following the exile of drug lord Chris "Coke" Dudus. Snoop also stops by the famous Alpha Boys School for an impromptu jam session. A school which has seen countless Reggae musicians pass through its youth orchestra. Snoop allows unprecedented access to his inner-workings as he makes his new album with Diplo and Angela Hunte, author of the smash hit song Empire State Of ... Written by VICE Staff', '96 min', 'http://ia.media-imdb.com/images/M/MV5BMTUxNDgzNDY2OV5BMl5BanBnXkFtZTcwMzE4MTMyOQ@@._V1_SY317_CR0,0,214,317_.jpg', '22 March 2013 (UK)', 5.70000000000000018, 'Reincarnated', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (79, 'K-11 follows Raymond Saxx Jr. (Goran Visnjic), a powerful record producer who wakes from a drug-induced blackout to find himself locked up and classified "K-11." Plunged into a nightmarish world ruled by a transsexual diva named Mousey (Kate del Castillo), Raymond is truly a fish out of water. Complicating matters are a troubled young transgender named Butterfly (Portia Doubleday), a predatory child molester (Tommy ''Tiny'' Lister) and the ruthless Sheriff''s Deputy, Lt. Johnson (D.B. Sweeney). Ray''s struggle to contact the outside world and regain his freedom seems impossible, but he must learn to navigate this new power structure if he is ever going survive and be in control of his life again. Written by Libertine Films', '88 min', 'http://ia.media-imdb.com/images/M/MV5BMjE1MjI0NDgwMV5BMl5BanBnXkFtZTcwODc5NDcxOQ@@._V1_SY317_CR2,0,214,317_.jpg', '15 March 2013 (USA)', 4.20000000000000018, 'K-11', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (80, 'Teen r&b/hip-hop boy band ''Mindless Behavior'' has been stirring up a frenzy wherever they go, singing and dancing their way into the hearts of millions as they travel across the US on their first major headlining tour. Coming from humble roots and rising to super stardom, Roc Royal, Ray Ray, Princeton and Prodigy hit the road for the biggest tour of their lives. From their early aspirations of becoming stars to fulfilling their wildest dreams, this concert documentary captures the movement that is ''Mindless Behavior,'' which reminds us all that with hard. Written by AwesomenessTV', '86 min', 'http://ia.media-imdb.com/images/M/MV5BMTYwNDU3MDE5N15BMl5BanBnXkFtZTcwMzI0NzcxOQ@@._V1_SY317_CR7,0,214,317_.jpg', '15 March 2013 (USA)', 4.09999999999999964, 'Mindless Behavior: All Around the World', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (81, 'When the White House (Secret Service Code: "Olympus") is captured by a terrorist mastermind and the President is kidnapped, disgraced former Presidential Secret Service Agent Mike Banning finds himself trapped within the building. As our national security team scrambles to respond, they are forced to rely on Banning''s inside knowledge to help retake the White House, save the President and avert an even bigger disaster. Written by FilmDistrict', '119 min', 'http://ia.media-imdb.com/images/M/MV5BMTkxNjIyNjE5OF5BMl5BanBnXkFtZTcwMTI3NzkxOQ@@._V1_SX214_.jpg', '22 March 2013 (USA)', 6.40000000000000036, 'Olympus Has Fallen', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (82, 'The Croods is a prehistoric comedy adventure that follows the world''s first family as they embark on a journey of a lifetime when the cave that has always shielded them from danger is destroyed. Traveling across a spectacular landscape, the Croods discover an incredible new world filled with fantastic creatures -- and their outlook is changed forever. Written by DreamWorks Animation', '98 min', 'http://ia.media-imdb.com/images/M/MV5BMTcyOTc2OTA1Ml5BMl5BanBnXkFtZTcwOTI1MjkzOQ@@._V1_SY317_CR0,0,214,317_.jpg', '22 March 2013 (USA)', 7.29999999999999982, 'The Croods', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (83, 'Straitlaced Princeton University admissions officer Portia Nathan (Tina Fey) is caught off-guard when she makes a recruiting visit to an alternative high school overseen by her former college classmate, the freewheeling John Pressman (Paul Rudd). Pressman has surmised that Jeremiah (Nat Wolff), his gifted yet very unconventional student, might well be the son that Portia secretly gave up for adoption many years ago. Soon, Portia finds herself bending the rules for Jeremiah, putting at risk the life she thought she always wanted -- but in the process finding her way to a surprising and exhilarating life and romance she never dreamed of having. Written by Focus Features', '107 min', 'http://ia.media-imdb.com/images/M/MV5BOTE2OTkwNzg5Ml5BMl5BanBnXkFtZTcwOTY0NzQ3OA@@._V1_SX214_.jpg', '22 March 2013 (USA)', 5.59999999999999964, 'Admission', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (84, '1968 was the year that changed the world. And for four young Aboriginal sisters from a remote mission this is the year that would change their lives forever. Around the globe, there was protest and revolution in the streets. Indigenous Australians finally secured the right to vote. There were drugs and the shock of a brutal assassination. And there was Vietnam. The sisters, Cynthia, Gail, Julie and Kay are discovered by Dave, a talent scout with a kind heart, very little rhythm but a great knowledge of soul music. Billed as Australia''s answer to ''The Supremes'', Dave secures the sisters their first true gig, and flies them to Vietnam to sing for the American troops. Based on a true story, THE SAPPHIRES is a triumphant celebration of youthful emotion, family and music. Written by Goalpost Pictures', '103 min', 'http://ia.media-imdb.com/images/M/MV5BMTQyNTk5MDk1OF5BMl5BanBnXkFtZTcwNjgyODYxOQ@@._V1_SX214_.jpg', '9 August 2012 (Australia)', 6.90000000000000036, 'The Sapphires', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (85, 'At 42, David lives the life of an irresponsible adolescent. He coasts through life with minimal effort and maintains a complicated relationship with Valerie, a young policewoman. Just as she tells him she''s pregnant, David''s past resurfaces. Twenty years earlier, he began providing sperm to a fertility clinic in exchange for money. He discovers he''s the father of 533 children, 142 of whom have filed a class action lawsuit to determine the identity of their biological father, known only by the pseudonym Starbuck. Written by Anonymous', '109 min', 'http://ia.media-imdb.com/images/M/MV5BMjMyMDczMzU1OV5BMl5BanBnXkFtZTcwMzMwNzk1OA@@._V1_SX214_.jpg', '3 May 2012 (New Zealand)', 7.20000000000000018, 'Starbuck', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (86, 'When a rival gang buffs Malcolm and Sofia''s latest graffiti masterpiece with a replica of the NY Mets home-run apple, they''re determined to get spectacular revenge - by tagging the real Mets'' apple. Over the course of a whirlwind two-day heat wave, these tough teens from the Bronx must hustle, scramble, and steal to execute the scheme that will make them the most famous writers in New York. Written by Anonymous', '81 min', 'http://ia.media-imdb.com/images/M/MV5BNTMyNTY1NTQ2OF5BMl5BanBnXkFtZTcwOTU3ODQxOQ@@._V1_SY317_CR0,0,214,317_.jpg', '2 January 2013 (France)', 6.40000000000000036, 'Gimme the Loot', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (87, 'When a young soldier in Vietnam gets dumped by his hometown girl, he and his best friend decide to go AWOL and return to the States to win her back.', '100 min', 'http://ia.media-imdb.com/images/M/MV5BMTgzOTg1MzI4MV5BMl5BanBnXkFtZTcwOTkwOTcxOQ@@._V1_SY317_CR0,0,214,317_.jpg', '22 March 2013 (USA)', 5.40000000000000036, 'Love and Honor', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (88, 'While mapping out the largest cave system in Ukraine, explorer and investigator Chris Nicola discovers evidence that five Jewish families spent nearly a year and a half in the pitch-black caves to escape the Nazis. This is the story of the longest uninterrupted underground survival in recorded human history. Written by History Channel', '83 min', 'http://ia.media-imdb.com/images/M/MV5BMjExMzgzNjU4NF5BMl5BanBnXkFtZTcwMzkzMzgxOQ@@._V1_SX214_.jpg', '9 May 2013 (Germany)', 6.29999999999999982, 'No Place on Earth', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (89, 'Mo is a young boy growing up in a traditional Egyptian household, but beyond the front door of the family''s modest London flat is a completely different world - the streets of Hackney. The impressionable Mo idolizes his handsome older brother Rashid and wants to follow is his footsteps. However, Rashid, a charismatic and shrewd member of a local gang, wants a different life for his little brother and deals drugs hoping to put Mo through college. One eventful summer, Rashid''s sexual awakening forces Mo to confront his own fears and phobias and threatens to tear the brothers apart. Written by Anonymous', '111 min', 'http://ia.media-imdb.com/images/M/MV5BMTc5MzE0MTI1N15BMl5BanBnXkFtZTcwMjcwMzYyOQ@@._V1_SX214_.jpg', '9 November 2012 (UK)', 6.20000000000000018, 'My Brother the Devil', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (90, 'In the heat of the summer of 1976, keen drama teacher Vivienne fights sweltering heat and general teenage apathy to put on an end of year music version of Shakespeare''s The Tempest. To engage her students, she uses hits of the time, which will be performed by a fresh young cast led by rising star Aneurin Barnard. Written by Websurfer', '110 min', 'http://ia.media-imdb.com/images/M/MV5BMTA0MjQ4MDAzMTdeQTJeQWpwZ15BbWU3MDgzMDkzMTk@._V1_SX214_.jpg', '22 March 2013 (USA)', 5.40000000000000036, 'Hunky Dory', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (91, 'Beth (Vinessa Shaw) and Francis (Ebon Moss-Bachrach), a young married couple, are on holiday together when they venture to a beautiful, but highly remote, island. Beth is pregnant and the two are hoping to enjoy their last vacation before their baby is born. When they arrive, they notice that while there are plenty of children present, the adults all seem to be missing. Initially attributing this to the after effects of a recent festival, they quickly realize something far more sinister is afoot. The two will face terror and unsettling difficult decisions in their quest to make it off the island alive. Written by Anonymous', '87 min', 'http://ia.media-imdb.com/images/M/MV5BMjEzNjIwMTcwNF5BMl5BanBnXkFtZTcwMTQ1ODIxOQ@@._V1_SX214_.jpg', '22 March 2013 (USA)', 4.59999999999999964, 'Come Out and Play', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (92, 'In this comedy film, a computer tablet full of the world''s most hilariously offensive apps breaks through the borders of political correctness, stirring up cultural anarchy.', '', 'http://ia.media-imdb.com/images/M/MV5BMTQ3NzAyMDUyOF5BMl5BanBnXkFtZTcwMDMzMDM5OA@@._V1_SY317_CR0,0,214,317_.jpg', '22 March 2013 (USA)', 2.89999999999999991, 'InAPPropriate Comedy', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (93, 'A documentary based on the honor, courage and commitment of Navy SEAL LT Michael P. Murphy, who gave his life for his men in 2005 and was posthumously awarded the Medal of Honor in 2007.', '79 min', 'http://ia.media-imdb.com/images/M/MV5BMTkzODAwNTc4MV5BMl5BanBnXkFtZTcwMDM1MTAyOQ@@._V1_SX214_.jpg', '22 March 2013 (USA)', 3.70000000000000018, 'Murph: The Protector', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (94, 'A poet who starts a health-conscious food stand finds support from his friends, as well as a potential love match with one of his customers. But will unexpected complications jeopardize his dreams of a hot dog-free future?', '85 min', 'http://ia.media-imdb.com/images/M/MV5BMTgwMjg0Njk4NF5BMl5BanBnXkFtZTcwMjk4MDcyOQ@@._V1_SY317_CR3,0,214,317_.jpg', '17 September 2010 (USA)', 5.59999999999999964, 'The Happy Poet', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (95, 'Framed for crimes against the country, the G.I. Joe team is terminated by the President''s order, and the surviving team members face off against Zartan, his accomplices, and the world leaders he has under his influence. Written by Anonymous', '110 min', 'http://ia.media-imdb.com/images/M/MV5BNzk5ODM0OTQ0N15BMl5BanBnXkFtZTcwODg2ODE4OA@@._V1_SX214_.jpg', '28 March 2013 (USA)', 5.79999999999999982, 'G.I. Joe: Retaliation', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (96, 'A race of aliens who are non corporeal go from planet to planet looking for hosts. They come to Earth and basically take over human bodies. Now it''s believed that once they take over a body all memories of the previous inhabitant are gone. And there are some humans who have remain hidden from them and are basically a resistance movement. So an alien charged with locating them known as the Seeker captures one of them a girl named Melanie and puts one of them who is known as Wanderer in her body, in hopes of finding out where the humans are. But Melanie for some reason is still there and she convinces Wanderer not to say anything to Seeker. Wanderer feels empathy for the humans. When Seeker is disappointed at her lack of progress, she informs Wanderer that she''ll be removed and placed in a new host and she will be placed in Melanie. Melanie knowing she can''t convince her the way she convinced Wanderer convinces Wsnderer to run away and they can meet with the humans. Eventually they find... Written by rcs0411@yahoo.com', '125 min', 'http://ia.media-imdb.com/images/M/MV5BMjMwNDg1MTAzNV5BMl5BanBnXkFtZTcwNTk5ODI3OA@@._V1_SX214_.jpg', '29 March 2013 (USA)', 5.70000000000000018, 'The Host', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (97, 'An ambitious married woman''s temptation by a handsome billionaire leads to betrayal, recklessness, and forever alters the course of her life.', '111 min', 'http://ia.media-imdb.com/images/M/MV5BMTg3MzExNjU1N15BMl5BanBnXkFtZTcwMzk0ODU5OA@@._V1_SX214_.jpg', '29 March 2013 (USA)', 4.20000000000000018, 'Temptation: Confessions of a Marriage Counselor', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (98, 'A mysterious and mythical motorcycle racer, Luke, (Ryan Gosling) drives out of a traveling carnival globe of death and whizzes through the backstreets of Schenectady, New York, desperately trying to connect with a former lover, Romina, (Eva Mendes) who recently and secretly gave birth to the stunt rider''s son. In an attempt to provide for his new family, Luke quits the carnival life and commits a series of bank robberies aided by his superior riding ability. The stakes rise as Luke is put on a collision course with an ambitious police officer, Avery Cross, (Bradley Cooper) looking to quickly move up the ranks in a police department riddled with corruption. The sweeping drama unfolds over fifteen years as the sins of the past haunt the present days lives of two high school boys wrestling with the legacy they''ve inherited. The only refuge is found in the place beyond the pines. Written by StudioCanal', '140 min', 'http://ia.media-imdb.com/images/M/MV5BMjc1OTEwNjU4N15BMl5BanBnXkFtZTcwNzUzNDIwOQ@@._V1_SX214_.jpg', '19 April 2013 (USA)', 7.40000000000000036, 'The Place Beyond the Pines', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (99, 'A subjective documentary that explores the numerous theories about the hidden meanings within ''Stanley Kubrick (I)'' ''s Kubrick'' ''s film The Shining. The film may be over 30 years old but it continues to inspire debate, speculation, and mystery. Five very different points of view are illuminated through voice over, film clips, animation and dramatic reenactments. Together they''ll draw the audience into a new maze, one with endless detours and dead ends, many ways in, but no way out. Written by Anonymous', '102 min', 'http://ia.media-imdb.com/images/M/MV5BMzQyMjgzNzAwNl5BMl5BanBnXkFtZTcwODI0NjIzNw@@._V1_SX214_.jpg', '26 October 2012 (UK)', 6.40000000000000036, 'Room 237', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (303, 'A cocky young man travels to Oregon to work on an apple farm. Out of his element, he finds his lifestyle and notions being picked apart by everyone who crosses his path.', '88 min', 'http://ia.media-imdb.com/images/M/MV5BMTExODkwNTAzODBeQTJeQWpwZ15BbWU3MDAzNzE4OTk@._V1_SY317_CR2,0,214,317_.jpg', '20 January 2013 (USA)', 5.09999999999999964, 'C.O.G.', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (100, 'Former criminal Jacob Sternwood is forced to return to London from his Icelandic hideaway when his son is involved in a heist gone wrong. This gives detective Max Lewinsky one last chance to catch the man he has always been after. As they face off, they start to uncover a deeper conspiracy they both need to solve in order to survive. Written by Anonymous', '99 min', 'http://ia.media-imdb.com/images/M/MV5BODkwNjY1MjUzOF5BMl5BanBnXkFtZTcwOTU0NDAyOQ@@._V1_SX214_.jpg', '4 April 2013 (Portugal)', 6.09999999999999964, 'Welcome to the Punch', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (101, 'Dolph Springer wakes up one morning to realize he has lost the love of his life, his dog, Paul. During his quest to get Paul (and his life) back, Dolph radically changes the lives of others: a pizza-delivering nymphomaniac, a jogging-addict neighbor in search of completeness, an opportunistic French-Mexican gardener, and an off-kilter pet detective. In his journey to find Paul, Dolph may lose something even more vital: his mind. Written by Realitism Films', '94 min', 'http://ia.media-imdb.com/images/M/MV5BODM5NzYyMTIyN15BMl5BanBnXkFtZTcwODM3MDQ5OA@@._V1_SY317_CR2,0,214,317_.jpg', '1 February 2013 (USA)', 6, 'Wrong', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (102, 'An honest temple priest takes on more than he can handle when he bears witness to a murder and gives evidence in a court of law against a powerful landlord in his village. The landlord bribes his way to freedom and engineers a ploy to ruin the priests reputation and his status among his peers in the village. Ashamed of his tarnished reputation the priest commits suicide,and leaves his wife and young children to face the atrocities of the evil landlord. The son flees the village and travels to Mumbai to make a life, but returns years later to avenge the shame caused to his family. Thi Written by UTV Motion Pictures', '150 min', 'http://ia.media-imdb.com/images/M/MV5BMTM4MTYwNDA0NF5BMl5BanBnXkFtZTcwNjE0MjQyOQ@@._V1_SY317_CR3,0,214,317_.jpg', '29 March 2013 (USA)', 2.29999999999999982, 'Himmatwala', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (103, 'The Moochmore girls are certain they all suffer from some kind of undiagnosed mental illness - because if they''re not crazy then they''re just unpopular. Their mother Shirley - unable to cope with her demanding daughters and unsupported by her philandering politician husband, Barry - suffers a nervous breakdown. After Barry commits his wife to a mental hospital (telling his constituents that "she''s on holiday") he finds himself alone with 5 teenage girls he barely knows. Desperate, he impulsively picks up a hitchhiker named Shaz and installs her in his home as nanny to his daughters. Written by Caitlin Rose', '116 min', 'http://ia.media-imdb.com/images/M/MV5BMTc1NjQ1OTA1NF5BMl5BanBnXkFtZTcwMTk0NzcwOQ@@._V1_SX214_.jpg', '29 March 2013 (USA)', 5.79999999999999982, 'Mental', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (104, 'A band of bullfighting dwarfs save the life of a young woman with amnesia. They end up taking her under their wing when they find out that she has seemingly natural skills as a bullfighter, upon which they can capitalize not only for their act but for her own personal gain. As she does not know her name or background, the dwarfs coin her Blancanieves, after the famed fairy tale. What they are all unaware of is that she is really Carmen, the daughter of the once great matador, Antonio Villalta. On the day Carmen was born, her father suffered a career ending accident, and her mother died in childbirth. Her father quickly remarried his nurse, the evil Encarna. Although raised by her grandmother during her early years, Carmen, following the death of her grandmother, went to live with Encarna while an adolescent, Encarna who treated her as a slave. Carmen eventually found her disabled father, who was hidden away and treated poorly by Encarna. In the meantime, Encarna was cavorting with the... Written by Huggo', '104 min', 'http://ia.media-imdb.com/images/M/MV5BMjIyNjY2MTgxMF5BMl5BanBnXkFtZTcwODg2Njk1OA@@._V1_SY317_CR4,0,214,317_.jpg', '7 March 2013 (Portugal)', 7.40000000000000036, 'Branca de Neve', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (105, 'Five twenty-something friends become holed up in a remote cabin. When they discover a Book of the Dead, they unwittingly summon up dormant demons living in the nearby woods, which possess the youngsters in succession until only one is left intact to fight for survival. Written by Sony Pictures Entertainment', '91 min', 'http://ia.media-imdb.com/images/M/MV5BNTQ3OTkwNTgyN15BMl5BanBnXkFtZTcwNTAzOTAzOQ@@._V1_SX214_.jpg', '5 April 2013 (USA)', 6.5, 'Evil Dead', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (106, 'Huge advancements in scientific technology have enabled a mogul to create an island full of living dinosaurs. John Hammond has invited four individuals, along with his two grandchildren, to join him at Jurassic Park. But will everything go to plan? Especially when one of the parks'' own workers attempts to steal the dinosaur embryos, and has to shut down critical security systems in the process. It''s now a race for survival with dangerous creatures roaming all over the island. Written by Film_Fan', '127 min', 'http://ia.media-imdb.com/images/M/MV5BMjQzODQyMzk2Nl5BMl5BanBnXkFtZTcwNTg4MjQ3OA@@._V1_SX214_.jpg', '11 June 1993 (USA)', 8, 'Jurassic Park', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (107, 'A fine art auctioneer mixed up with a gang joins forces with a hypnotherapist to recover a lost painting. As boundaries between desire, reality and hypnotic suggestion begin to blur the stakes rise faster than anyone could have anticipated. Written by Fox Searchlight', '101 min', 'http://ia.media-imdb.com/images/M/MV5BMjMzNjU1MTg5NF5BMl5BanBnXkFtZTcwMTExMTcwOQ@@._V1_SX214_.jpg', '25 April 2013 (Portugal)', 6.90000000000000036, 'Trance', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (108, 'After years in hiding, ex-Weather Underground militant, Nick Sloan aka Jim Grant, learns about his old compatriot''s arrest for a bank robbery turned deadly in the 1970s, which he is wanted as an accomplice. This puts the ambitious young local reporter, Ben Shepard, on the scent of a story that exposes Nick as well. As such, Nick goes on the run while taking his daughter to safety. With that accomplished, Nick stays one step ahead of the FBI while pursuing a faint hope to clear his name. Meanwhile, Shepard digs deeper into the case himself as he discovers the true complexities of another times'' determined ideals even as Nick faces their consequences with another. Written by Kenneth Chisholm (kchishol@rogers.com)', '121 min', 'http://ia.media-imdb.com/images/M/MV5BMTQ0NDQxOTY3M15BMl5BanBnXkFtZTcwNTE0MTExOQ@@._V1_SY317_CR0,0,214,317_.jpg', '11 April 2013 (Portugal)', 6.29999999999999982, 'The Company You Keep', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (109, 'Recently heartbroken, Simon travels to Paris to clear his head. After several days of wandering aimlessly, Simon finds himself drawn into a sex parlor and has a sexual encounter with an exotic prostitute, Victoria. The chemistry builds between the two until they find themselves in a serious relationship, one that leads to blackmail, betrayal and the ultimate revelation of Simon''s true nature. Written by IFC Films', '101 min', 'http://ia.media-imdb.com/images/M/MV5BMTM4MzU2ODMxNV5BMl5BanBnXkFtZTcwNDk1MDE3OA@@._V1_SX214_.jpg', '12 April 2013 (USA)', 6, 'Simon Killer', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (110, 'A man and woman are drawn together, entangled in the life cycle of an ageless organism. Identity becomes an illusion as they struggle to assemble the loose fragments of wrecked lives.', '96 min', 'http://ia.media-imdb.com/images/M/MV5BMTQzMzQ4MDAyNF5BMl5BanBnXkFtZTcwNzE0MDk3OA@@._V1_SX214_.jpg', '30 August 2013 (UK)', 6.79999999999999982, 'Upstream Color', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (111, 'A documentary that chronicles the life of young college professor Angela Davis, and how her social activism implicates her in a botched kidnapping attempt that ends with a shootout, four dead, and her name on the FBI''s 10 most wanted list.', '102 min', 'http://ia.media-imdb.com/images/M/MV5BMTY1ODk4MDk2M15BMl5BanBnXkFtZTcwMzYyOTUwOQ@@._V1_SY317_CR0,0,214,317_.jpg', '5 April 2013 (USA)', 5.90000000000000036, 'Free Angela and All Political Prisoners', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (112, 'Based on the comic book series "The Brass Teapot" about mid-twenty year old couple who, in these difficult economic times, finds a mysterious, magical brass teapot which makes them money but at a surprising price. After realizing the teapots powers, John and Alice must decide how far they will go to fulfill their dream. Written by Anonymous', '101 min', 'http://ia.media-imdb.com/images/M/MV5BMTEyNDIxOTE3NDheQTJeQWpwZ15BbWU3MDI0ODE5OTg@._V1_SX214_.jpg', '15 April 2013 (USA)', 6.20000000000000018, 'The Brass Teapot', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (113, 'Lars Olafssen, once a young celebrity in the art world is slipping away fast into the land of has-beens. His long-time art dealer, Ronny, is now an ungracefully aging hipster who desperately wants his meal ticket back. But Lars refuses to paint. His creativity comes at too high a cost - his inspiration is carnage - blood, guts and limbs. Not surprisingly, this lead to a dreadful breakdown in the past. Nevertheless, an eager Ronny arranges a teaching job for Lars at an art school in Koda Lake, a small Canadian town in the middle of nowhere. It''s a "therapeutic" measure for Lars - a means to conquer his need to paint in the "safety" of a country retreat... That is, until Eddie comes into his life. Written by dobbinnian / rodriguez', '90 min', 'http://ia.media-imdb.com/images/M/MV5BMTcwMDA3NTUxM15BMl5BanBnXkFtZTcwNTQ0MDMzOQ@@._V1_SY317_CR1,0,214,317_.jpg', '5 April 2013 (USA)', 5.5, 'Eddie', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (114, 'After the death of her husband, Dr. Cara Harding''s faith in God has been shaken, but not her belief in science. In an attempt to get her more open to accepting unexplainable psychiatric theories, her father introduces her to Adam, a patient with multiple personalities who also takes on some of the physical characteristics of his other personalities. But Cara quickly discovers that his other personalities were murder victims and the more she finds out about Adam and his past, the closer she and her loved ones are to becoming murder victims themselves. Written by napierslogs', '112 min', 'http://ia.media-imdb.com/images/M/MV5BMTM3Njk3ODA2M15BMl5BanBnXkFtZTcwNzUzOTMxOQ@@._V1_SX214_.jpg', '1 March 2013 (USA)', 6, '6 Souls', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (115, 'In 1946, Jackie Robinson is a Negro League baseball player who never takes racism lying down. Branch Rickey is a Major League team executive with a bold idea. To that end, Rickey recruits Robinson to break the unspoken color line as the first modern African American Major League player. As both anticipate, this proves a major challenge for Robinson and his family as they endure unrelenting racist hostility on and off the field, from player and fan alike. As Jackie struggles against his nature to endure such abuse without complaint, he finds allies and hope where he least expects it. Written by Kenneth Chisholm (kchishol@rogers.com)', '128 min', 'http://ia.media-imdb.com/images/M/MV5BMTQwMDU4MDI3MV5BMl5BanBnXkFtZTcwMjU1NDgyOQ@@._V1_SX214_.jpg', '12 April 2013 (USA)', 7.5, '42', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (116, 'Happily-married couple Dan and Jody begin to notice some bizarre activity once they bring their lost nieces and nephew home. But when the chaos expands into Jody''s job as a ballet dancer and Dan''s career as an Ape researcher, they realize their family is being stalked by a nefarious demon. Together, with the advice of a psychic and the aid of numerous surveillance cameras, they must figure out how to get rid of it before it''s too late. Written by Dimension Films', '86 min', 'http://ia.media-imdb.com/images/M/MV5BMTc5OTIxMjQ4NF5BMl5BanBnXkFtZTcwOTAyNDcyOQ@@._V1_SY317_CR0,0,214,317_.jpg', '12 April 2013 (USA)', 3.39999999999999991, 'Scary MoVie', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (117, 'Neil (Ben Affleck) is an American traveling in Europe who meets and falls in love with Marina (Olga Kurylenko), an Ukrainian divorcée who is raising her 10-year-old daughter Tatiana in Paris. The lovers travel to Mont St. Michel, the island abbey off the coast of Normandy, basking in the wonder of their newfound romance. Neil makes a commitment to Marina, inviting her to relocate to his native Oklahoma with Tatiana. He takes a job as an environmental inspector and Marina settles into her new life in America with passion and vigor. After a holding pattern, their relationship cools. Marina finds solace in the company of another exile, the Catholic priest Father Quintana (Javier Bardem), who is undergoing a crisis of faith. Work pressures and increasing doubt pull Neil further apart from Marina, who returns to France with Tatiana when her visa expires. Neil reconnects with Jane (Rachel McAdams), an old flame. They fall in love until Neil learns that Marina has fallen on hard times. ... Written by Magnolia Pictures', '112 min', 'http://ia.media-imdb.com/images/M/MV5BMTAwNzk1NjM2ODZeQTJeQWpwZ15BbWU3MDE1MjQwMjk@._V1_SX214_.jpg', '9 May 2013 (Portugal)', 6.09999999999999964, 'To the Wonder', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (118, 'Syd March is an employee at a clinic that sells injections of live viruses harvested from sick celebrities to obsessed fans. Biological communion - for a price. Syd also supplies illegal samples of these viruses to piracy groups, smuggling them from the clinic in his own body. When he becomes infected with the disease that kills super sensation Hannah Geist, Syd becomes a target for collectors and rabid fans. He must unravel the mystery surrounding her death before he suffers the same fate. Written by Rhombus Media', '108 min', 'http://ia.media-imdb.com/images/M/MV5BNjI5MzY0OTgwMF5BMl5BanBnXkFtZTcwNzQ1MzAzOQ@@._V1_SX214_.jpg', '30 November 2012 (Iceland)', 5.5, 'Antiviral', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (119, 'Eight friends meet for their monthly couples brunch. But what starts as an impromptu therapy session/airing of domestic grievances takes a sudden, catastrophic turn when the city falls victim to a mysterious attack. Trapped in the house and unsure of their fates, these seemingly normal people become increasingly unhinged to surprising results. Written by Oscilloscope Pictures', '88 min', 'http://ia.media-imdb.com/images/M/MV5BMTQwNjYzMTQ0Ml5BMl5BanBnXkFtZTcwNDUzODM5Nw@@._V1_SX214_.jpg', '7 June 2013 (Poland)', 6.40000000000000036, 'It''s a Disaster', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (120, 'This bitter sweet comedy follows protagonist Robbie as he sneaks into the maternity hospital to visit his young girlfriend Leonie and hold his newborn son Luke for the first time. Overwhelmed by the moment, he swears that Luke will not have the same tragic life he has had. Escaping a prison sentence by the skin of his teeth, he''s given one last chance......While serving a community service order, he meets Rhino, Albert and Mo who, like him, find it impossible to find work because of their criminal records. Little did Robbie imagine how turning to drink might change their lives - not cheap fortified wine, but the best malt whiskies in the world. Will it be ''slopping out'' for the next twenty years, or a new future with ''Uisge Beatha'' the ''Water of Life?'' Only the angels know........ Written by Rebecca O''Brien, producer', '101 min', 'http://ia.media-imdb.com/images/M/MV5BNzQ0MTg1MzI0Ml5BMl5BanBnXkFtZTcwNDA0MTcyOQ@@._V1_SY317_CR6,0,214,317_.jpg', '3 October 2013 (Portugal)', 7, 'The Angels'' Share', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (121, 'A hard-working lawyer, attached to his cell phone, can''t find the time to communicate with his family. A couple is drawn into a dangerous situation when their secrets are exposed online. A widowed ex-cop struggles to raise a mischievous son who cyber-bullies a classmate. An ambitious journalist sees a career-making story in a teen that performs on an adult-only site. They are strangers, neighbors and colleagues and their stories collide in this riveting dramatic thriller about ordinary people struggling to connect in today''s wired world. Written by LD Entertainment', '115 min', 'http://ia.media-imdb.com/images/M/MV5BMjA2MTEzMDkyOF5BMl5BanBnXkFtZTcwNzc4NTgxOQ@@._V1_SX214_.jpg', '17 October 2013 (Portugal)', 7.5, 'Disconnect', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (122, 'In World War II, the German pilots Lieutenant Horst Schopis, Josef Schwartz and Wolfgang Strunk crash their airplane in the wilderness of Norway after shooting down a British airplane. They walk through a snow storm until they reach shelter in an abandoned hunter cabin. Soon the British pilot Captain Charles P. Davenport and the gunner Robert Smith arrive in the cabin and they become prisoners of the German pilots. However, after the initial friction between the enemies, they realize that they should team-up to survive in the wilderness in the beginning of an improbable friendship. Written by Claudio Carvalho, Rio de Janeiro, Brazil', '100 min', 'http://ia.media-imdb.com/images/M/MV5BMTM5MDgzMTAyMV5BMl5BanBnXkFtZTcwODA5MzUwOQ@@._V1_SY317_CR0,0,214,317_.jpg', '12 April 2013 (USA)', 7, 'Into the White', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (123, 'Caden Welles has the world at his disposal. With the resources of his wealthy father, he''s living life as large as any 20-year-old could dream. But what happens when that dream becomes a nightmare halfway around the world? Traveling with his friends to Hyderabad, India on a whim, Caden''s expectations of a never-ending party crash hard. But not as hard as his conscience when he refuses to help a starving man and his little girl. Haunted by the images of Kiran and Annika, Caden attempts to right his wrong-only to discover Kiran has been forced to sell his own daughter. Caden''s eyes are now opened to a world few Americans know still exists: a thriving human-trafficking trade. Add the dehumanization of Kiran and hundreds of millions of other Dalits due to India''s caste system, and Caden could easily turn his back. Yet spurred by a true purpose, an unlikely new friendship, and the prayers of his mother and girlfriend back home, Caden chooses to help in Kiran''s unlikely search to find his ... Written by Not Today', '118 min', 'http://ia.media-imdb.com/images/M/MV5BMjIxNDI5ODc1MV5BMl5BanBnXkFtZTcwNjY1NjQxOA@@._V1_SX214_.jpg', '12 April 2013 (USA)', 4.59999999999999964, 'Not Today', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (124, 'One of the few remaining drone repairmen assigned to Earth, its surface devastated after decades of war with the alien Scavs, discovers a crashed spacecraft with contents that bring into question everything he believed about the war, and may even put the fate of mankind in his hands. Written by Black Dahlia', '124 min', 'http://ia.media-imdb.com/images/M/MV5BMTQwMDY0MTA4MF5BMl5BanBnXkFtZTcwNzI3MDgxOQ@@._V1_SX214_.jpg', '19 April 2013 (USA)', 7, 'Oblivion', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (125, 'Heidi, a blond rock chick, DJs at a local radio station, and together with the two Hermans (Whitey and Munster) forms part of the "Big H Radio Team." A mysterious wooden box containing a vinyl record arrives for Heidi, a gift of the Lords. She assumes it''s a rock band on a mission to spread their word. As Heidi and Whitey play the Lords'' record, it starts to play backwards, and Heidi experiences a flashback to a past trauma. Later, Whitey plays the Lords'' record, dubbing them the Lords of Salem, and to his surprise, the record plays normally and is a massive hit with his listeners. The arrival of another wooden box from the Lords presents the Big H team with free tickets, posters and records to host a gig in Salem. Soon, Heidi and her cohorts are far from the rock spectacle they''re expecting. The original Lords of Salem are returning and they''re out for blood. Written by UHM', '101 min', 'http://ia.media-imdb.com/images/M/MV5BMjA2NTc5Njc4MV5BMl5BanBnXkFtZTcwNTYzMTcwOQ@@._V1_SX214_.jpg', '18 April 2013 (Russia)', 5.20000000000000018, 'The Lords of Salem', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (126, 'Maria Jose ''Majo'' Tonorio is a tough LA street poet who spits from the heart. After meeting a talented DJ she cuts her first demo under the guidance of a small time hustler more interested in promoting Majo''s sexuality than her lyrics. Soon a major label and its strong-arm executive come calling. Convinced that a record deal will deliver much needed money for the family, Majo is suddenly faced with some stark choices. Does she accept the deal and turn her back on the friends who got her to the precipice of success or does she let a golden opportunity slip away. Written by Anonymous', '80 min', 'http://ia.media-imdb.com/images/M/MV5BMTU2ODA0OTI4Ml5BMl5BanBnXkFtZTcwMjM5MDkzOQ@@._V1_SX214_.jpg', '19 April 2013 (USA)', 4.5, 'Filly Brown', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (127, 'A sixteen-year-old boy insinuates himself into the house of a fellow student from his literature class and writes about it in essays for his French teacher. Faced with this gifted and unusual pupil, the teacher rediscovers his enthusiasm for his work, but the boy''s intrusion will unleash a series of uncontrollable events. Written by Production', '105 min', 'http://ia.media-imdb.com/images/M/MV5BMTY3OTQwMTg5Ml5BMl5BanBnXkFtZTcwNjQ4NzAyOQ@@._V1_SX214_.jpg', '18 July 2013 (Portugal)', 7.29999999999999982, 'Dentro de Casa', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (128, 'Based on the true story of Daniel Lugo (Mark Wahlberg) a Miami bodybuilder who wants to live the American dream. He would like to have the money that other people have. So he enlists the help of fellow bodybuilder Adrian Doorbal (Anthony Mackie) and ex-convict, Christian bodybuilder Paul Doyle (Dwayne Johnson). Their kidnapping and extortion scheme goes terribly wrong since they have muscles for brains and they''re left to haphazardly try to hold onto the elusive American dream. Written by napierslogs', '129 min', 'http://ia.media-imdb.com/images/M/MV5BMTU0NDE5NTU0OV5BMl5BanBnXkFtZTcwMzI1OTMzOQ@@._V1_SY317_CR0,0,214,317_.jpg', '26 April 2013 (USA)', 6.5, 'Pain & Gain', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (129, 'Don and Ellie were once married and have two children, Lyla and Jared. They adopted a boy from Colombia, Alejandro. Eventually they divorce, Ellie moves away and Don hooks up with Bebe, Ellie''s best friend. When Alejandro is about to get married, he informs Don And Ellie that he never told his natural mother who is so traditional that they got divorced. And she is coming for the wedding so he asks them if they can pretend to still be married. Don and Ellie reluctantly agree to it and Bebe moves out who is also upset that Don for some reason doesn''t want to commit. Written by rcs0411@yahoo.com', '89 min', 'http://ia.media-imdb.com/images/M/MV5BMTcwODUwMjg2Ml5BMl5BanBnXkFtZTcwMTc2NzkxOA@@._V1_SX214_.jpg', '26 April 2013 (USA)', 5.40000000000000036, 'The Big Wedding', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (130, '14 year-old Ellis (Tye Sheridan) lives on a makeshift houseboat on the banks of a river in Arkansas with his parents, Mary Lee (Sarah Paulson) and Senior (Ray McKinnon). He sneaks out early one morning to meet his best friend, Neckbone (Jacob Lofland). Neckbone, also 14, lives with his uncle, Galen (Michael Shannon), who makes a hardscrabble living diving for oysters. The two boys set out to an island on the Mississippi River, where Neckbone has discovered an unusual sight-a boat, suspended high in the trees, a remnant of an extreme flood some time in the past. They climb the tree and into the boat only to find fresh bread and fresh footprints. Realizing that they are not the only ones who have discovered the treehouse boat, they decide to leave. When they reach the shore, they find the same footprint in their boat. And that''s when they meet Mud (Matthew McConaughey). Mud is a gritty, superstitious character; his clothes are dirty, his tooth is cracked, and he needs help. He tells the... Written by Roadside Attractions', '130 min', 'http://ia.media-imdb.com/images/M/MV5BMTU2MzcyODgyNV5BMl5BanBnXkFtZTcwNTc4MDYwOQ@@._V1_SX214_.jpg', '10 May 2013 (USA)', 7.5, 'Mud', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (304, 'The tragic death of a beautiful young girl starts a tense and atmospheric game of cat and mouse between hunter John Moon and the hardened backwater criminals out for his blood.', '116 min', 'http://ia.media-imdb.com/images/M/MV5BMjMzNzAwNTk2OF5BMl5BanBnXkFtZTgwMjE3MDAxMDE@._V1_SY317_CR2,0,214,317_.jpg', '25 April 2013 (USA)', 5.90000000000000036, 'A Single Shot', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (131, 'The Norwegian explorer Thor Heyerdahl crossed the Pacific Ocean in a balsawood raft in 1947, together with five men, to prove that South Americans back in pre-Columbian times could have crossed the ocean and settled on Polynesian islands. After financing the trips with loans and donations, they set off on an epic 101-day-long trip across 8000 kilometers, while the world was waiting for the result of the trip. The film tells about the origin of the idea, the preparations, and the events on the trip. The "Kon-Tiki" was named after the Inca sun god, Viracocha, and "Kon-Tiki" is an old name for this god. Heyerdahl filmed the expedition, which later became the Academy Award winning documentary in 1951, and he wrote a book about the expedition that was translated into 70 languages and sold more than 50 millions copies around the world. Heyerdahl believed that people from South America could have settled Polynesia in pre-Columbian times, although most anthropologists now believe they did not... Written by OJT', '118 min', 'http://ia.media-imdb.com/images/M/MV5BMjMxOTU2NzQxMF5BMl5BanBnXkFtZTcwODIwODY0OA@@._V1_SY317_CR4,0,214,317_.jpg', '26 April 2013 (USA)', 7.20000000000000018, 'Kon-Tiki', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (132, 'Wallace Avery hates his job. His ex-wife and son hate him, and he''s blown his one shot at living his dream. Not wanting to face all this, he stages his own death and buys himself a new identity as Arthur Newman. However, Arthur''s road trip towards anew life is interrupted by the arrival of the beautiful but fragile Mike, who is also trying to leave her past behind. Drawn to one another, these two damaged souls begin to connect as they break into empty homes and take on the identities of the absent owners: elderly newlyweds, a high-roller and his Russian lady, among others. Through this process, Arthur and Mike discover that what they love most about each other are the identities they left at home, and their real journey, that of healing, begins. Written by Becky Johnston', '101 min', 'http://ia.media-imdb.com/images/M/MV5BMTEyNzY1NzAzNjZeQTJeQWpwZ15BbWU3MDA5MjcxMzk@._V1_SX214_.jpg', '25 July 2013 (Portugal)', 5.40000000000000036, 'Arthur Newman', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (133, 'In the competitive world of modern agriculture, ambitious Henry Whipple wants his rebellious son Dean to help expand his family''s farming empire. However, Dean has his sights set on becoming a professional race car driver. When a high-stakes investigation into their business is exposed, father and son are pushed into an unexpected crisis that threatens the family''s entire livelihood. Written by Sony Pictures Classics', '105 min', 'http://ia.media-imdb.com/images/M/MV5BMTc1Nzg0NDEwOV5BMl5BanBnXkFtZTcwODUxNTgxOQ@@._V1_SX214_.jpg', '18 July 2013 (Portugal)', 5.59999999999999964, 'At Any Price', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (134, 'A young Pakistani man is chasing corporate success on Wall Street. He finds himself embroiled in a conflict between his American Dream, a hostage crisis, and the enduring call of his family''s homeland.', '130 min', 'http://ia.media-imdb.com/images/M/MV5BNzAzNjg3Mzg1Nl5BMl5BanBnXkFtZTcwOTUzNzExOQ@@._V1._CR25,27.166671752929688,1347,1995.9999542236328_SY317_CR1,0,214,317_.jpg', '23 May 2013 (Portugal)', 6.70000000000000018, 'The Reluctant Fundamentalist', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (135, 'Family man Marlon Villar - a longtime chauffeur to corrupt Filipino politician Manuel Chango - is faced with an unthinkable predicament when he is ambushed while driving both his boss''s and his own daughter home from school one afternoon. In the chaos of the kidnapping attempt, things go horribly awry and Marlon''s daughter is taken and held for ransom instead. Desperate to save his daughter, Marlon must navigate the conflicting motives between the ruthless kidnappers, untrustworthy Chango and determined detectives eager to name him a suspect without letting on the wrong girl was taken hostage. As events spin wildly out of control, Marlon, Chango and their families are forced into a rapid downward spiral of deceit and betrayal that will leave no one innocent. Written by Graceland', '84 min', 'http://ia.media-imdb.com/images/M/MV5BMTQ0MDI4NTIzN15BMl5BanBnXkFtZTcwOTM1MzcxOQ@@._V1_SX214_.jpg', '26 April 2013 (USA)', 6.5, 'Graceland', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (136, 'Marvel''s "Iron Man 3" pits brash-but-brilliant industrialist Tony Stark/Iron Man against an enemy whose reach knows no bounds. When Stark finds his personal world destroyed at his enemy''s hands, he embarks on a harrowing quest to find those responsible. This journey, at every turn, will test his mettle. With his back against the wall, Stark is left to survive by his own devices, relying on his ingenuity and instincts to protect those closest to him. As he fights his way back, Stark discovers the answer to the question that has secretly haunted him: does the man make the suit or does the suit make the man? Written by Jawadjee', '130 min', 'http://ia.media-imdb.com/images/M/MV5BMjIzMzAzMjQyM15BMl5BanBnXkFtZTcwNzM2NjcyOQ@@._V1_SX214_.jpg', '3 May 2013 (USA)', 7.40000000000000036, 'Iron Man Three', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (137, 'A Danish woman, Ida (Trine Dyrholm), who has just finished her cancer treatments, walks in on her suffering husband in bed with his young co-worker. She travels alone to their daughter''s wedding, which is to take place in Italy, but meets the father of the groom, Philip (Pierce Brosnan), and immediately makes a bad first impression. At the seaside villa where Philip once lived with his wife, conflicts arise not least between the soon-to-be newlyweds. But first impressions fade, and Ida may find her chance for another life. Written by Peter Brandt Nielsen', '116 min', 'http://ia.media-imdb.com/images/M/MV5BNzYxMDQwMzIzMF5BMl5BanBnXkFtZTcwNjcxODIzOQ@@._V1_SY317_CR0,0,214,317_.jpg', '9 May 2013 (Portugal)', 6.5, 'Só Precisamos de Amor', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (138, 'It''s the most mythic of all American emporiums - and the scene of many an ultimate fashion fantasy. Now audiences get a rarified chance to peek behind the backroom doors and into the reality of the fascinating inner workings and fabulous untold stories from Bergdorf Goodman''s iconic history in Scatter My Ashes at Bergdorf''s. Written by Anonymous', '93 min', 'http://ia.media-imdb.com/images/M/MV5BMjI3MjQwNTU4Ml5BMl5BanBnXkFtZTcwNjcyODUzOQ@@._V1_SX214_.jpg', '3 May 2013 (USA)', 4.59999999999999964, 'Scatter My Ashes at Bergdorf''s', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (139, 'In the 1960s, Richard Kuklinski is working as a porn film lab tech until his mob bosses persuade him to change his career into that of a contract killer. For years, Kuklinski gains a reputation for cold blooded professionalism even as he raises a family who are kept in the dark about his true career. Unfortunately, mob politics ultimately forces him to secretly work independently with the psychopathic Robert ''Mr. Freezy'' Pronge. As much as Kuklinski tries to keep his lives separate, circumstances and his own weaknesses threaten a terrible collision as the consequences of his choices finally catch up to him. Written by Kenneth Chisholm (kchishol@rogers.com)', '105 min', 'http://ia.media-imdb.com/images/M/MV5BMTc3NjY3NzUyOF5BMl5BanBnXkFtZTcwMTA5NzAyOA@@._V1_SX214_.jpg', '1 August 2013 (Portugal)', 6.90000000000000036, 'The Iceman', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (140, 'In the months after the heady weeks of May ''68, a group of young Europeans search for a way to continue the revolution believed to be just beginning.', '122 min', 'http://ia.media-imdb.com/images/M/MV5BMTk1Mjg5NDU1OV5BMl5BanBnXkFtZTcwMDI5OTI0OQ@@._V1_SY317_CR0,0,214,317_.jpg', '14 November 2012 (France)', 6.59999999999999964, 'Something in the Air', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (221, 'The true story of the "Flying Sikh" - world champion runner and Olympian Milkha Singh -- who overcame the massacre of his family, civil war during the India-Pakistan partition, and homelessness to become one of India''s most iconic athletes. Written by Reliance Big Pictures', '186 min', 'http://ia.media-imdb.com/images/M/MV5BMTY1Nzg4MjcwN15BMl5BanBnXkFtZTcwOTc1NTk1OQ@@._V1_SY317_CR2,0,214,317_.jpg', '12 July 2013 (USA)', 8.09999999999999964, 'Bhaag Milkha Bhaag', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (141, 'What Maisie Knew is a contemporary New York City revisioning of the Henry James novel by the same name. It revolves around unwitting 7-year-old Maisie, caught in the middle of a custody battle between her mother Susanna, an aging rock star, and her father, Beale, a major art dealer. Written by Anonymous', '99 min', 'http://ia.media-imdb.com/images/M/MV5BMTY1MDk0MTIzN15BMl5BanBnXkFtZTcwNDM3NzkxOQ@@._V1_SX214_.jpg', '3 May 2013 (USA)', 7.40000000000000036, 'What Maisie Knew', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (142, 'The vampire Djuna resists the advances of Paolo, but soon gives in to their passion. When her trouble-making sister unexpectedly comes to visit, Djuna''s love is threatened, and the whole vampire community becomes endangered.', '97 min', 'http://ia.media-imdb.com/images/M/MV5BMjMyMzg5OTAxNF5BMl5BanBnXkFtZTcwNTcxMzUxOQ@@._V1_SY317_CR0,0,214,317_.jpg', '28 March 2013 (USA)', 5.40000000000000036, 'Kiss of the Damned', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (143, 'Greetings from Tim Buckley follows the story of the days leading up to Jeff Buckley''s eminent 1991 performance at his father''s tribute concert in St. Ann''s Church. Through a romance with a young woman working at the concert, he learns to embrace all of his feelings toward the father who abandoned him - longing, anger, forgiveness, and love. Culminating a cathartic performance of his father''s most famous songs, Jeff''s debut stuns the audience and launches his career as one of the greatest young musicians of his time. Written by Production Weekly', '99 min', 'http://ia.media-imdb.com/images/M/MV5BMTkyNTI0MzkxMF5BMl5BanBnXkFtZTcwMDE1MzU0OQ@@._V1_SX214_.jpg', '4 July 2013 (Hong Kong)', 5.29999999999999982, 'Greetings from Tim Buckley', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (144, '"Generation Um..." follows a day in the life of John and his two beautiful cohorts as they live life on the fringe, immersed in sex, drugs and indecision. As they navigate their daily routine of bars, crowds and New York City living, they embark on a path of self-discovery. Written by Anonymous', '97 min', 'http://ia.media-imdb.com/images/M/MV5BMTY2OTk0MzQzNF5BMl5BanBnXkFtZTcwNTQxNTgxOQ@@._V1_SY317_CR2,0,214,317_.jpg', '28 May 2013 (USA)', 3.70000000000000018, 'Generation Um...', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (145, 'A western set on the New Mexico frontier a few years after the Civil War and centered on a struggling young family and the mining company who wants to buy their land.', '93 min', 'http://ia.media-imdb.com/images/M/MV5BMTQxNjQyMzI3OF5BMl5BanBnXkFtZTcwMDQxNDA0OQ@@._V1_SY317_CR0,0,214,317_.jpg', '3 May 2013 (USA)', 5.20000000000000018, 'Dead Man''s Burden', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (146, 'Adam is a rich industrialist, who aspires to a more cultured world. Spurred on by playful jibes that he is little more than a city suit living the capitalist''s dream, this frustrated amateur opera singer decides to throw an opera in his lavish country retreat. Once his friends see him belting out the notes, he feels sure it will spell the end to their shallow taunts. In fact, it might even help him win the hand of a female conductor he has been pursuing whom - it just so happens - is the first to be recruited for his showpiece. Written by Anonymous', '116 min', 'http://ia.media-imdb.com/images/M/MV5BODUzOTYyNzM2NF5BMl5BanBnXkFtZTcwMTE0NDg0Ng@@._V1_SY317_CR9,0,214,317_.jpg', '3 May 2013 (USA)', 4.5, '1st Night', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (147, 'On May 5th, 1862, a few thousand Mexican soldiers put their lives on the line against the world''s largest and most powerful army in one legendary battle for freedom and for Mexico.', '125 min', 'http://ia.media-imdb.com/images/M/MV5BMjAzMjg4MDU1OF5BMl5BanBnXkFtZTcwNjg4MDU0OQ@@._V1_SX214_.jpg', '3 May 2013 (Mexico)', 5.20000000000000018, 'Cinco de Mayo, La Batalla', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (148, 'An adaptation of F. Scott Fitzgerald''s Long Island-set novel, where Midwesterner Nick Carraway is lured into the lavish world of his neighbor, Jay Gatsby. Soon enough, however, Carraway will see through the cracks of Gatsby''s nouveau riche existence, where obsession, madness, and tragedy await. Written by Anonymous', '143 min', 'http://ia.media-imdb.com/images/M/MV5BMTkxNTk1ODcxNl5BMl5BanBnXkFtZTcwMDI1OTMzOQ@@._V1_SX214_.jpg', '10 May 2013 (USA)', 7.29999999999999982, 'O Grande Gatsby', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (149, 'Sparks fly when Wade Walker crashes the Peeples annual reunion in the Hamptons to ask for their precious daughter Grace''s hand in marriage.', '95 min', 'http://ia.media-imdb.com/images/M/MV5BMTQwODU0MDM4Ml5BMl5BanBnXkFtZTcwMTA5MDkzOQ@@._V1_SX214_.jpg', '10 May 2013 (USA)', 4.5, 'Peeples', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (150, 'Chris wants to show girlfriend Tina his world, but events soon conspire against the couple and their dream caravan holiday takes a very wrong turn.', '88 min', 'http://ia.media-imdb.com/images/M/MV5BMTQ5ODAwNDAzOF5BMl5BanBnXkFtZTcwMDUyOTc0OQ@@._V1_SX214_.jpg', '10 May 2013 (USA)', 6.5, 'Sightseers', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (151, 'Ever since Venus and Serena Williams started playing in tennis tournaments, they''ve provoked strong reactions - from awe and admiration to suspicion and resentment. They''ve been winning championships for over a decade, pushing the limits of longevity in such a demanding sport. How long can they last? In Venus & Serena, we gain unprecedented access into their lives during the most intimidating year of their career. Over the course of 2011, Venus grappled with an energy-sapping autoimmune disease while Serena battled back from a life-threatening pulmonary embolism. Neither Venus nor Serena let their adversities hold them back. They drew their greatest strength from each other. Written by Michelle Major', '99 min', 'http://ia.media-imdb.com/images/M/MV5BMzM0MDQyMzc3OF5BMl5BanBnXkFtZTcwNTA0NDcyOQ@@._V1_SY317_CR0,0,214,317_.jpg', '28 June 2013 (UK)', 5.59999999999999964, 'Venus and Serena', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (152, 'After an earthquake erupts in Chile, tourist discover that a neighboring prison in the area collapsed in the event, and all surviving criminals managed to break free. Soon they learn that the most terrifying thing, more threatening that Mother Nature, is what she created. Written by AnotherMovieGuy45', '89 min', 'http://ia.media-imdb.com/images/M/MV5BMTQyOTA3MjQzNF5BMl5BanBnXkFtZTcwMzc3NzY0OQ@@._V1_SY317_CR0,0,214,317_.jpg', '9 May 2013 (Kuwait)', 4.79999999999999982, 'Aftershock', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (153, 'A gang of ruthless highway killers kidnap a wealthy couple traveling cross country only to shockingly discover that things are not what they seem.', '86 min', 'http://ia.media-imdb.com/images/M/MV5BMjMzMzI0OTgwM15BMl5BanBnXkFtZTgwMzU5ODQxMDE@._V1_SY317_CR5,0,214,317_.jpg', '10 May 2013 (USA)', 5.79999999999999982, 'No One Lives', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (154, 'In 1970, Jeffrey Kagel walked away from the American dream of rock ''n'' roll stardom, turning down the chance to record as lead singer for the band soon-to-be the Blue Oyster Cult. Instead, he sold all his possessions and moved from the suburbs of Long Island to the foothills of the Himalayas in search of happiness and a little-known saint named Neem Karoli Baba. ONE TRACK HEART: THE STORY OF KRISHNA DAS follows his journey to India and back, witnessing his struggles with depression and drug abuse, to his eventual emergence as Krishna Das, world-renowned spiritual teacher and chant master. Featuring interviews with Ram Dass (LSD Icon Richard Alpert), Rick Rubin (Grammy Award winning Producer), Sharon Salzberg (NY Times bestselling author), Daniel Goleman (two-time Pulitzer Prize nominee), as well as a musical score by J Mascis (Dinosaur Jr) & Devadas, this is the inspiring story of how one man''s heart-expanding journey continues to transform countless lives. Written by Anonymous', '74 min', 'http://ia.media-imdb.com/images/M/MV5BMjMzNjAwNjI4Nl5BMl5BanBnXkFtZTcwOTU2NzAzOQ@@._V1_SX214_.jpg', '17 June 2012 (USA)', 6.70000000000000018, 'One Track Heart: The Story of Krishna Das', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (155, 'Story centers on the aftermath of a suicide bombing in Indonesia, where a reckless American posing as a grad student is bent on vengeance but quickly finds that the world''s problems can''t be solved with violence alone. A mysterious American Marine/FBI agent Jake Travers (Kellan Lutz) teams with a Muslim cop Hashim (Ario Bayu) to hunt down a dangerous international jewel thief Malik (Mickey Rourke) who kidnaps a Sultan''s daughter Sultana (Atiqah Hasiholan) in a plot to steal the royal treasury: exotic intrigue amid ancient palaces, mosques, temples, subterranean labyrinths and stone pyramids in the heart of Java. Written by H.G.', '104 min', 'http://ia.media-imdb.com/images/M/MV5BMTczNzU3MTA3Nl5BMl5BanBnXkFtZTcwOTc1OTYzOQ@@._V1_SX214_.jpg', '18 April 2013 (Indonesia)', 4.90000000000000036, 'Java Heat', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (156, 'When the crew of the Enterprise is called back home, they find an unstoppable force of terror from within their own organization has detonated the fleet and everything it stands for, leaving our world in a state of crisis. With a personal score to settle, Captain Kirk leads a manhunt to a war-zone world to capture a one man weapon of mass destruction. As our heroes are propelled into an epic chess game of life and death, love will be challenged, friendships will be torn apart, and sacrifices must be made for the only family Kirk has left: his crew. Written by Paramount Pictures', '132 min', 'http://ia.media-imdb.com/images/M/MV5BMTk2NzczOTgxNF5BMl5BanBnXkFtZTcwODQ5ODczOQ@@._V1_SX214_.jpg', '16 May 2013 (USA)', 7.90000000000000036, 'Star Trek Into Darkness', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (157, 'Frances lives in New York, but she doesn''t really have an apartment. Frances is an apprentice for a dance company, but she''s not really a dancer. Frances has a best friend named Sophie, but they aren''t really speaking anymore. Frances throws herself headlong into her dreams, even as their possible reality dwindles. Frances wants so much more than she has but lives her life with unaccountable joy and lightness. Written by IFC Films', '86 min', 'http://ia.media-imdb.com/images/M/MV5BOTY0NDQ2NzQ2N15BMl5BanBnXkFtZTcwMTU0OTkwOQ@@._V1_SX214_.jpg', '17 October 2013 (Portugal)', 7.59999999999999964, 'Frances Ha', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (158, 'In this inspired, genre-twisting new film, Oscar®-nominated writer/director Sarah Polley discovers that the truth depends on who''s telling it. Polley is both filmmaker and detective as she investigates the secrets kept by a family of storytellers. She playfully interviews and interrogates a cast of characters of varying reliability, eliciting refreshingly candid, yet mostly contradictory, answers to the same questions. As each relates their version of the family mythology, present-day recollections shift into nostalgia-tinged glimpses of their mother, who departed too soon, leaving a trail of unanswered questions. Polley unravels the paradoxes to reveal the essence of family: always complicated, warmly messy and fiercely loving. Stories We Tell explores the elusive nature of truth and memory, but at its core is a deeply personal film about how our narratives shape and define us as individuals and families, all interconnecting to paint a profound, funny and poignant picture of the ... Written by The National Film Board of Canada', '108 min', 'http://ia.media-imdb.com/images/M/MV5BMTg3MDU2NjI3N15BMl5BanBnXkFtZTcwMjYwMzYyOQ@@._V1_SX214_.jpg', '7 November 2013 (Portugal)', 7.59999999999999964, 'Histórias que Contamos', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (159, 'An ex-CIA agent and his estranged daughter are forced on the run when his employers erase all records of his existence, and mark them both for termination as part of a wide-reaching international conspiracy.', '100 min', 'http://ia.media-imdb.com/images/M/MV5BMTM3MjQwNzE1OF5BMl5BanBnXkFtZTcwMDYyNDYyOQ@@._V1_SX214_.jpg', '4 April 2013 (Portugal)', 6, 'Erased', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (160, 'Linda Sinclair (Julianne Moore) is a forty-year-old unmarried high school English teacher in the small town of Kingston, Pennsylvania. She shares a small apartment with two Siamese cats and her rich collection of great literature. She maintains no close personal relationships aside from those she has with her favorite authors and stories. Her life is far less complicated than the dramas she devours on the page, and she likes it that way. But Linda''s simple life turns an unexpected page when former star pupil Jason Sherwood (Michael Angarano) returns to Kingston after trying to make it as a playwright in New York. Now in his 20s, Jason is on the verge of abandoning art, pressured by his overbearing father, Dr. Tom Sherwood (Greg Kinnear), to face reality and go to law school. Linda can''t stand the thought of Jason giving up on his dreams so she decides to mount his play - a dark, angst-ridden, ambitious work - as a Kingston High School production, with flamboyant drama teacher Carl ... Written by Cinedigm', '93 min', 'http://ia.media-imdb.com/images/M/MV5BMTU2MjIwNDA5MF5BMl5BanBnXkFtZTcwMjU2NzEzOQ@@._V1_SX214_.jpg', '28 November 2013 (Portugal)', 5.59999999999999964, 'The English Teacher', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (161, 'A look at the relationship between pioneering 19th century French neurologist Dr. Jean-Martin Charcot and his star teenage patient, a kitchen maid who is left partially paralyzed after a seizure.', '102 min', 'http://ia.media-imdb.com/images/M/MV5BMTM2ODA4MzE3N15BMl5BanBnXkFtZTcwODE2NjA0OQ@@._V1_SY317_CR0,0,214,317_.jpg', '7 November 2012 (France)', 5.90000000000000036, 'Augustine', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (162, 'Three women who were good friends in the past get back together for the first time since they were kids to spend time on an island called Black Rock. They meet some local hunters and find out they know one of them from when they were children. After inviting them to join them in a few drinks on the beach, the atmosphere changes into one of panic and horror as the situation and friendships are turned on their head in a brutal confrontation. Written by Michael Hallows Eve', '83 min', 'http://ia.media-imdb.com/images/M/MV5BMjM0NjExNDkwOF5BMl5BanBnXkFtZTcwMDQ3ODQxOQ@@._V1_SX214_.jpg', '17 May 2013 (USA)', 4.59999999999999964, 'Black Rock', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (163, 'A look deep inside Israel and Palestine at the men and women trying to seize a historic opportunity to end the conflict and make implementing the two-state solution a reality.', '98 min', 'http://ia.media-imdb.com/images/M/MV5BMzQxNDc3NzcyNV5BMl5BanBnXkFtZTcwOTI0MDE1OQ@@._V1_SX214_.jpg', '17 May 2013 (USA)', 5.59999999999999964, 'State 194', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (164, 'Since Dom (Diesel) and Brian''s (Walker) Rio heist toppled a kingpin''s empire and left their crew with $100 million, our heroes have scattered across the globe. But their inability to return home and living forever on the lam have left their lives incomplete. Meanwhile, Hobbs (Johnson) has been tracking an organization of lethally skilled mercenary drivers across 12 countries, whose mastermind (Evans) is aided by a ruthless second-in-command revealed to be the love Dom thought was dead, Letty (Rodriguez). The only way to stop the criminal outfit is to outmatch them at street level, so Hobbs asks Dom to assemble his elite team in London. Payment? Full pardons for all of them so they can return home and make their families whole again. Written by Universal Pictures', '130 min', 'http://ia.media-imdb.com/images/M/MV5BMTM3NTg2NDQzOF5BMl5BanBnXkFtZTcwNjc2NzQzOQ@@._V1_SX214_.jpg', '24 May 2013 (USA)', 7.20000000000000018, 'Fast & Furious 6', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (165, 'In the aftermath of the death of Alan''s father, the wolfpack decide to take Alan to get treated for his mental issues. But things start to go wrong on the way to the hospital as the wolfpack is assaulted and Doug is kidnapped. Now they must find Mr. Chow again in order to surrender him to the gangster who kidnapped Doug in order to save him. Written by HeWhoShallNotBeNamed', '100 min', 'http://ia.media-imdb.com/images/M/MV5BMTA0NjE1MzMzODheQTJeQWpwZ15BbWU3MDY4MTQ3Mzk@._V1_SX214_.jpg', '23 May 2013 (USA)', 5.90000000000000036, 'The Hangover Part III', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (166, 'Young Mary Katherine (M.K.) returns to her eccentric scientist father''s home, but his all-consuming quest to discover a tiny civilization in the neighboring forest drives them apart. However, M.K. soon finds herself shrunken down by Queen Tara of that forest who was mortally wounded by the putrefying Boggans, and charged to deliver a pod bearing the new Queen to safety. Together with a veteran Leafman warrior, two goofy mollusks and a young maverick, M.K. agrees to help. As the villainous Boggan leader, Mandrake closes in, M.K. and her new friends must draw on the best of themselves together and discover what they have to save their world. Written by Kenneth Chisholm (kchishol@rogers.com)', '102 min', 'http://ia.media-imdb.com/images/M/MV5BMTgyNDYwNzE5NV5BMl5BanBnXkFtZTcwMzUyODM5OA@@._V1_SY317_CR0,0,214,317_.jpg', '24 May 2013 (USA)', 6.59999999999999964, 'Epic', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (167, 'It has been nine years since we last met Jesse and Celine, the French-American couple who once met on a train in Vienna. They now live in Paris with twin daughters, but have spent a summer in Greece on the invitation of an author colleague of Jesse''s. When the vacation is over and Jesse must send his teenage son off to the States, he begins to question his life decisions, and his relationship with Celine is at risk. Written by Peter Brandt Nielsen', '109 min', 'http://ia.media-imdb.com/images/M/MV5BMjA5NzgxODE2NF5BMl5BanBnXkFtZTcwNTI1NTI0OQ@@._V1_SX214_.jpg', '14 June 2013 (USA)', 8.09999999999999964, 'Before Midnight', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (168, 'A devout 18-year-old Israeli is pressured to marry the husband of her late sister. Declaring her independence is not an option in Tel Aviv''s ultra-Orthodox Hasidic community, where religious law, tradition and the rabbi''s word are absolute. Written by Sundance Film Festival', '90 min', 'http://ia.media-imdb.com/images/M/MV5BNzQ3ODMyMjA1MV5BMl5BanBnXkFtZTcwMTIzMzEzOQ@@._V1_SX214_.jpg', '29 August 2013 (Portugal)', 6.59999999999999964, 'Noiva Prometida', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (169, 'A documentary that details the creation of Julian Assange''s controversial website, which facilitated the largest security breach in U.S. history.', '130 min', 'http://ia.media-imdb.com/images/M/MV5BNTg3MjUyNjkzNl5BMl5BanBnXkFtZTcwMTQzNDgyOQ@@._V1_SX214_.jpg', '11 July 2013 (Germany)', 6.5, 'We Steal Secrets: The Story of WikiLeaks', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (170, 'One thousand years after cataclysmic events forced humanity''s escape from Earth, Nova Prime has become mankind''s new home. Legendary General Cypher Raige returns from an extended tour of duty to his estranged family, ready to be a father to his 13-year-old son, Kitai. When an asteroid storm damages Cypher and Kitai''s craft, they crash-land on a now unfamiliar and dangerous Earth. As his father lies dying in the cockpit, Kitai must trek across the hostile terrain to recover their rescue beacon. His whole life, Kitai has wanted nothing more than to be a soldier like his father. Today, he gets his chance. Written by Columbia Pictures', '100 min', 'http://ia.media-imdb.com/images/M/MV5BMTY3MzQyMjkwMl5BMl5BanBnXkFtZTcwMDk2OTE0OQ@@._V1_SX214_.jpg', '31 May 2013 (USA)', 5, 'After Earth', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (171, 'Four magicians each answer a mysterious summons to an obscure address with secrets inside. A year later, they are the Four Horseman, big time stage illusionists who climax their sold out Las Vegas show with a bank apparently robbed for real. This puts agents Dylan Rhodes of the FBI and Alma Dray of Interpol on the case to find out how they did it. However, this mystery proves difficult to solve even with the insights of the professional illusion exposer, Thaddeus Bradley. What follows is a bizarre investigation where nothing is what it seems with illusions, dark secrets and hidden agendas galore as all involved are reminded of a great truth in this puzzle: the closer you look, the less you see. Written by Kenneth Chisholm (kchishol@rogers.com)', '115 min', 'http://ia.media-imdb.com/images/M/MV5BMTY0NDY3MDMxN15BMl5BanBnXkFtZTcwOTM5NzMzOQ@@._V1_SX214_.jpg', '31 May 2013 (USA)', 7.20000000000000018, 'Mestres da Ilusão', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (172, 'Joe Toy, on the verge of adolescence, finds himself increasingly frustrated by his single father, Frank''s attempts to manage his life. Declaring his freedom once and for all, he escapes to a clearing in the woods with his best friend, Patrick, and a strange kid named Biaggio. He announces that they are going to build a house there, free from responsibility and parents. Once their makeshift abode is finished, the three young men find themselves masters of their own destiny, alone in the woods. Written by A.J. Porter', '95 min', 'http://ia.media-imdb.com/images/M/MV5BMTc3ODA1NTI0MV5BMl5BanBnXkFtZTcwOTE4OTUzOQ@@._V1_SX214_.jpg', '23 August 2013 (UK)', 7.20000000000000018, 'The Kings of Summer', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (173, 'A successful operative for an elite private intelligence firm is tasked with infiltrating an anarchist group known for executing covert attacks upon major corporations. However, she finds her priorities changing as she befriends the members and begins to develop romantic feelings for its charismatic leader. Written by Anonymous', '116 min', 'http://ia.media-imdb.com/images/M/MV5BMjEyNjQzMzg5Nl5BMl5BanBnXkFtZTcwMjExNzU1OQ@@._V1_SX214_.jpg', '28 June 2013 (UK)', 6.90000000000000036, 'The East', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (174, 'In 1993, the IRA member Collette is arrested in the London tube after leaving a bomb in the facility. MI-5 Agent Mac offers a deal to Collette to become an informer. She accepts the agreement to protect her son and in return Mac offers a new identity to her after a period working for the MI-5. Soon Mac learns that his superior Kate Fletcher is using Collette to protect her mole inside the Irish organization. Mac tries to find the identity of the informer and protect Collette. Written by Claudio Carvalho, Rio de Janeiro, Brazil', '101 min', 'http://ia.media-imdb.com/images/M/MV5BMTQzMDYyMTk1OV5BMl5BanBnXkFtZTcwOTkyMTkzOQ@@._V1_SX214_.jpg', '28 November 2013 (Portugal)', 6.20000000000000018, 'Shadow Dancer', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (175, 'A look at the life of philosopher and political theorist Hannah Arendt, who reported for The New Yorker on the war crimes trial of the Nazi Adolf Eichmann.', '113 min', 'http://ia.media-imdb.com/images/M/MV5BMjIyMDM2NTUyNF5BMl5BanBnXkFtZTcwOTQ2NzAzOQ@@._V1_SX214_.jpg', '3 October 2013 (Portugal)', 7.09999999999999964, 'Hannah Arendt', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (176, 'Two aliens from the planet Hondo have come take over our planet. But when they discover an amazing human invention called "music", they immediately abandon their mission, head to a tiny Brooklyn bar, and start the universe''s first Hondonian bluegrass duo: Future Folk! Written by Production', '86 min', 'http://ia.media-imdb.com/images/M/MV5BNzA3MDI3MzAxMl5BMl5BanBnXkFtZTcwNDY2Mjc0OQ@@._V1_SY317_CR0,0,214,317_.jpg', '31 May 2013 (USA)', 6.40000000000000036, 'The History of Future Folk', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (177, 'Billy (Vince Vaughn) and Nick (Owen Wilson) are salesmen whose careers have been torpedoed by the digital world. Trying to prove they are not obsolete, they defy the odds by talking their way into a coveted internship at Google, along with a battalion of brilliant college students. But, gaining entrance to this utopia is only half the battle. Now they must compete with a group of the nation''s most elite, tech-savvy geniuses to prove that necessity really is the mother of re-invention. Written by Twentieth Century Fox', '119 min', 'http://ia.media-imdb.com/images/M/MV5BMjM1MzczMDgwOV5BMl5BanBnXkFtZTcwMDM4NjM2OQ@@._V1_SX214_.jpg', '7 June 2013 (USA)', 6.20000000000000018, 'The Internship', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (261, 'A road trip through medicalized America, examining the pervasiveness of pharmaceutical drugs through the lives of eight very unique characters.', '80 min', 'http://ia.media-imdb.com/images/M/MV5BMTgwNzY0Mzc3MF5BMl5BanBnXkFtZTcwMjAyNzY3OQ@@._V1_SX214_.jpg', 'May 2012 (Canada)', 4.90000000000000036, 'Off Label', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (178, 'In an America wracked by crime and overcrowded prisons, the government has sanctioned an annual 12-hour period in which any and all criminal activity-including murder-becomes legal. The police can''t be called. Hospitals suspend help. It''s one night when the citizenry regulates itself without thought of punishment. On this night plagued by violence and an epidemic of crime, one family wrestles with the decision of who they will become when a stranger comes knocking. When an intruder breaks into James Sandin''s (Ethan Hawke) gated community during the yearly lockdown, he begins a sequence of events that threatens to tear a family apart. Now, it is up to James, his wife, Mary (Lena Headey), and their kids to make it through the night without turning into the monsters from whom they hide. Written by Universal Pictures', '85 min', 'http://ia.media-imdb.com/images/M/MV5BMTU0OTE1Nzk2NF5BMl5BanBnXkFtZTcwMjE5NDY0OQ@@._V1_SX214_.jpg', '7 June 2013 (USA)', 5.5, 'The Purge', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (179, 'Leonato (Clark Gregg), the governor of Messina, is visited by his friend Don Pedro (Reed Diamond) who is returning from a victorious campaign against his rebellious brother Don John (Sean Maher). Accompanying Don Pedro are two of his officers: Benedick (Alexis Denisof) and Claudio (Fran Kranz). While in Messina, Claudio falls for Leonato''s daughter Hero (Jillian Morgese), while Benedick verbally spars with Beatrice (Amy Acker), the governor''s niece. The budding love between Claudio and Hero prompts Don Pedro to arrange with Leonato for a marriage. In the days leading up to the ceremony, Don Pedro, with the help of Leonato, Claudio and Hero, attempts to sport with Benedick and Beatrice in an effort to trick the two into falling in love. Meanwhile, the villainous Don John, with the help of his allies Conrade (Riki Lindhome) and Borachio (Spencer Treat Clark), plots against the happy couple, using his own form of trickery to try to destroy the marriage before it begins. A series of comic... Written by http://muchadomovie.com/#story', '109 min', 'http://ia.media-imdb.com/images/M/MV5BMTgxNjQ0MjAwMl5BMl5BanBnXkFtZTcwNjI1NDEyOQ@@._V1_SY317_CR12,0,214,317_.jpg', '14 June 2013 (UK)', 7.20000000000000018, 'Much Ado About Nothing', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (180, 'Two teenage assassins accept what they think will be a quick-and-easy job, until an unexpected target throws them off their plan.', '88 min', 'http://ia.media-imdb.com/images/M/MV5BMTczOTc4ODE4OF5BMl5BanBnXkFtZTcwMjg3NzY0OQ@@._V1_SY317_CR3,0,214,317_.jpg', '6 June 2013 (Israel)', 6.20000000000000018, 'Violet & Daisy', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (181, 'Dirty Wars follows investigative reporter Jeremy Scahill, author of the international bestseller Blackwater, into the hidden world of America''s covert wars, from Afghanistan to Yemen, Somalia, and beyond. With a strong cinematic style, the film blurs the boundaries of documentary and fiction storytelling. Part action film and part detective story, Dirty Wars is a gripping journey into one of the most important and underreported stories of our time. What begins as a report on a deadly U.S. night raid in a remote corner of Afghanistan quickly turns into a global investigation of the secretive and powerful Joint Special Operations Command (JSOC). As Scahill digs deeper into the activities of JSOC, he is pulled into a world of covert operations unknown to the public and carried out across the globe by men who do not exist on paper and will never appear before Congress. In military jargon, JSOC teams "find, fix, and finish" their targets, who are selected through a secret process. No ... Written by Anonymous', '87 min', 'http://ia.media-imdb.com/images/M/MV5BMTUyOTYwNDUyMV5BMl5BanBnXkFtZTcwNzQwOTU1OQ@@._V1_SX214_.jpg', '18 October 2013 (Spain)', 6.90000000000000036, 'Dirty Wars', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (182, 'Four friends lose themselves in a carefree South-East Asian holiday. Only three come back. Dave and Alice return home to their young family desperate for answers about Jeremy''s mysterious disappearance. When Alice''s sister Steph returns not long after, a nasty secret is revealed about the night her boyfriend went missing. But it is only the first of many. Who amongst them knows what happened on that fateful night when they were dancing under a full moon in Cambodia? Written by Production', '89 min', 'http://ia.media-imdb.com/images/M/MV5BMTYzNzY5Njg1MV5BMl5BanBnXkFtZTcwNzU0OTIzOQ@@._V1_SX214_.jpg', '7 June 2013 (USA)', 5.79999999999999982, 'Wish You Were Here', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (183, 'A slacker hatches a million-dollar idea. But, in order to see it through, he has to learn to trust his attractive corporate counterpart. Based on Max Barry''s novel.', '90 min', 'http://ia.media-imdb.com/images/M/MV5BMjA3NzYzMDI1MF5BMl5BanBnXkFtZTcwMDE1NTI0OQ@@._V1_SY317_CR4,0,214,317_.jpg', '1 May 2013 (USA)', 5.5, 'Syrup', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (184, 'Long before O''Reilly and Beck, Morton Downey, Jr., was tearing up the talk-show format with his divisive populism. Between the fistfights, rabid audience, and Mort''s cigarette smoke always "in your face," The Morton Downey Jr. Show was billed as "3-D television," "rock and roll without the music." Évocateur meditates on the hysteria that ended the ''80s and ultimately its most notorious agitator. Written by Ironbound Films', '', 'http://ia.media-imdb.com/images/M/MV5BNDQ3NjcwMzc0Nl5BMl5BanBnXkFtZTcwNzQ1ODYzOQ@@._V1_SX214_.jpg', '7 June 2013 (USA)', 5.79999999999999982, 'Évocateur: The Morton Downey Jr. Movie', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (185, 'A young boy learns that he has extraordinary powers and is not of this Earth. As a young man, he journeys to discover where he came from and what he was sent here to do. But the hero in him must emerge if he is to save the world from annihilation and become the symbol of hope for all mankind. Written by Warner Bros. Pictures', '143 min', 'http://ia.media-imdb.com/images/M/MV5BMjI5OTYzNjI0Ml5BMl5BanBnXkFtZTcwMzM1NDA1OQ@@._V1_SY317_CR1,0,214,317_.jpg', '14 June 2013 (USA)', 7.40000000000000036, 'Man of Steel', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (186, 'All Jay Baruchel expected coming to LA was a fun time with Seth Rogen with all the wild partying to have both by themselves and at James Franco''s housewarming party. Suddenly, the Rapture hits and the Biblical Apocalypse has begun. Now, Jay and Seth are desperately sheltering in James'' house for rescue along with a few other friends. Together, they must band together to attempt to survive the end of the world, only for Jay to find that they are all too dumb and superficial to do it until they discover the only way out. Written by Kenneth Chisholm (kchishol@rogers.com)', '107 min', 'http://ia.media-imdb.com/images/M/MV5BMTQxODE3NjM1Ml5BMl5BanBnXkFtZTcwMzkzNjc4OA@@._V1_SX214_.jpg', '12 June 2013 (USA)', 7, 'This Is the End', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (187, 'College. Three of the most important years of your life. Three years of studies (at times) and sheer indulgence. Indulgence in all the little pleasures that a carefree life has to offer. But it isn''t always about ragging, fuchacha parties, college fests, races, and churning out ways to whack some extra pocket money from your parents. It''s sometimes hard, ugly, and complicated. More so, when you really need to get admission in the coolest college in town and you know you don''t deserve it. And to top that, you get yourself involved in the most bizarre stations that could crack you into pieces before you could crack it. Written by Excel Entertainment', '139 min', 'http://ia.media-imdb.com/images/M/MV5BODI5MzQ2NDg0MV5BMl5BanBnXkFtZTcwNTEwMzI1OQ@@._V1_SY317_CR12,0,214,317_.jpg', '14 June 2013 (USA)', 6.59999999999999964, 'Fukrey', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (274, 'A 20-something supervising staff member of a foster care facility navigates the troubled waters of that world alongside her co-worker and longtime boyfriend.', '96 min', 'http://ia.media-imdb.com/images/M/MV5BMTEwNjE2OTM4NDZeQTJeQWpwZ15BbWU3MDE2MTE4OTk@._V1_SX214_.jpg', '23 August 2013 (USA)', 8, 'Short Term 12', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (188, 'The backup singer exists in a strange place in the pop music world; they are always in the shadow of the feature artists even when they are in front of them in concert while they provide a vital foundation for the music. Through interviews with veterans and concert footage, the history of these predominately African-American singers is explored through the rock era. Furthermore, special focus is given to special stand outs who endeavored to make a living in the art burdened with a low profile and more personal career frustrations, especially those who faced the very different challenge of singing in the spotlight themselves. Written by Kenneth Chisholm (kchishol@rogers.com)', '91 min', 'http://ia.media-imdb.com/images/M/MV5BMTQxNDY2NjMwNF5BMl5BanBnXkFtZTcwNzExMDg0OQ@@._V1_SX214_.jpg', '28 November 2013 (Netherlands)', 7.40000000000000036, '20 Feet from Stardom', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (189, 'A sound engineer''s work for an Italian horror studio becomes a terrifying case of life imitating art.', '92 min', 'http://ia.media-imdb.com/images/M/MV5BMTEzMzI3OTM4MDleQTJeQWpwZ15BbWU3MDgyNDAzNTk@._V1_SY317_CR0,0,214,317_.jpg', '31 August 2012 (UK)', 6.29999999999999982, 'Berberian Sound Studio', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (190, 'Life for former United Nations investigator Gerry Lane and his family seems content. Suddenly, the world is plagued by a mysterious infection turning whole human populations into rampaging mindless zombies. After barely escaping the chaos, Lane is persuaded to go on a mission to investigate this disease. What follows is a perilous trek around the world where Lane must brave horrific dangers and long odds to find answers before human civilization falls. Written by Kenneth Chisholm (kchishol@rogers.com)', '116 min', 'http://ia.media-imdb.com/images/M/MV5BMTg0NTgxMjIxOF5BMl5BanBnXkFtZTcwMDM0MDY1OQ@@._V1_SX214_.jpg', '21 June 2013 (USA)', 7.09999999999999964, 'World War Z', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (191, 'Mike Wazowski and James P. Sullivan are an inseparable pair, but that wasn''t always the case. From the moment these two mismatched monsters met they couldn''t stand each other. "Monsters University" unlocks the door to how Mike and Sulley overcame their differences and became the best of friends. Written by Disney/Pixar', '104 min', 'http://ia.media-imdb.com/images/M/MV5BMTUyODgwMDU3M15BMl5BanBnXkFtZTcwOTM4MjcxOQ@@._V1_SX214_.jpg', '21 June 2013 (USA)', 7.5, 'Monsters University', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (192, '"Song for Marion", a London-set comedic drama, is about shy, grumpy pensioner Arthur who is reluctantly inspired by his beloved wife Marion to join a highly unconventional local choir. At odds with his son James, it is left to charismatic choir director Elizabeth to try and persuade Arthur that he can learn to embrace life. Arthur must confront the undercurrents of his own grumbling persona as he embarks on a hilarious, life-affirming journey of musical self discovery. Written by Anonymous', '93 min', 'http://ia.media-imdb.com/images/M/MV5BMTY5MjA5NzExM15BMl5BanBnXkFtZTcwMDE5NzU2OQ@@._V1_SX214_.jpg', '22 February 2013 (UK)', 6.79999999999999982, 'Unfinished Song', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (193, 'Just when the streets seemed safe, a serial killer with a fetish for scalps is back and on the hunt. Frank is the withdrawn owner of a mannequin store, but his life changes when young artist Anna appears asking for his help with her new exhibition. As their friendship develops and Frank''s obsession escalates, it becomes clear that she has unleashed a long-repressed compulsion to stalk and kill. Written by Anonymous', '89 min', 'http://ia.media-imdb.com/images/M/MV5BMjI2NjMxMTQ5MV5BMl5BanBnXkFtZTcwODczMTQ3OQ@@._V1_SY317_CR0,0,214,317_.jpg', '2 January 2013 (France)', 6.09999999999999964, 'Maniac', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (194, 'The cargo ship MV Rozen is heading for harbor when it is hijacked by Somali pirates in the Indian Ocean. Amongst the men on board are the ship''s cook Mikkel and the engineer Jan, who along with the rest of the seamen are taken hostage in a cynical game of life and death. With the demand for a ransom of millions of dollars a psychological drama unfolds between the CEO of the shipping company and the Somali pirates. Written by Production', '103 min', 'http://ia.media-imdb.com/images/M/MV5BMTQ0NDI4Nzg1N15BMl5BanBnXkFtZTcwNjE2NjcyOQ@@._V1_SY317_CR0,0,214,317_.jpg', '20 September 2012 (Denmark)', 7.09999999999999964, 'A Hijacking', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (195, 'A documentary that explores the downloading revolution; the kids that created it, the bands and the businesses that were affected by it, and its impact on the world at large.', '106 min', 'http://ia.media-imdb.com/images/M/MV5BMTk5MjI3NDQ5NV5BMl5BanBnXkFtZTcwOTc3NzY0OQ@@._V1_SX214_.jpg', '10 March 2013 (USA)', 6.40000000000000036, 'Downloaded', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (196, 'Inspired by actual events, a group of fame-obsessed teenagers use the internet to track celebrities'' whereabouts in order to rob their homes.', '90 min', 'http://ia.media-imdb.com/images/M/MV5BMTQzMTgwMzQxN15BMl5BanBnXkFtZTcwOTcwNTY0OQ@@._V1_SX214_.jpg', '21 June 2013 (USA)', 5.70000000000000018, 'The Bling Ring', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (197, 'Capitol Policeman John Cale has just been denied his dream job with the Secret Service of protecting President James Sawyer. Not wanting to let down his little girl with the news, he takes her on a tour of the White House, when the complex is overtaken by a heavily armed paramilitary group. Now, with the nation''s government falling into chaos and time running out, it''s up to Cale to save the president, his daughter, and the country. Written by Columbia Pictures', '131 min', 'http://ia.media-imdb.com/images/M/MV5BMTAyNzQyNTcwNjVeQTJeQWpwZ15BbWU3MDAwOTQ4Nzk@._V1_SY317_CR0,0,214,317_.jpg', '28 June 2013 (USA)', 6.29999999999999982, 'White House Down', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (198, 'Sarah Ashburn, an FBI agent, is extremely ambitious and has her eye on a promotion, but she doesn''t get along with her co-workers. She is sent to Boston to uncover the identity of an elusive drug lord, Mr. Larkin, by tracking down his proxy, Rojas, and is told that she''ll have a good shot at the promotion if she finds Larkin. When she arrives in Boston, she learns that Larkin has been eliminating his competition and taking over their operations. She learns that Rojas is in Boston PD custody and goes to see him to ask him what he knows about Larkin, but is warned that the cop who arrested Rojas, Shannon Mullins, is very territorial, and she is not exactly sociable. When the two meet they don''t get along. When Mullins learns why Ashburn is in Boston, she decides to find Larkin herself. Ashburn is told by her boss to work with Mullins, but it won''t be easy because Ashburn does things by the book while Mullins does things her way. Written by rcs0411@yahoo.com', '117 min', 'http://ia.media-imdb.com/images/M/MV5BMjA2MDQ2ODM3MV5BMl5BanBnXkFtZTcwNDUzMTQ3OQ@@._V1_SX214_.jpg', '28 June 2013 (USA)', 6.59999999999999964, 'The Heat', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (199, 'A technical failure has endangered the lives of the people on board Peninsula Flight 2549. The pilots are striving, along with their colleagues in the Control Center, to find a solution. The flight attendants and the chief steward are atypical, baroque characters who, in the face of danger, try to forget their own personal problems and devote themselves body and soul to the task of making the flight as enjoyable as possible for the passengers, while they wait for a solution. Life in the clouds is as complicated as it is at ground level, and for the same reasons, which could be summarized in two: sex and death. Written by Production', '90 min', 'http://ia.media-imdb.com/images/M/MV5BMjM0MDY2OTEzNl5BMl5BanBnXkFtZTcwMjI5ODU0OQ@@._V1_SX214_.jpg', '18 April 2013 (Portugal)', 5.59999999999999964, 'I''m So Excited!', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (327, 'The U.S. government recruits Machete to battle his way through Mexico in order to take down an arms dealer who looks to launch a weapon into space.', '107 min', 'http://ia.media-imdb.com/images/M/MV5BMjA2MzUxMTM3M15BMl5BanBnXkFtZTgwMzA2NzkxMDE@._V1_SX214_.jpg', '11 October 2013 (USA)', 6.09999999999999964, 'Machete Kills', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (200, 'Two mysterious women seek refuge in a run-down coastal resort. Clara meets lonely Noel, who provides shelter in his deserted guesthouse, Byzantium. Schoolgirl Eleanor befriends Frank and tells him their lethal secret. They were born 200 years ago and survive on human blood. As knowledge of their secret spreads, their past catches up on them with deathly consequence. Written by Production', '118 min', 'http://ia.media-imdb.com/images/M/MV5BMTk2Nzc0NDQwMV5BMl5BanBnXkFtZTcwNjI2MjY3OQ@@._V1_SX214_.jpg', '31 May 2013 (UK)', 6.5, 'Byzantium', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (201, 'Homeless and on the run from a military court martial, a damaged ex-special forces soldier navigating London''s criminal underworld seizes an opportunity to assume another man''s identity -- transforming into an avenging angel in the process.', '100 min', 'http://ia.media-imdb.com/images/M/MV5BMjI0ODc3NjI4NV5BMl5BanBnXkFtZTcwOTc3MzI1OQ@@._V1_SX214_.jpg', '4 July 2013 (Portugal)', 6.20000000000000018, 'Redemption', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (202, 'A drama that charts ten years in the relationship of a male-to-female transsexual''s relationship with her lover.', '168 min', 'http://ia.media-imdb.com/images/M/MV5BMjAyNjQzODUyMV5BMl5BanBnXkFtZTcwNTExOTIxOQ@@._V1_SX214_.jpg', '28 June 2013 (USA)', 7.09999999999999964, 'Laurence Para Sempre', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (203, 'Based on his play by the same name, Neil LaBute''s script follows a successful writer who, on the eve of his wedding, travels across the country to meet up with ex-lovers in an attempt to make amends for past relationship transgressions. Crisscrossing from Seattle to Boston, he reunites with high school sweetheart Sam, sexually free-spirited Tyler, married college professor Lindsay, his best friend''s little sister Reggie, and "the one that got away" Bobbi. A modern-day Candide stumbling through a landscape familiar to most men-messy breakups. Written by Leeden Media', '90 min', 'http://ia.media-imdb.com/images/M/MV5BMTQ0ODI2NDM5MF5BMl5BanBnXkFtZTcwMTkwOTU1OQ@@._V1_SY317_CR0,0,214,317_.jpg', '26 June 2013 (USA)', 4.79999999999999982, 'Some Girl(s)', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (204, 'Before Bad Brains, the Sex Pistols or even the Ramones, there was a band called Death. Punk before punk existed, three teenage brothers in the early ''70s formed a band in their spare bedroom, began playing a few local gigs and even pressed a single in the hoped of getting signed. But this was the era of Motown and emerging disco. Record companies found Death''s music - and band name - too intimidating, and the group were never given a fair shot, disbanding before they even completed one album. Equal parts electrifying rockumentary and epic family love story, A Band Called Death chronicles the incredible fairy-tale journey of what happened almost three decades later, when a dusty 1974 demo tape made it way out of the attic and found an audience several generations younger. Playing music impossible ahead of its time, Death is now being credited as the first black punk band (hell...the first punk band!), and are finally receiving their long overdue recognition as true rock pioneers. Written by Drafthouse Films', '96 min', 'http://ia.media-imdb.com/images/M/MV5BMTU1NjAzMjc1M15BMl5BanBnXkFtZTcwOTk4NDY0OQ@@._V1_SY317_CR3,0,214,317_.jpg', '28 June 2013 (USA)', 7.09999999999999964, 'A Band Called Death', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (205, 'Ten easy steps show you how to make money from drugs, featuring a series of interviews with drug dealers, prison employees, and lobbyists arguing for tougher drug laws.', '96 min', 'http://ia.media-imdb.com/images/M/MV5BMTQ2NDk2NDcxOF5BMl5BanBnXkFtZTcwNDk4MjA3OQ@@._V1_SY317_CR2,0,214,317_.jpg', '25 April 2013 (USA)', 7.59999999999999964, 'How to Make Money Selling Drugs', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (206, 'In the 1930s, an elderly Tonto tells a young boy the tale of John Reid, the Lone Ranger. An idealistic lawyer, he rides with his brother and fellow Texas Rangers in pursuit of the notorious Butch Cavendish. Ambushed by the outlaw and left for dead, John Reid is rescued by the renegade Comanche, Tonto, at the insistence of a mysterious white horse and offers to help him to bring Cavendish to justice. Becoming a reluctant masked rider with a seemingly incomprehensible partner, Reid pursues the criminal against all obstacles. However, John and Tonto learn that Cavendish is only part of a far greater injustice and the pair must fight it in an adventure that would make them a legend. Written by Kenneth Chisholm (kchishol@rogers.com)', '149 min', 'http://ia.media-imdb.com/images/M/MV5BMjI3Mjk5MTUxOV5BMl5BanBnXkFtZTcwNTMyNzY3OQ@@._V1_SX214_.jpg', '3 July 2013 (USA)', 6.59999999999999964, 'The Lone Ranger', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (207, 'While Gru, the ex-supervillain is adjusting to family life and an attempted honest living in the jam business, a secret Arctic laboratory is stolen. The Anti-Villain League decides it needs an insider''s help and recruits Gru in the investigation. Together with the eccentric AVL agent, Lucy Wilde, Gru concludes that his prime suspect is the presumed dead supervillain, El Macho, whose his teenage son is also making the moves on his eldest daughter, Margo. Seemingly blinded by his overprotectiveness of his children and his growing mutual attraction to Lucy, Gru seems on the wrong track even as his minions are being quietly kidnapped en masse for some malevolent purpose. Written by Kenneth Chisholm (kchishol@rogers.com)', '98 min', 'http://ia.media-imdb.com/images/M/MV5BOTg4NTk2OTg5N15BMl5BanBnXkFtZTcwMDk1MzI2OQ@@._V1._CR243,215.64999389648438,1087,1598.0000305175781_SY317_CR14,0,214,317_.jpg', '3 July 2013 (USA)', 7.59999999999999964, 'Despicable Me 2', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (208, 'Filmed at a sold-out performance at Madison Square Garden, comedian Kevin Hart delivers material from his 2012 "Let Me Explain" concert tour.', '75 min', 'http://ia.media-imdb.com/images/M/MV5BMTg4MjM2MjAxOF5BMl5BanBnXkFtZTcwMTAzOTEyOQ@@._V1_SX214_.jpg', '3 July 2013 (USA)', 6.20000000000000018, 'Kevin Hart: Let Me Explain', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (209, 'Shy 14-year-old Duncan goes on summer vacation with his mother, her overbearing boyfriend, and her boyfriend''s daughter. Having a rough time fitting in, Duncan finds an unexpected friend in Owen, manager of the Water Wizz water park.', '103 min', 'http://ia.media-imdb.com/images/M/MV5BNTU5ODk5NDg0Nl5BMl5BanBnXkFtZTcwNzQwMjI1OQ@@._V1_SX214_.jpg', '26 July 2013 (USA)', 7.5, 'The Way Way Back', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (210, 'After the untimely death of his daughter, Paul Raymond reflects on his life. Rising from a mind-reading act, Raymond grew to have a fabulously successful career as an erotica magnate that would make him the richest man in Britain. However, for all his material success, Paul''s appetites mess up his personal life, such as alienating his wife with his philandering. Furthermore, even as he challenged his society''s sexual mores, Paul''s relationship with his daughter proves troublingly problematic as she came of age. While trying to be the best father he could, Paul gradually comes to realize that his proclivities have impoverished him in ways that mere money cannot address. Written by Kenneth Chisholm (kchishol@rogers.com)', '101 min', 'http://ia.media-imdb.com/images/M/MV5BMTAxNDIyMDIxNjheQTJeQWpwZ15BbWU3MDYzNTk3MTk@._V1_SX214_.jpg', '7 July 2013 (USA)', 5.90000000000000036, 'The Look of Love', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (275, 'Tensions rise between lifelong friends Mitchell and Carter after their truck breaks down on an isolated desert road as they start to attack each other''s life decisions with unwavering brutality.', '', 'http://ia.media-imdb.com/images/M/MV5BMjAyNjIyOTU0M15BMl5BanBnXkFtZTcwNTUwOTI2OQ@@._V1_SY317_CR0,0,214,317_.jpg', '23 August 2013 (USA)', 6.40000000000000036, 'Scenic Route', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (328, 'Romeo and Juliet secretly wed despite the sworn contempt their families hold for each another. It is not long, however, before a chain of fateful events changes the lives of both families forever.', '118 min', 'http://ia.media-imdb.com/images/M/MV5BMTA3MjQwOTg4MTheQTJeQWpwZ15BbWU3MDM3NDE0OTk@._V1_SX214_.jpg', '24 October 2013 (Portugal)', 5.09999999999999964, 'Romeo and Juliet', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (211, 'BIG STAR: NOTHING CAN HURT ME is a feature-length documentary about legendary Memphis band Big Star. While mainstream success eluded them, Big Star''s three albums have become critically lauded touchstones of the rock music canon. A seminal band in the history of alternative music, Big Star has been cited as an influence by artists including REM, The Replacements, Belle & Sebastian, Elliott Smith and Flaming Lips, to name just a few. With never-before-seen footage and photos of the band, in-depth interviews and a rousing musical tribute by the bands they inspired, BIG STAR: NOTHING CAN HURT ME is a story of artistic and musical salvation. Written by Danielle McCarthy', '113 min', 'http://ia.media-imdb.com/images/M/MV5BMTc0MDQwMjY5MV5BMl5BanBnXkFtZTcwMDkzNDY2OQ@@._V1_SX214_.jpg', '15 March 2012 (USA)', 6.40000000000000036, 'Big Star: Nothing Can Hurt Me', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (212, 'A high energy, high concept, stylish action epic set in the Norse world sees a passionate young man transform into a brutal warrior as he travels the unforgiving British landscape in search of his long lost brother Hakan The Ferrocious who his people are relying on to restore order to their kingdom following the bloody death of their king. Written by Anonymous', '99 min', 'http://ia.media-imdb.com/images/M/MV5BMTY5ODY2NjE5OF5BMl5BanBnXkFtZTcwNzY4NzAzOQ@@._V1_SY317_CR6,0,214,317_.jpg', '30 May 2013 (USA)', 4.5, 'Hammer of the Gods', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (213, 'Mona (Golshifteh Farahani), 26, an immigrant from North Africa, runs her in-laws'' mini market in Chicago. She''s married to Mourad, a man who can''t stand up to his authoritarian mother. Mona is harassed by her mother-in-law because after five years of marriage, she hasn''t be able to get pregnant, something that''s considered a shame and a taboo in her culture. Marilyn (Sienna Miller), 29, is a receptionist at a computer repair company. Her marriage with Harvey is on the ropes. The only thing in her life that makes her happy is her belly dance class, a passion shared by Mona. Dancing at family gatherings lifts her spirits up and makes her forget the misery of her daily life. Marilyn shops at Mona''s mini-market. They''ve become friends. One morning, Mona''s mother-in-law is found dead in her bed. Mona realizes that she mixed the wrong dose while preparing her medicine. Realizing that she might be accused of murder, Mona runs away and flees Chicago by bus. Marilyn loses her job because of ... Written by Cohen Media Group', '90 min', 'http://ia.media-imdb.com/images/M/MV5BMTU0OTQ5NDg5N15BMl5BanBnXkFtZTcwMTc0NTg1OQ@@._V1_SY317_CR2,0,214,317_.jpg', '5 July 2013 (USA)', 5.5, 'Just Like a Woman', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (214, 'When monstrous creatures, known as Kaiju, started rising from the sea, a war began that would take millions of lives and consume humanity''s resources for years on end. To combat the giant Kaiju, a special type of weapon was devised: massive robots, called Jaegers, which are controlled simultaneously by two pilots whose minds are locked in a neural bridge. But even the Jaegers are proving nearly defenseless in the face of the relentless Kaiju. On the verge of defeat, the forces defending mankind have no choice but to turn to two unlikely heroes - a washed up former pilot (Charlie Hunnam) and an untested trainee (Rinko Kikuchi) - who are teamed to drive a legendary but seemingly obsolete Jaeger from the past. Together, they stand as mankind''s last hope against the mounting apocalypse. Written by Del Torro', '131 min', 'http://ia.media-imdb.com/images/M/MV5BMTY3MTI5NjQ4Nl5BMl5BanBnXkFtZTcwOTU1OTU0OQ@@._V1_SY317_CR0,0,214,317_.jpg', '12 July 2013 (USA)', 7.20000000000000018, 'Pacific Rim', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (215, 'After having the greatest time of his life three summers ago, Lenny (Adam Sandler), decides he wants to move his family back to his hometown and have them grow up with his gang of childhood friends and their kids. But between old bullies, new bullies, schizophrenic bus drivers, drunk cops on skis, psycho grade school girlfriends and 400 costumed party crashes he finds out that sometimes crazy follows you. Written by Happy Madison', '101 min', 'http://ia.media-imdb.com/images/M/MV5BMTgwNTI2MDI0OF5BMl5BanBnXkFtZTcwMTk5MDg0OQ@@._V1_SX214_.jpg', '12 July 2013 (USA)', 5.20000000000000018, 'Grown Ups 2', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (216, 'This is the true story of Oscar, a 22-year-old Bay Area resident who wakes up on the morning of December 31, 2008 and feels something in the air. Not sure what it is, he takes it as a sign to get a head start on his resolutions: being a better son to his mother, whose birthday falls on New Year''s Eve, being a better partner to his girlfriend, who he hasn''t been completely honest with as of late, and being a better father to T, their beautiful 4 year old daughter. He starts out well, but as the day goes on, he realizes that change is not going to come easy. He crosses paths with friends, family, and strangers, each exchange showing us that there is much more to Oscar than meets the eye. But it would be his final encounter of the day, with police officers at the Fruitvale BART station that would shake the Bay Area to its very core, and cause the entire nation to be witnesses to the story of Oscar Grant. Written by The Weinstein Company', '85 min', 'http://ia.media-imdb.com/images/M/MV5BMTQ0OTU1MDkxMF5BMl5BanBnXkFtZTcwNjI5OTA3OQ@@._V1_SX214_.jpg', '26 July 2013 (USA)', 7.70000000000000018, 'Fruitvale Station', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (217, 'A teacher lives a lonely life, all the while struggling over his son''s custody. His life slowly gets better as he finds love and receives good news from his son, but his new luck is about to be brutally shattered by an innocent little lie.', '115 min', 'http://ia.media-imdb.com/images/M/MV5BMTg2NDg3ODg4NF5BMl5BanBnXkFtZTcwNzk3NTc3Nw@@._V1_SY317_CR4,0,214,317_.jpg', '7 March 2013 (Portugal)', 8.30000000000000071, 'The Hunt', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (218, 'Searching for a missing student, two private investigators break into his house and find collection of VHS tapes. Viewing the horrific contents of each cassette, they realize there may be dark motives behind the student''s disappearance.', '96 min', 'http://ia.media-imdb.com/images/M/MV5BODg4OTMxNDAxMV5BMl5BanBnXkFtZTcwMjM4ODQ0OQ@@._V1_SX214_.jpg', '6 June 2013 (USA)', 6.09999999999999964, 'V/H/S/2', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (219, 'Jamie (Cera) is a boorish, insensitive American twentysomething traveling in Chile, who somehow manages to create chaos at every turn. He and his friends are planning on taking a road trip north to experience a legendary shamanistic hallucinogen called the San Pedro cactus. In a fit of drunkenness at a wild party, Jamie invites an eccentric woman -- a radical spirit named Crystal Fairy (Hoffmann) -- to come along. What is meant to be a devil-may-care journey becomes a battle of wills as Jamie finds himself locking horns with his new traveling companion. But on a remote, pristine beach at the edge of the desert, the magic brew is finally imbibed, and the true adventure begins. Written by Production', '98 min', 'http://ia.media-imdb.com/images/M/MV5BMTk3Mjk5NjUxNF5BMl5BanBnXkFtZTcwMTk3OTA4OQ@@._V1_SX214_.jpg', '17 January 2013 (USA)', 5.70000000000000018, 'Crystal Fairy', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (220, 'Faced with the absurd competitiveness surrounding his son''s youth league baseball team, Max Morris, a famous comedian, decides to get to know the colorful parents and coaches of the team better in an attempt to find the inspiration for his next movie. Written by IFC Films', '', 'http://ia.media-imdb.com/images/M/MV5BNjE0MTIyMDY0Ml5BMl5BanBnXkFtZTcwMjA1Njk2OQ@@._V1_SX214_.jpg', '12 July 2013 (USA)', 4.90000000000000036, 'Dealin'' with Idiots', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (329, 'In a world of fake castles and anthropomorphic rodents, an epic battle begins when an unemployed father''s sanity is challenged by a chance encounter with two underage girls on holiday.', '90 min', 'http://ia.media-imdb.com/images/M/MV5BNTIxNjcxOTgxM15BMl5BanBnXkFtZTgwMjYzODEzMDE@._V1_SY317_CR0,0,214,317_.jpg', '18 January 2013 (USA)', 5.5, 'Escape from Tomorrow', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (222, 'After years of stability, the lives of octogenarian couple, Craig and Irene Morrison, are slowly beginning to change. Because of changing times and regulations, they are no longer able to make a living from their small coastal New Brunswick farm. And Irene has begun to show signs of early dementia. Against the wishes of their two offspring who still reside in the area and who would like to see more standard care provided for Irene, Craig, the son of a master shipbuilder who inherited his father''s building abilities, decides to mill lumber from trees on their property and with it build a more suitable, small one story house on the property in which he and Irene can live. Beginning this project with only a design in his mind, he is encouraged by friends at least to go through the regulatory process of building permits and the like. Despite being able to complete this project to more than exacting centuries old standards, Craig ends up hitting one roadblock after another in this ... Written by Huggo', '102 min', 'http://ia.media-imdb.com/images/M/MV5BMjA3NjA5OTM4MF5BMl5BanBnXkFtZTcwMjQ0MTA3OQ@@._V1_SX214_.jpg', '6 June 2013 (Australia)', 6.90000000000000036, 'Still Mine', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (223, 'Based on actual events, a fisherman tries to survive in the freezing ocean after his boat capsizes off the south coast of Iceland.', '95 min', 'http://ia.media-imdb.com/images/M/MV5BODc3MzQyMTU0OF5BMl5BanBnXkFtZTcwNjI0MzU0OQ@@._V1_SY317_CR6,0,214,317_.jpg', '21 May 2013 (USA)', 6.70000000000000018, 'The Deep', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (224, 'Terms And Conditions May Apply examines the cost of so-called ''free'' services and the continuing disappearance of online privacy. People may think they know what they give up when they click ''I Agree'' on companies like Facebook and Google. They''re wrong. Written by Anonymous', '79 min', 'http://ia.media-imdb.com/images/M/MV5BMTQyNDc5NTUzOF5BMl5BanBnXkFtZTcwNzM0MTAzOQ@@._V1_SX214_.jpg', '12 July 2013 (USA)', 7, 'Terms and Conditions May Apply', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (225, 'An unlikely basketball team of unappreciated middle-aged Texas women, all former high school champs, challenge the current arrogant high school girls'' state champs to a series of games to raise money for breast cancer prevention. Sparks fly as these marginalized women go to comic extremes to prove themselves on and off the court, and become a national media sensation. Written by Hennig, Brad', '99 min', 'http://ia.media-imdb.com/images/M/MV5BMjQ4OTM5NDk3NV5BMl5BanBnXkFtZTcwNDY1NTk1OQ@@._V1_SX214_.jpg', '9 August 2013 (Spain)', 4.40000000000000036, 'The Hot Flashes', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (226, 'A group of actresses performing in a production of Shakespeare''s "Twelfth Night" get caught up in a web of romantic intrigue and revelation.', '65 min', 'http://ia.media-imdb.com/images/M/MV5BMTQxNjUwMDAyMV5BMl5BanBnXkFtZTcwNDI2Mjk3OQ@@._V1_SX214_.jpg', '27 March 2013 (USA)', 6.09999999999999964, 'Viola', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (227, 'SHRAPNEL tells the story of two veterans of the Bosnian War, one American, one Serbian, who clash in the Appalachian Mountain wilderness. FORD is a former American soldier who fought on the front lines in Bosnia. When our story begins, he has retreated to a remote cabin in the woods, trying to escape painful memories of war. The drama begins when KOVAC, a former Serbian soldier, seeks Ford out, hoping to settle an old score. What follows is a cat-and-mouse game in which Ford and Kovac fght their own personal World War III, with battles both physical and psychological. By the end of the flm, old wounds are opened, suppressed memories are drawn to the surface and long-hidden secrets about both Ford and Kovac are revealed. Written by producer', '91 min', 'http://ia.media-imdb.com/images/M/MV5BOTQ2MzA3MTk3MV5BMl5BanBnXkFtZTcwMDM5ODk2OQ@@._V1_SY317_CR0,0,214,317_.jpg', '17 October 2013 (Portugal)', 5.29999999999999982, 'Killing Season - Temporada de Caça', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (228, 'A missing wedding ring leads to a wild-goose chase involving meth addicts, skinheads and an Elvis impersonator.', '112 min', 'http://ia.media-imdb.com/images/M/MV5BMTYwMTQ3MTU0MF5BMl5BanBnXkFtZTcwMDU5NzY2OQ@@._V1_SX214_.jpg', '12 July 2013 (USA)', 5.59999999999999964, 'Pawn Shop Chronicles', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (229, 'Retired C.I.A. agent Frank Moses reunites his unlikely team of elite operatives for a global quest to track down a missing portable nuclear device.', '116 min', 'http://ia.media-imdb.com/images/M/MV5BMjI2ODQ4ODY3Nl5BMl5BanBnXkFtZTcwNTc2NzE1OQ@@._V1_SX214_.jpg', '19 July 2013 (USA)', 6.70000000000000018, 'Red 2', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (230, 'After Nick is murdered by his own partner, he joins the Rest in Peace Department to protect the world from the undeads. While working with his new partner, many undeads are seen gathering in Boston. Soon he realizes that someone close to him is behind all a plot to bring on the apocalypse. Written by Immanuel A.', '96 min', 'http://ia.media-imdb.com/images/M/MV5BMTM5OTYxNzE5N15BMl5BanBnXkFtZTcwMDU1MTQ4OQ@@._V1_SX214_.jpg', '19 July 2013 (USA)', 5.5, 'R.I.P.D.', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (231, 'From the makers of MADAGASCAR and KUNG FU PANDA, TURBO is a high-velocity 3D comedy about a snail who dares to dream big - and fast. After a freak accident infuses him with the power of super-speed, Turbo kicks into overdrive and embarks on an extraordinary journey to achieve the seemingly impossible: competing in the world''s fastest race, the Indianapolis 500. With the help of his tricked-out streetwise snail crew, this ultimate underdog puts his heart and shell on the line to prove that no dream is too big, and no dreamer too small. Written by DreamWorks Animation', '96 min', 'http://ia.media-imdb.com/images/M/MV5BMTA4NTgwMjM5MzheQTJeQWpwZ15BbWU3MDg2ODA1ODk@._V1_SX214_.jpg', '17 July 2013 (USA)', 6.40000000000000036, 'Turbo', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (232, 'In 1971, Carolyn and Roger Perron move their family into a dilapidated Rhode Island farm house and soon strange things start happening around it with escalating nightmarish terror. In desperation, Carolyn contacts the noted paranormal investigators, Ed and Lorraine Warren, to examine the house. What the Warrens discover is a whole area steeped in a satanic haunting that is now targeting the Perron family wherever they go. To stop this evil, the Warrens will have to call upon all their skills and spiritual strength to defeat this spectral menace at its source that threatens to destroy everyone involved. Written by Kenneth Chisholm (kchishol@rogers.com)', '112 min', 'http://ia.media-imdb.com/images/M/MV5BMTM3NjA1NDMyMV5BMl5BanBnXkFtZTcwMDQzNDMzOQ@@._V1_SX214_.jpg', '19 July 2013 (USA)', 7.59999999999999964, 'The Conjuring', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (233, 'Kristen Wiig stars as Imogene, a failed New York playwright awkwardly navigating the transition from Next Big Thing to Last Year''s News. After both her career and relationship hit the skids, she''s forced to make the humiliating move back home to New Jersey with her eccentric mother and younger brother (Annette Bening and Christopher Fitzgerald). Adding further insult to injury, there''s a strange man sleeping in her old bedroom (Darren Criss) and an even stranger man sleeping in her mother''s bed (Matt Dillon). Through it all, Imogene eventually realizes that as part of her rebuilding process she must finally come to love and accept both her family and her Jersey roots if she''s ever going to be stable enough to get the hell away from them. Written by Roadside Attractions', '103 min', 'http://ia.media-imdb.com/images/M/MV5BMTEyMDgyNDYwNjReQTJeQWpwZ15BbWU3MDc1MDQwNjk@._V1_SX214_.jpg', '26 September 2013 (Portugal)', 5.59999999999999964, 'Girl Most Likely', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (300, 'Battle of the Year attracts all the best teams from around the world, but the Americans haven''t won in fifteen years. Dante enlists Blake to assemble a team of the best dancers and bring the Trophy back to America where it started.', '110 min', 'http://ia.media-imdb.com/images/M/MV5BOTY2OTcyNzM3NF5BMl5BanBnXkFtZTgwNzgxMjkxMDE@._V1_SY317_CR1,0,214,317_.jpg', '20 September 2013 (USA)', 3.70000000000000018, 'Battle of the Year', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (234, 'Bangkok. Ten years ago Julian killed a man and went on the run. Now he manages a Thai boxing club as a front for a drugs operation. Respected in the criminal underworld, deep inside, he feels empty. When Julian''s brother murders an underage prostitute, the police call on retired cop Chang - the Angel of Vengeance. Chang allows the father to kill his daughter''s murderer, then ''restores order'' by chopping off the man''s right hand. Julian''s mother Crystal - the head of a powerful criminal organization - arrives in Bangkok to collect her son''s body. She dispatches Julian to find his killers and ''raise hell''. Written by www.joblo.com', '90 min', 'http://ia.media-imdb.com/images/M/MV5BMzE5NzcxMTk5NF5BMl5BanBnXkFtZTcwNjE2MDg2OQ@@._V1_SX214_.jpg', '25 July 2013 (Portugal)', 5.90000000000000036, 'Só Deus Perdoa', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (235, 'Notorious killer whale Tilikum is responsible for the deaths of three individuals, including a top killer whale trainer. Blackfish shows the sometimes devastating consequences of keeping such intelligent and sentient creatures in captivity. Written by Anonymous', '83 min', 'http://ia.media-imdb.com/images/M/MV5BNTkyNTkwMzkxMl5BMl5BanBnXkFtZTcwMzAwOTE2OQ@@._V1_SX214_.jpg', '18 October 2013 (Iceland)', 8, 'Blackfish', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (236, 'A documentary that challenges former Indonesian death squad leaders to reenact their real-life mass-killings in whichever cinematic genres they wish, including classic Hollywood crime scenarios and lavish musical numbers.', '115 min', 'http://ia.media-imdb.com/images/M/MV5BNzQ0NDA1ODQ3NF5BMl5BanBnXkFtZTcwNjQwMzk0OA@@._V1_SY317_CR4,0,214,317_.jpg', '8 November 2012 (Denmark)', 8, 'The Act of Killing', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (237, '9 years ago Wali Khan (Irrfan Khan) was sent into Karachi, Pakistan by the Chief of RAW Ashwini Rao (Nasser) to report the activities of The Most Wanted Man in India. 9 days ago Rudra Pratap Singh (Arjun Rampal) Indian Armed Forces, MARCOS unit, Zoya Rehman (Huma Qureshi) RAW Explosives expert, and Aslam, a petty thief from the streets of Mumbai recruited by RAW, infiltrated Pakistan to join Wali Khan and carry out the mission to bring back The Most Wanted Man in India. The man who was going to break all ISI protocol and security and attend his own son''s wedding. The man who could on that day be abducted and brought back to India to face justice. 1 day ago everything went according to plan until it all failed. The team sent in to bring The Most Wanted Man in India, did the unthinkable - they carried out the most daring operation and almost got away with it. Almost because, something went horribly wrong. Written by Yash Raj Films', '153 min', 'http://ia.media-imdb.com/images/M/MV5BMTk4MDQzMjU3M15BMl5BanBnXkFtZTcwMDY1NzA4OQ@@._V1_SY317_CR3,0,214,317_.jpg', '19 July 2013 (India)', 6.90000000000000036, 'D-Day', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (238, 'Members of a once-promising hip-hop group, now in their late 30''s, struggle with regret, disappointment, and change on Election Night 2008.', '93 min', 'http://ia.media-imdb.com/images/M/MV5BMjIxMDQ3OTM5OV5BMl5BanBnXkFtZTcwNDI3MTA2OQ@@._V1_SY317_CR1,0,214,317_.jpg', '18 January 2013 (USA)', 4.5, 'Big Words', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (239, 'In modern day Japan, Wolverine is out of his depth in an unknown world as he faces his ultimate nemesis in a life-or-death battle that will leave him forever changed. Vulnerable for the first time and pushed to his physical and emotional limits, he confronts not only lethal samurai steel but also his inner struggle against his own immortality, emerging more powerful than we have ever seen him before. Written by Twentieth Century Fox', '126 min', 'http://ia.media-imdb.com/images/M/MV5BNzg1MDQxMTQ2OF5BMl5BanBnXkFtZTcwMTk3MjAzOQ@@._V1_SX214_.jpg', '26 July 2013 (USA)', 6.90000000000000036, 'Wolverine', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (240, 'Feeling pressured to become more sexually experienced before she goes to college, Brandy Klark makes a list of things to accomplish before hitting campus in the fall.', '104 min', 'http://ia.media-imdb.com/images/M/MV5BODg4ODYxMTk2NV5BMl5BanBnXkFtZTcwNzYxMTI5OQ@@._V1_SX214_.jpg', '26 July 2013 (USA)', 5.70000000000000018, 'The To Do List', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (241, 'Jasmine French used to be on the top of the heap as a New York socialite, but now is returning to her estranged sister in San Francisco utterly ruined. As Jasmine struggles with her haunting memories of a privileged past bearing dark realities she ignored, she tries to recover in her present. Unfortunately, it all proves a losing battle as Jasmine''s narcissistic hangups and their consequences begin to overwhelm her. In doing so, her old pretensions and new deceits begin to foul up everyone''s lives, especially her own. Written by Kenneth Chisholm (kchishol@rogers.com)', '98 min', 'http://ia.media-imdb.com/images/M/MV5BMTc0ODk5MzEyMV5BMl5BanBnXkFtZTcwMzI0MDY1OQ@@._V1_SX214_.jpg', '23 August 2013 (USA)', 7.70000000000000018, 'Blue Jasmine', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (242, 'An artist meets a mysterious and wealthy benefactor and their relationship is not what it appears to be.', '85 min', 'http://ia.media-imdb.com/images/M/MV5BMTQwNTU1MjI3NF5BMl5BanBnXkFtZTcwODk2MDk3OQ@@._V1_SX214_.jpg', '23 July 2013 (USA)', 5.09999999999999964, 'The Time Being', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (243, 'When four best friends try and move forward in their work and personal life, they realize that trying to live their life''s dream is more difficult than they imagine -- especially in the high fashion world of Shanghai.', '116 min', 'http://ia.media-imdb.com/images/M/MV5BMjA1NjQyNTIzNF5BMl5BanBnXkFtZTcwMjQzMzg4OQ@@._V1_SY317_CR6,0,214,317_.jpg', '27 June 2013 (China)', 2.70000000000000018, 'Tiny Times 1.0', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (244, 'After losing control of his car and crashing into a local restaurant, a man loses consciousness on the street. Later, while working on a case, the police''s anti-drug division captain, Zhang Lei (Honglei Sun), realizes that the man in the crash is drug lord Tian Ming (Louis Koo). In order to avoid the death penalty, Tian Ming helps the police put a stop to the entire drug trafficking circuit, but just as soon as the police are ready to make a large bust, Tian Ming makes a decision that shocks everyone involved. Written by Anonymous', '107 min', 'http://ia.media-imdb.com/images/M/MV5BMjI3MDE4MjYxNl5BMl5BanBnXkFtZTcwNzIwODA4OQ@@._V1_SX214_.jpg', '4 April 2013 (China)', 7, 'Drug War', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (245, 'Sara, a college student who was slandered by a classmate, finds herself framed for murder by Alex, who initially proposed the perfect, untraceable crime.', '83 min', 'http://ia.media-imdb.com/images/M/MV5BODcwNTUxNTkwNl5BMl5BanBnXkFtZTcwNjQ3ODY4OQ@@._V1_SY317_CR2,0,214,317_.jpg', '26 July 2013 (USA)', 4.70000000000000018, 'Breaking the Girls', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (246, 'Robert Trench, an undercover DEA agent, takes advantage of gunman Michael Stigman''s idea to rob a bank to bust him and a mob boss. However, it proves too successful with much more money seized than anticipated with Trench''s forces not stopping the getaway. Complicating things still more, Stigman turns out to be a Naval Intelligence agent who shoots Trench and takes the money. The interservice debacle suddenly finds Trench and Stigman in a bloody web of corrupt clandestine rivalries as they are hunted, blackmailed and isolated for the money on both sides of the law. Now, the fugitives must work together to find a way out of this situation with no one to turn to but themselves. Written by Kenneth Chisholm (kchishol@rogers.com)', '109 min', 'http://ia.media-imdb.com/images/M/MV5BNTQ5MTgzNDg4OF5BMl5BanBnXkFtZTcwMjAyODEzOQ@@._V1_SX214_.jpg', '2 August 2013 (USA)', 6.90000000000000036, '2 Guns', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (330, 'A coming-of-age story about two inner city boys who are left to fend for themselves over the summer after their mothers are taken away by the authorities.', '108 min', 'http://ia.media-imdb.com/images/M/MV5BMTUwMjgyNTE2OV5BMl5BanBnXkFtZTgwNzU1MzgwMDE@._V1_SY317_CR0,0,214,317_.jpg', '25 January 2013 (USA)', 5.90000000000000036, 'The Inevitable Defeat of Mister & Pete', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (247, 'The evil wizard Gargamel creates a couple of mischievous Smurf-like creatures called the Naughties that he hopes will let him harness the all-powerful, magical Smurf-essence. But when he discovers that only a real Smurf can give him what he wants, and only a secret spell that Smurfette knows can turn the Naughties into real Smurfs, Gargamel kidnaps Smurfette and brings her to Paris, where he has been winning the adoration of millions as the world¹s greatest sorcerer. It''s up to Papa, Clumsy, Grouchy, and Vanity to return to our world, reunite with their human friends Patrick and Grace Winslow, and rescue her! Will Smurfette, who has always felt different from the other Smurfs, find a new connection with the Naughties Vexy and Hackus or will the Smurfs convince her that their love for her is True Blue? Written by Columbia Pictures', '105 min', 'http://ia.media-imdb.com/images/M/MV5BMTkyNDUxODg3MV5BMl5BanBnXkFtZTcwNjE5OTY2OQ@@._V1_SX214_.jpg', '31 July 2013 (USA)', 5, 'The Smurfs 2', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (248, 'Sutter Keely lives in the now. It''s a good place for him. A high school senior, charming and self-possessed, he''s the life of the party, loves his job at a men''s clothing store, and has no plans for the future. A budding alcoholic, he''s never far from his supersized, whiskey-fortified thirst-master cup. But after being dumped by his girlfriend, Sutter gets drunk and wakes up on a lawn with Aimee Finecky hovering over him. She''s different: the "nice girl" who reads science fiction and doesn''t have a boyfriend. While Amy has dreams of a future, Sutter lives in the impressive delusion of a spectacular now, yet somehow, they''re drawn together. Written by Production', '95 min', 'http://ia.media-imdb.com/images/M/MV5BMjA5MTc0NTkzM15BMl5BanBnXkFtZTcwODEwNjE3OQ@@._V1_SY317_CR0,0,214,317_.jpg', '13 September 2013 (USA)', 7.70000000000000018, 'The Spectacular Now', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (249, 'When Christian, an LA trust-fund kid with casual ties to Hollywood, learns of a secret affair between Tara and the lead of his film project, Ryan, he spirals out of control, and his cruel mind games escalate into an act of bloody violence.', '99 min', 'http://ia.media-imdb.com/images/M/MV5BMTkyMjk5NDA0OF5BMl5BanBnXkFtZTgwODEwNjU0MDE@._V1_SY317_CR4,0,214,317_.jpg', '2 August 2013 (USA)', 4.09999999999999964, 'The Canyons', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (250, 'An international crew of astronauts undertakes a privately funded mission to search for life on Jupiter''s fourth largest moon.', '90 min', 'http://ia.media-imdb.com/images/M/MV5BMjA2OTk5ODkxMl5BMl5BanBnXkFtZTcwODc4MDk0OQ@@._V1_SY317_CR4,0,214,317_.jpg', '27 June 2013 (USA)', 6.5, 'Europa Report', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (251, 'In the 70s two brothers battle killer waves, conservative society and ruthless bikers to kick-start the modern surf industry.', '', 'http://ia.media-imdb.com/images/M/MV5BMTYzNzMxNjg0Ml5BMl5BanBnXkFtZTcwOTM0OTU5OQ@@._V1_SY317_CR4,0,214,317_.jpg', '2 July 2013 (USA)', 5.79999999999999982, 'Drift', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (252, 'In the year 2154, two classes of people exist: the very wealthy, who live on a pristine man-made space station called Elysium, and the rest, who live on an overpopulated, ruined Earth. Secretary Delacourt, a government official, will stop at nothing to enforce anti-immigration laws and preserve the luxurious lifestyle of the citizens of Elysium. That doesn''t stop the people of Earth from trying to get in by any means they can. When unlucky Max is backed into a corner, he agrees to take on a daunting mission that, if successful, will not only save his life but could bring equality to these polarized worlds. Written by Production', '109 min', 'http://ia.media-imdb.com/images/M/MV5BNDc2NjU0MTcwNV5BMl5BanBnXkFtZTcwMjg4MDg2OQ@@._V1_SX214_.jpg', '9 August 2013 (USA)', 6.90000000000000036, 'Elysium', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (253, 'In this retelling of Rick Riordans book, "The Sea of Monsters", Percy Jackson, accompanied by his friends Annabeth Chase, Clarisse La Rue and Tyson, his half brother, goes on a journey to the Sea of Monsters to retrieve the Golden Fleece and save Camp Half-Blood. Written by Michelle Stone', '106 min', 'http://ia.media-imdb.com/images/M/MV5BMTUwODUyODI0Nl5BMl5BanBnXkFtZTcwNzAxODY2OQ@@._V1_SX214_.jpg', '7 August 2013 (USA)', 6.20000000000000018, 'Percy Jackson: Sea of Monsters', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (254, 'After being robbed of a week''s take, small-time pot dealer David is forced by his boss to go to Mexico to pick up a load of marijuana. In order to improve his odds of making it past the border, David asks the broke stripper Rose and two local teenagers to join him and pretend they''re on a family holiday. Written by Peter Brandt Nielsen', '110 min', 'http://ia.media-imdb.com/images/M/MV5BMjA5Njc0NDUxNV5BMl5BanBnXkFtZTcwMjYzNzU1OQ@@._V1_SY317_CR0,0,214,317_.jpg', '7 August 2013 (USA)', 7.09999999999999964, 'We''re the Millers', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (255, 'Dusty Crophopper is a little cropduster plane with a fear of heights and a crazy dream of being a racer. While his friends need convincing, Dusty gets the training he needs from Skipper, a veteran fighter, and qualifies for the Wings Across the World race. In the event, Dusty finds competitors who soon learn that there is something special about this underdog as he is tested to his physical and emotional limits. In doing so, Dusty soon finds enemies, and more importantly friends, who are inspired by his dream. In the face of all obstacles, the winner of this air race will be anyone''s guess. Written by Kenneth Chisholm (kchishol@rogers.com)', '91 min', 'http://ia.media-imdb.com/images/M/MV5BMjAwODc5NzYzOF5BMl5BanBnXkFtZTcwNTk4MjEzOQ@@._V1_SX214_.jpg', '9 August 2013 (USA)', 5.40000000000000036, 'Planes', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (256, 'Two highway road workers spend the summer of 1988 away from their city lives. The isolated landscape becomes a place of misadventure as the men find themselves at odds with each other and the women they left behind.', '94 min', 'http://ia.media-imdb.com/images/M/MV5BMTQzMzMwNDExMV5BMl5BanBnXkFtZTcwMzE5MjU3OQ@@._V1_SX214_.jpg', '19 September 2013 (Netherlands)', 6.40000000000000036, 'Prince Avalanche', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (257, 'Rahul embarks on a journey to a small town in Tamil Nadu to fulfill the last wish of his grandfather: to have his ashes immersed in the Holy water of Rameshwaram. En route, he meets a woman hailing from a unique family down South. As they find love through this journey in the exuberant lands of South India, an unanticipated drive awaits them. Written by UTV Motion Pictures', '141 min', 'http://ia.media-imdb.com/images/M/MV5BMjE2OTEyOTA3OV5BMl5BanBnXkFtZTcwNjI4MDk3OQ@@._V1_SY317_CR2,0,214,317_.jpg', '8 August 2013 (USA)', 6.09999999999999964, 'Chennai Express', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (258, 'The story of Linda Lovelace, who is used and abused by the porn industry at the behest of her coercive husband, before taking control of her life.', '93 min', 'http://ia.media-imdb.com/images/M/MV5BOTM0Mzc2MjgyN15BMl5BanBnXkFtZTcwOTIzNDQ4OQ@@._V1_SX214_.jpg', '14 November 2013 (Portugal)', 6.09999999999999964, 'Lovelace', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (259, 'An underachieving vocal coach is motivated by her father, the king of movie-trailer voice-overs, to pursue her aspirations of becoming a voiceover star. Amidst pride, sexism and family dysfunction, she sets out to change the voice of a generation. Written by Anonymous', '93 min', 'http://ia.media-imdb.com/images/M/MV5BMTU0NzE0Mzg3M15BMl5BanBnXkFtZTcwNzY2MDY3OQ@@._V1_SX214_.jpg', '13 September 2013 (UK)', 7.29999999999999982, 'In a World...', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (260, 'Newlywed couple Nat and Josh are deliriously happy despite their differences, though friends and family aren''t convinced that they can last. With their first anniversary approaching and attractive alternatives in the mix, can they last?', '97 min', 'http://ia.media-imdb.com/images/M/MV5BMTg5NDk4MTUwNl5BMl5BanBnXkFtZTcwMDU5MTc4OQ@@._V1_SY317_CR4,0,214,317_.jpg', '4 April 2013 (Portugal)', 5.70000000000000018, 'I Give It a Year', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (262, 'After Kick-Ass'' insane bravery inspires a new wave of self-made masked crusaders, led by the badass Colonel Stars and Stripes, our hero joins them on patrol. When these amateur superheroes are hunted down by Red Mist -- reborn as The Mother F%&*^r -- only the blade-wielding Hit Girl can prevent their annihilation. When we last saw junior assassin Hit Girl and young vigilante Kick-Ass, they were trying to live as normal teenagers Mindy and Dave. With graduation looming and uncertain what to do, Dave decides to start the world''s first superhero team with Mindy. Unfortunately, when Mindy is busted for sneaking out as Hit Girl, she''s forced to retire-leaving her to navigate the terrifying world of high-school mean girls on her own. With no one left to turn to, Dave joins forces with Justice Forever, run by a born-again ex-mobster named Colonel Stars and Stripes. Just as they start to make a real difference on the streets, the world''s first super villain, The Mother F%&*^r, assembles his ... Written by Universal Pictures', '103 min', 'http://ia.media-imdb.com/images/M/MV5BMTQ4OTQxNzc0N15BMl5BanBnXkFtZTcwOTQxOTU5OQ@@._V1_SY317_CR2,0,214,317_.jpg', '16 August 2013 (USA)', 6.90000000000000036, 'Kick-Ass 2', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (263, 'Cecil Gaines was a sharecropper''s son who grew up in the 1920s as a domestic servant for the white family who casually destroyed his. Eventually striking out on his own, Cecil becomes a hotel valet of such efficiency and discreteness in the 1950s that he becomes a butler in the White House itself. There, Cecil would serve numerous US Presidents over the decades as a passive witness of history with the American Civil Rights Movement gaining momentum even as his family has troubles of its own. As his wife, Gloria, struggles with her addictions and his defiant eldest son, Louis, strives for a just world, Cecil must decide whether he should take action in his own way. Written by Kenneth Chisholm (kchishol@rogers.com)', '132 min', 'http://ia.media-imdb.com/images/M/MV5BMjM2NDY3MjkyMF5BMl5BanBnXkFtZTcwMDM5Nzg5OQ@@._V1_SX214_.jpg', '16 August 2013 (USA)', 6.70000000000000018, 'Lee Daniels'' The Butler', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (264, 'The high stakes thriller Paranoia takes us deep behind the scenes of global success to a deadly world of greed and deception. The two most powerful tech billionaires in the world (Harrison Ford and Gary Oldman) are bitter rivals with a complicated past who will stop at nothing to destroy each other. A young superstar (Liam Hemsworth), seduced by unlimited wealth and power falls between them, and becomes trapped in the middle of the twists and turns of their life-and-death game of corporate espionage. By the time he realizes his life is in danger, he is in far too deep and knows far too much for them to let him walk away. Written by Relativity Media', '106 min', 'http://ia.media-imdb.com/images/M/MV5BMTUyNjYwMTYwM15BMl5BanBnXkFtZTcwNDA4NTc2OQ@@._V1_SX214_.jpg', '16 August 2013 (USA)', 5, 'Paranoia', NULL);
