INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (266, 'The tale of an outlaw who escapes from prison and sets out across the Texas hills to reunite with his wife and the daughter he has never met.', '96 min', 'http://ia.media-imdb.com/images/M/MV5BMjg2MjI1OTU2M15BMl5BanBnXkFtZTcwODc3MzM5OQ@@._V1_SY317_CR2,0,214,317_.jpg', '16 August 2013 (USA)', 6.70000000000000018, 'Ain''t Them Bodies Saints', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (267, 'Austenland is a romantic comedy about 30-something, single Jane Hayes, a seemingly normal young woman with a secret: her obsession with Mr. Darcy-as played by Colin Firth in the BBC adaptation of Pride and Prejudice-is ruining her love life; no real man can compare. But when she decides to spend her life savings on a trip to an English resort catering to Austen-crazed women, Jane''s fantasies of meeting the perfect Regency-era gentleman suddenly become more real than she ever could have imagined. Written by Anonymous', '97 min', 'http://ia.media-imdb.com/images/M/MV5BMjE2MTUzMjgyNF5BMl5BanBnXkFtZTcwNjY4NDM4OQ@@._V1_SX214_.jpg', '27 September 2013 (UK)', 5.79999999999999982, 'Austenland', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (268, 'This candid New York love story explores the chaotic 40-year marriage of famed boxing painter Ushio Shinohara and his wife, Noriko. Anxious to shed her role as her overbearing husband''s assistant, Noriko finds an identity of her own.', '82 min', 'http://ia.media-imdb.com/images/M/MV5BMjEyNzgyMjUzNl5BMl5BanBnXkFtZTcwODk3NjQyOQ@@._V1_SY317_CR0,0,214,317_.jpg', '1 November 2013 (UK)', 6.79999999999999982, 'Cutie and the Boxer', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (269, 'Set in contemporary New York City, a seemingly ordinary teenager, Clary Fray (Lily Collins), discovers she is the descendant of a line of Shadowhunters, a secret cadre of young half-angel warriors locked in an ancient battle to protect our world from demons. After the disappearance of her mother (Lena Headey), Clary must join forces with a group of Shadowhunters, who introduce her to a dangerous alternate New York called Downworld, filled with demons, warlocks, vampires, werewolves and other deadly creatures. Based on the worldwide best-selling book series. Written by Sony Pictures Entertainment', '130 min', 'http://ia.media-imdb.com/images/M/MV5BMTc5NzAyOTQyNF5BMl5BanBnXkFtZTcwNzQ1MDc4OQ@@._V1_SX214_.jpg', '21 August 2013 (USA)', 6, 'The Mortal Instruments: City of Bones', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (270, '20 years after attempting an epic pub crawl, five childhood friends reunite when one of them becomes hell bent on trying the drinking marathon again. They are convinced to stage an encore by mate Gary King, a 40-year old man trapped at the cigarette end of his teens, who drags his reluctant pals to their home town and once again attempts to reach the fabled pub, The World''s End. As they attempt to reconcile the past and present, they realize the real struggle is for the future, not just theirs but humankind''s. Reaching The World''s End is the least of their worries. Written by Production', '109 min', 'http://ia.media-imdb.com/images/M/MV5BNzA1MTk1MzY0OV5BMl5BanBnXkFtZTgwNjkzNTUwMDE@._V1_SX214_.jpg', '23 August 2013 (USA)', 7.29999999999999982, 'The World''s End', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (271, 'When a gang of masked, ax-wielding murderers descend upon the Davison family reunion, the hapless victims seem trapped... until an unlikely guest of the family proves to be the most talented killer of all. Written by Lionsgate', '95 min', 'http://ia.media-imdb.com/images/M/MV5BMTQwODAxMTE1NF5BMl5BanBnXkFtZTcwNTQ0MjY3OQ@@._V1_SX214_.jpg', '23 August 2013 (USA)', 6.79999999999999982, 'You''re Next', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (272, 'Ip Man''s peaceful life in Foshan changes after Gong Yutian seeks an heir for his family in Southern China. Ip Man then meets Gong Er who challenges him for the sake of regaining her family''s honor. After the Second Sino-Japanese War, Ip Man moves to Hong Kong and struggles to provide for his family. In the mean time, Gong Er chooses the path of vengeance after her father was killed by Ma San. Written by Immanuel Ambhara', '108 min', 'http://ia.media-imdb.com/images/M/MV5BMTQ0OTY2NTU2MF5BMl5BanBnXkFtZTcwNTEyMjY2OQ@@._V1_SX214_.jpg', '30 August 2013 (USA)', 6.59999999999999964, 'The Grandmaster', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (273, 'Luke and Kate are co-workers at a Chicago brewery, where they spend their days drinking and flirting. They''re perfect for each other, except that they''re both in relationships. Luke is in the midst of marriage talks with his girlfriend of six years, Kate is playing it cool with her music producer boyfriend Chris. But you know what makes the line between "friends" and "more than friends" really blurry? Beer. Written by Anonymous', '90 min', 'http://ia.media-imdb.com/images/M/MV5BMjMwNDU1NzMzM15BMl5BanBnXkFtZTcwNTY3ODk1OQ@@._V1_SX214_.jpg', '25 July 2013 (USA)', 6.20000000000000018, 'Drinking Buddies', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (276, 'An intimate all-access look at life on the road for the global music phenomenon. Weaved with stunning live concert footage, this inspiring feature film tells the remarkable story of Niall, Zayn, Liam, Harry and Louis'' meteoric rise to fame, from their humble hometown beginnings and competing on the X-Factor, to conquering the world and performing at London''s famed O2 Arena. Hear it from the boys themselves and see through their own eyes what it''s really like to be One Direction. Written by Sony Pictures Entertainment', '92 min', 'http://ia.media-imdb.com/images/M/MV5BMTk5NTIxNzg3Nl5BMl5BanBnXkFtZTcwMzc5MDE0OQ@@._V1_SX214_.jpg', '30 August 2013 (USA)', 3.29999999999999982, 'One Direction: This Is Us', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (277, 'Getaway is the gritty, exciting action thriller from Warner Brothers in which former race car driver Brent Magna is pitted against the clock as he commandeers a custom Shelby Super Snake Mustang, taking it and its unwitting owner on a high-speed adventure at the command of a mysterious villain on a race against time to save the life of his kidnapped wife. Written by anonymous', '90 min', 'http://ia.media-imdb.com/images/M/MV5BMTM5NTkzNzk0NF5BMl5BanBnXkFtZTcwMTQwNjE5OQ@@._V1_SY317_CR0,0,214,317_.jpg', '30 August 2013 (USA)', 4, 'Getaway', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (278, 'A high-profile terrorism case unexpectedly binds together two ex-lovers on the defense team - testing the limits of their loyalties and placing their lives in jeopardy.', '96 min', 'http://ia.media-imdb.com/images/M/MV5BMjc3MTU2MzI2Ml5BMl5BanBnXkFtZTcwMzI3ODI2OQ@@._V1_SX214_.jpg', '28 August 2013 (USA)', 5.79999999999999982, 'Closed Circuit', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (279, 'The rivalry between the manipulative boss of an advertising agency and her talented protégée escalates from stealing credit to public humiliation to murder.', '102 min', 'http://ia.media-imdb.com/images/M/MV5BMjMwOTg4NjQ0MV5BMl5BanBnXkFtZTcwMTkzMDg2OQ@@._V1_SX214_.jpg', '11 July 2013 (Portugal)', 5.40000000000000036, 'Paixão', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (280, 'Valentin is Acapulco''s resident playboy, until a former fling leaves a baby on his doorstep and takes off without a trace. Leaving Mexico for Los Angeles to find the baby''s mother, Valentin ends up finding a new home for himself and his newfound daughter, Maggie. An unlikely father figure, Valentin raises Maggie for six years, while also establishing himself as one of Hollywood''s top stuntmen to pay the bills, with Maggie acting as his on-set coach. As Valentin raises Maggie, she forces him to grow up too. But their unique and offbeat family is threatened when Maggie''s birth mom shows up out of the blue, and Valentin realizes he''s in danger of losing his daughter - and his best friend. Written by Pantaleon Films', '122 min', 'http://ia.media-imdb.com/images/M/MV5BMTUyNjI3ODI0N15BMl5BanBnXkFtZTcwMTQ1NTY5OQ@@._V1_SX214_.jpg', '6 September 2013 (USA)', 7.20000000000000018, 'Instructions Not Included', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (281, 'A former valedictorian quits her reporter job in New York and returns to the place she last felt happy: her childhood home in Connecticut. She gets work as a lifeguard and starts a dangerous relationship with a troubled teenager.', '98 min', 'http://ia.media-imdb.com/images/M/MV5BMjExOTI5MjY3Ml5BMl5BanBnXkFtZTcwMjU2NDk3OQ@@._V1_SX214_.jpg', '19 January 2013 (USA)', 5.5, 'The Lifeguard', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (282, 'Armed with nothing more than twigs, their imaginations and a simple set of rules, a group of 12-year-olds engaged in a lively game of Capture the Flag in the neighborhood woods start dangerously blurring the lines between make-believe and reality. Paint-filled balloons = Grenades. Trees = Control towers. Sticks = Sub-machine guns. The youthful innocence of the game gradually takes on a different tone as the quest for victory pushes the boundaries of friendship. The would-be warriors get a searing glimpse of humanity''s dark side as their combat scenario takes them beyond the rules of the game and into an adventure where fantasy combat clashes with the real world. Written by Anonymous', '94 min', 'http://ia.media-imdb.com/images/M/MV5BOTg4NTQyODIyM15BMl5BanBnXkFtZTcwMjI1OTQ4OQ@@._V1_SY317_CR0,0,214,317_.jpg', '15 April 2012 (USA)', 5.90000000000000036, 'I Declare War', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (283, 'Betrayed by his own kind and left for dead on a desolate planet, Riddick fights for survival against alien predators and becomes more powerful and dangerous than ever before. Soon bounty hunters from throughout the galaxy descend on Riddick only to find themselves pawns in his greater scheme for revenge. With his enemies right where he wants them, Riddick unleashes a vicious attack of vengeance before returning to his home planet of Furya to save it from destruction. Written by Shock Till You Drop', '119 min', 'http://ia.media-imdb.com/images/M/MV5BMTk5NzYwMzQ4MV5BMl5BanBnXkFtZTcwMjE5MTI1OQ@@._V1_SX214_.jpg', '6 September 2013 (USA)', 6.70000000000000018, 'Riddick', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (284, 'An unprecedented look inside the private world of J.D. Salinger, the reclusive author of The Catcher in the Rye.', '120 min', 'http://ia.media-imdb.com/images/M/MV5BMTQ1MjM4NTMyMl5BMl5BanBnXkFtZTcwNzE3MDkzOQ@@._V1_SX214_.jpg', '5 September 2013 (Australia)', 5.79999999999999982, 'Salinger', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (285, 'What happens when three young people in today''s changing India try to figure out what love, attraction and commitment mean to each of them? Raghu (Shushant Singh Rajput) needs a woman in his life -the rest he''s going to figure out along the way. Gayatri (Parineeti Chopra) has been around the block a few times and knows the scene, warts and all. Tara (Vaani Kapoor) knows what''s right for her, but a little experimenting never did hurt anybody, did it? When their lives crisscross, their beliefs get challenged, and their loves, tested. We all want it all...the love, the sex, the relationship, the commitment. But when we get it, it may not be in the way we recognize. Written by Yash Raj Films', '141 min', 'http://ia.media-imdb.com/images/M/MV5BMTU0NjI2MTI0Ml5BMl5BanBnXkFtZTcwNjI4MzY5OQ@@._V1_SY317_CR8,0,214,317_.jpg', '6 September 2013 (India)', 5.90000000000000036, 'Shuddh Desi Romance', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (286, 'Jason Stevens survived the journey his grandfather Red Stevens sent him through for "the Ultimate Gift". Now...That gift which includes managing a Billion dollar foundation is being challenged by his own family. In a courtroom battle...his assets are seized...his love interest with Alexia gets complicated...Jason could lose it all...He is now on a quest to discover what it truly means to fulfill his destiny...And Live. Written by Anonymous', '', 'http://ia.media-imdb.com/images/M/MV5BMjI5ODU3NjQyNl5BMl5BanBnXkFtZTcwNDA2NTU3OQ@@._V1_SX214_.jpg', '6 September 2013 (USA)', 3.70000000000000018, 'The Ultimate Life', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (287, 'A massage therapist is unable to do her job when stricken with a mysterious and sudden aversion to bodily contact. Meanwhile, her uptight brother''s floundering dental practice receives new life when clients seek out his healing touch.', '89 min', 'http://ia.media-imdb.com/images/M/MV5BNjc1NjIyMzk5M15BMl5BanBnXkFtZTcwMDk2NjE3OQ@@._V1_SX214_.jpg', '19 January 2013 (USA)', 4.90000000000000036, 'Touchy Feely', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (301, 'A divorced and single parent, Eva (Julia Louis-Dreyfus) spends her days enjoying work as a masseuse but dreading her daughter''s impending departure for college. She meets Albert (James Gandolfini) - a sweet, funny and like-minded man also facing an empty nest. As their romance quickly blossoms, Eva befriends Marianne (Catherine Keener), her new massage client. Marianne is a beautiful poet who seems "almost perfect" except for one prominent quality: she rags on her ex-husband way too much. Suddenly, Eva finds herself doubting her own relationship with Albert as she learns the truth about Marianne''s ex. Written by ID-PR', '93 min', 'http://ia.media-imdb.com/images/M/MV5BMjI2MjIwMDk2Ml5BMl5BanBnXkFtZTcwNTQ1MzQ5OQ@@._V1_SX214_.jpg', '11 October 2013 (USA)', 7.5, 'Enough Said', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (288, 'Spring, 1958. 21-year-old Rose Pamphyle lives with her grouchy widower father who runs the village store. Engaged to the son of the local mechanic, she seems destined for the quiet, drudgery-filled life of a housewife. But that''s not the life Rose longs for. When she travels to Lisieux in Normandy, where charismatic insurance agency boss Louis Echard is advertising for a secretary, the ensuing interview is a disaster. But Rose reveals a special gift - she can type at extraordinary speed. Unwittingly, the young woman awakens the dormant sports fan in Louis. If she wants the job she''ll have to compete in a speed typing competition. Whatever sacrifices Rose must make to reach the top, Louis declares himself her trainer. He''ll turn her into the fastest girl not only in the country, but in the world! But a love of sport doesn''t always mix well with love itself ... Written by The Weinstein Company', '111 min', 'http://ia.media-imdb.com/images/M/MV5BMjA2NzY4MDExOV5BMl5BanBnXkFtZTcwNTE4NzQzOQ@@._V1_SY317_CR0,0,214,317_.jpg', '27 June 2013 (Portugal)', 6.70000000000000018, 'A Datilógrafa', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (289, '''Good Ol'' Freda'' tells the story of Freda Kelly, a shy Liverpudlian teenager asked to work for a young local band hoping to make it big: the Beatles. As the Beatles'' fame multiplies, Freda bears witness to music and cultural history but never exploits her insider access. Their loyal secretary from beginning to end, Freda finally tells her tales for the first time in 50 years. Written by Anonymous', '86 min', 'http://ia.media-imdb.com/images/M/MV5BMjIwMjU3MzUxM15BMl5BanBnXkFtZTcwNzE1NDQ4OQ@@._V1_SY317_CR0,0,214,317_.jpg', '6 September 2013 (USA)', 6.20000000000000018, 'Good Ol'' Freda', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (290, 'The haunted Lambert family seeks to uncover the mysterious childhood secret that has left them dangerously connected to the spirit world.', '106 min', 'http://ia.media-imdb.com/images/M/MV5BMTg0OTA5ODIxNF5BMl5BanBnXkFtZTcwNTUzNDg4OQ@@._V1_SX214_.jpg', '13 September 2013 (USA)', 7, 'Insidious: Chapter 2', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (291, 'A mafia boss and his family are relocated to a sleepy town in France under the witness protection program after snitching on the mob. Despite the best efforts of CIA Agent Stansfield (Tommy Lee Jones) to keep them in line, Fred Manzoni (Robert De Niro), his wife Maggie (Michelle Pfeiffer) and their children Belle (Dianna Agron) and Warren (John D''Leo) can''t help but revert to old habits and blow their cover by handling their problems the "family" way, enabling their former mafia cronies to track them down. Chaos ensues as old scores are settled in the unlikeliest of settings in this darkly funny film by Luc Besson (Taken, Transporter). Written by Minoesch', '111 min', 'http://ia.media-imdb.com/images/M/MV5BMjE2MzI0MzkyNV5BMl5BanBnXkFtZTcwMjQ2MDM2OQ@@._V1_SX214_.jpg', '13 September 2013 (USA)', 6.40000000000000036, 'The Family', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (292, 'Meet, Prem, and Amar look to have a blast at their college reunion, though they soon find themselves in another predicament.', '137 min', 'http://ia.media-imdb.com/images/M/MV5BMTQwOTc3MjM5N15BMl5BanBnXkFtZTgwMjcxODEyMDE@._V1_SX214_.jpg', '13 September 2013 (USA)', 4.20000000000000018, 'Grand Masti', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (293, 'WADJDA is a 10-year-old girl living in a suburb of Riyadh, the capital of Saudi Arabia. Although she lives in a conservative world, Wadjda is fun loving, entrepreneurial and always pushing the boundaries of what she can get away with. After a fight with her friend Abdullah, a neighborhood boy she shouldn''t be playing with, Wadjda sees a beautiful green bicycle for sale. She wants the bicycle desperately so that she can beat Abdullah in a race. But Wadjda''s mother won''t allow it, fearing repercussions from a society that sees bicycles as dangerous to a girl''s virtue. So Wadjda decides to try and raise the money herself. At first, Wadjda''s mother is too preoccupied with convincing her husband not to take a second wife to realize what''s going on. And soon enough Wadjda''s plans are thwarted when she is caught running various schemes at school. Just as she is losing hope of raising enough money, she hears of a cash prize for a Koran recitation competition at her school. She devotes herself... Written by Razor Film Produktion GmbH', '98 min', 'http://ia.media-imdb.com/images/M/MV5BMjI4MzMyNzM2Ml5BMl5BanBnXkFtZTgwNDQ5MDgwMDE@._V1_SX214_.jpg', '5 September 2013 (Germany)', 7.79999999999999982, 'Wadjda', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (294, 'An abandoned boy is lured to America and drawn into the shadow of a dangerous father figure. Inspired by the real life events that led to the 2002 Beltway sniper attacks.', '93 min', 'http://ia.media-imdb.com/images/M/MV5BNzYwMTcyMzU5OV5BMl5BanBnXkFtZTgwOTAwOTUwMDE@._V1_SY317_CR0,0,214,317_.jpg', '19 January 2013 (USA)', 6.09999999999999964, 'Blue Caprice', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (295, 'A follow up to award winning documentary ''Herb & Dorothy'', the film captures the ordinary couple''s extraordinary gift of art to the nation as they close the door on their life as collectors. When Herb and Dorothy Vogel, a retired postal clerk and librarian, began collecting works of contemporary art in the 1960s, they never imagined it would outgrow their one bedroom Manhattan apartment and spread throughout America. 50 years later, the collection is nearly 5,000 pieces and worth millions. Refusing to sell, the couple launches an unprecedented gift project giving artworks to one museum in all 50 states. The film journeys around the country with the Vogels, meeting artists who are famous or unknown, often controversial, striking today''s society with questions about art and its survival. Written by Anonymous', '87 min', 'http://ia.media-imdb.com/images/M/MV5BMTM5MjYyMzQzMl5BMl5BanBnXkFtZTgwNDA4MDEwMDE@._V1_SX214_.jpg', '13 September 2013 (USA)', 5.29999999999999982, 'Herb & Dorothy 50X50', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (296, 'A documentary on radical left-wing activist turned FBI informant, Brandon Darby.', '81 min', 'http://ia.media-imdb.com/images/M/MV5BNzYxMzM2ODQ0N15BMl5BanBnXkFtZTgwNDMzMjExMDE@._V1_SX214_.jpg', '13 September 2013 (USA)', 5.20000000000000018, 'Informant', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (297, 'A documentary focused on former Vogue Paris editor-in-chief and fashion stylist Carine Roitfeld as she moves to New York to launch her own magazine.', '93 min', 'http://ia.media-imdb.com/images/M/MV5BMTg0MDc4NTQ5OV5BMl5BanBnXkFtZTgwODcyNjYwMDE@._V1_SY317_CR2,0,214,317_.jpg', '11 September 2013 (USA)', 5.29999999999999982, 'Mademoiselle C', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (298, 'A young man in the 1940s raises a family in Alabama after his wife leaves him for an Englishman and moves to England. When the wife dies, she leaves a request to be brought back to Alabama to be buried, and at that point the man hasn''t seen her in nearly 30 years. The two families - her original family she abandoned and her English family - meet and make an attempt to adjust to each other, with uneven results. Written by alfiehitchie', '122 min', 'http://ia.media-imdb.com/images/M/MV5BNTcxMzMxNTEyMF5BMl5BanBnXkFtZTcwODIxNjg5OQ@@._V1_SX214_.jpg', '20 August 2013 (USA)', 6, 'Jayne Mansfield''s Car', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (299, 'How far would you go to protect your family? Keller Dover is facing every parent''s worst nightmare. His six-year-old daughter, Anna, is missing, together with her young friend, Joy, and as minutes turn to hours, panic sets in. The only lead is a dilapidated RV that had earlier been parked on their street. Heading the investigation, Detective Loki arrests its driver, Alex Jones, but a lack of evidence forces his release. As the police pursue multiple leads and pressure mounts, knowing his child''s life is at stake the frantic Dover decides he has no choice but to take matters into his own hands. But just how far will this desperate father go to protect his family? Written by Warner Bros. Pictures', '153 min', 'http://ia.media-imdb.com/images/M/MV5BMTg0NTIzMjQ1NV5BMl5BanBnXkFtZTcwNDc3MzM5OQ@@._V1_SY317_CR0,0,214,317_.jpg', '20 September 2013 (USA)', 8.09999999999999964, 'Prisoners', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (305, 'In this charming film based on the popular L. Frank Baum stories, Dorothy and her dog Toto are caught in a tornado''s path and somehow end up in the land of Oz. Here she meets some memorable friends and foes in her journey to meet the Wizard of Oz who everyone says can help her return home and possibly grant her new friends their goals of a brain, heart and courage. Written by Dale Roloff', '102 min', 'http://ia.media-imdb.com/images/M/MV5BMTU0MTA2OTIwNF5BMl5BanBnXkFtZTcwMzA0Njk3OA@@._V1_SY317_CR10,0,214,317_.jpg', '25 August 1939 (USA)', 8.09999999999999964, 'The Wizard of Oz', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (306, 'Set against the sexy, glamorous golden age of Formula 1 racing in the 1970s, the film is based on the true story of a great sporting rivalry between handsome English playboy James Hunt (Hemsworth), and his methodical, brilliant opponent, Austrian driver Niki Lauda (Bruhl). The story follows their distinctly different personal styles on and off the track, their loves and the astonishing 1976 season in which both drivers were willing to risk everything to become world champion in a sport with no margin for error: if you make a mistake, you die. Written by P. Morgan', '123 min', 'http://ia.media-imdb.com/images/M/MV5BMTQyMDE0MTY0OV5BMl5BanBnXkFtZTcwMjI2OTI0OQ@@._V1_SX214_.jpg', '27 September 2013 (USA)', 8.30000000000000071, 'Rush', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (307, 'After the disastrous food storm in the first film, Flint and his friends are forced to leave the town. Flint accepts the invitation from his idol Chester V to join The Live Corp Company, which has been tasked to clean the island, and where the best inventors in the world create technologies for the betterment of mankind. When Flint discovers that his machine still operates and now creates mutant food beasts like living pickles, hungry tacodiles, shrimpanzees and apple pie-thons, he and his friends must return to save the world. Written by Reese Sara Eversting', '95 min', 'http://ia.media-imdb.com/images/M/MV5BMTYzNDM0MDI1NF5BMl5BanBnXkFtZTcwNzQ5NzYxOQ@@._V1_SX214_.jpg', '27 September 2013 (USA)', 6.5, 'Cloudy with a Chance of Meatballs 2', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (308, 'Determined to get engaged before her youngest sister''s wedding, flight attendant Montana Moore (Paula Patton) finds herself with only 30 days to find Mr. Right. Using her airline connections to "accidentally" meet up with eligible ex-boyfriends and scour for potential candidates, she racks up more than 30,000 miles and countless comedic encounters, all the while searching for the perfect guy. Written by Fox Searchlight', '96 min', 'http://ia.media-imdb.com/images/M/MV5BMjIyNDU4NTY3M15BMl5BanBnXkFtZTcwOTA3MDA1OQ@@._V1_SX214_.jpg', '27 September 2013 (USA)', 3.79999999999999982, 'Baggage Claim', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (309, 'Jon Martello objectifies everything in his life: his apartment, his car, his family, his church, and, of course, women. His buddies even call him Don Jon because of his ability to pull "10s" every weekend without fail. Yet even the finest flings don''t compare to the transcendent bliss he achieves alone in front of the computer watching pornography. Dissatisfied, he embarks on a journey to find a more gratifying sex life, but ends up learning larger lessons of life and love through relationships with two very different women. Written by SophiaLB', '90 min', 'http://ia.media-imdb.com/images/M/MV5BMTQxNTc3NDM2MF5BMl5BanBnXkFtZTcwNzQ5NTQ3OQ@@._V1._CR28,28.649993896484375,1271,1991.0000305175781_SX214_.jpg', '27 September 2013 (USA)', 7.20000000000000018, 'Don Jon', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (310, 'Located alongside the Tennessee River, Muscle Shoals, Alabama is the unlikely breeding ground for some of America''s most creative and defiant music. Under the spiritual influence of the ''Singing River'' as Native Americans called it, the music of Muscle Shoals changed the world and sold millions upon millions of copies. At its heart is Rick Hall who founded FAME Studios. Overcoming crushing poverty and staggering tragedies, he brought black and white together in Alabama''s cauldron of racial hostility to create music for the generations while giving birth to the ''Muscle Shoals Sound'' and ''The Swampers''. Mick Jagger, Keith Richards, Percy Sledge, Gregg Allman, Clarence Carter, Etta James, Alicia Keys, Bono, and others bear witness to Muscle Shoals'' magnetism, mystery, and why it remains influential today. Written by Anonymous', '111 min', 'http://ia.media-imdb.com/images/M/MV5BMTUzMzU1MTA0N15BMl5BanBnXkFtZTgwMjY3MDgwMDE@._V1_SX214_.jpg', '25 October 2013 (UK)', 6.5, 'Muscle Shoals', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (311, 'A seemingly wholesome and benevolent family, the Parkers have always kept to themselves, and for good reason. Behind closed doors, patriarch Frank rules his family with a rigorous fervor, determined to keep his ancestral customs intact at any cost. As a torrential rainstorm moves into the area, tragedy strikes and his daughters Iris and Rose are forced to assume responsibilities that extend beyond those of a typical family. As the unrelenting downpour continues to flood their small town, the local authorities begin to uncover clues that bring them closer to the secret that the Parkers have held closely for so many years. Written by Entertainment One', '105 min', 'http://ia.media-imdb.com/images/M/MV5BMjI3NjI3NjAyN15BMl5BanBnXkFtZTgwODE3NzMxMDE@._V1_SY317_CR0,0,214,317_.jpg', '25 October 2013 (UK)', 5.70000000000000018, 'We Are What We Are', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (312, 'A documentary that follows former U.S. Labor Secretary Robert Reich as he looks to raise awareness of the country''s widening economic gap.', '89 min', 'http://ia.media-imdb.com/images/M/MV5BMTY5NjUwNjU1OF5BMl5BanBnXkFtZTgwOTI2NjEwMDE@._V1_SX214_.jpg', '19 January 2013 (USA)', 6.70000000000000018, 'Inequality for All', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (313, 'Dr. Ryan Stone (Sandra Bullock) is a brilliant medical engineer on her first shuttle mission, with veteran astronaut Matt Kowalsky (George Clooney) in command of his last flight before retiring. But on a seemingly routine spacewalk, disaster strikes. The shuttle is destroyed, leaving Stone and Kowalsky completely alone - tethered to nothing but each other and spiraling out into the blackness. Written by MuTaTeD', '91 min', 'http://ia.media-imdb.com/images/M/MV5BNjE5MzYwMzYxMF5BMl5BanBnXkFtZTcwOTk4MTk0OQ@@._V1_SY317_CR0,0,214,317_.jpg', '4 October 2013 (USA)', 8.5, 'Gravity', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (314, 'Princeton grad student Richie, believing he''s been swindled, travels to Costa Rica to confront online gambling tycoon Ivan Block. Richie is seduced by Block''s promise of immense wealth, until he learns the disturbing truth about his benefactor. When the FBI tries to coerce Richie to help bring down Block, Richie faces his biggest gamble ever: attempting to outmaneuver the two forces closing in on him. Written by 20th Century Fox Distribution', '91 min', 'http://ia.media-imdb.com/images/M/MV5BMTU5OTA0MjI4Ml5BMl5BanBnXkFtZTgwMTgxOTQwMDE@._V1_SY317_CR0,0,214,317_.jpg', '4 October 2013 (USA)', 5.29999999999999982, 'Runner Runner', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (315, 'Rachel is an intelligent, modern-day woman constantly on the move. Primarily focused on her career as a diplomatic consul for the U.S. embassy, she''s literally lived her life on the move, globe-trotting from city to city. Currently working in Mexico City and set to leave for London, Rachel''s world turns upside down on the eve of her own goodbye party when she gets drunk and passes out on the street. Saved by Alejandro, a handsome Mariachi singer and single father, Rachel wakes up in his apartment with no recollection of how she got there. Nor does she remember that she rejected his visa the day before, which he desperately needs for his daughter. Romance unexpectedly blossoms between the two, but either sparks or fists will fly after she finds out his secret. Written by Pantelion Films', '111 min', 'http://ia.media-imdb.com/images/M/MV5BMTk4NjAxMTYyMF5BMl5BanBnXkFtZTgwOTY4MDEzMDE@._V1_SX214_.jpg', '8 November 2013 (Mexico)', 4.90000000000000036, 'Pulling Strings', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (316, 'Babli (Ranbir Kapoor) is a street smart car mechanic living in a Delhi orphanage. He is charming and lives life to the fullest. He also steals cars to support his orphanage. He has no sense of right or wrong till he unwittingly hurts the love of his life, Tara (Pallavi Sharda) and is chased by cop couple Chulbul Chautala (Rishi Kapoor) and Bulbul Chautala (Neetu Kapoor). Babli realizes that there is no right way of doing the wrong thing. Babli sets out to fix all the wrongs in his life and he continues to be shameless about it. Written by Reliance Entertainment', '143 min', 'http://ia.media-imdb.com/images/M/MV5BMjI1NTk0NzgyOV5BMl5BanBnXkFtZTgwODQ3NjgyMDE@._V1_SX214_.jpg', '2 October 2013 (India)', 3.70000000000000018, 'Besharam', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (317, 'Grace Unplugged is an Inspirational movie starring Amanda "AJ" Michalka as 18 year old Christian singer/songwriter, Grace Rose Trey. Beautiful, highly talented and restless, Grace is so far undiscovered outside church. She performs there each Sunday with her gifted father Johnny, the praise music director at Freedom Community Chapel, a small town Alabama church. A former rock star, Johnny Trey charted a Billboard number one single 20 years before. When the hits stopped coming he crash landed hard, a one hit wonder. Johnny found Christ and a new life for his family, far from the Hollywood Hills. One day without warning, Grace leaves for Los Angeles. She has landed a record deal with the help of Johnny''s ruthless former manager and producer Frank "Mossy" Mostin. Mossy sees in Grace a potential pop superstar - the next Katie Perry. Cutting off contact with her parents, Grace seems prepared to walk away from her Christian faith and music to achieve her long-suppressed fantasy of Hollywood... Written by Chris Zarpas', '102 min', 'http://ia.media-imdb.com/images/M/MV5BMTA4MzY3MzA1MTZeQTJeQWpwZ15BbWU3MDY1MTE2Nzk@._V1_SX214_.jpg', '4 October 2013 (USA)', 5.5, 'Grace Unplugged', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (318, 'A.C.O.D. follows a seemingly well-adjusted Adult Child of Divorce (Adam Scott) who is forced to revisit the chaos of his parents (Catherine O''Hara and Richard Jenkins) bitter divorce all over again after his younger brother (Clark Duke) decides to get married. Written by The Film Arcade', '88 min', 'http://ia.media-imdb.com/images/M/MV5BMTQwNTc5MjkyNF5BMl5BanBnXkFtZTgwNzQ5NTYwMDE@._V1_SX214_.jpg', '23 January 2013 (USA)', 5.5, 'A.C.O.D.', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (319, 'After a blow to the head, Abby decides she can''t do it anymore. Her life just can''t be only about the house, the kids and the wife. She needs more: she needs to be Eleanor.', '96 min', 'http://ia.media-imdb.com/images/M/MV5BMjMxNDAyODI0Ml5BMl5BanBnXkFtZTgwNTAzMTUzMDE@._V1_SX214_.jpg', '4 October 2013 (USA)', 5.5, 'Concussion', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (320, 'Recounting the chaotic events that occurred in Dallas, Texas on November 22, 1963, Parkland weaves together the perspectives of a handful of ordinary individuals suddenly thrust into extraordinary circumstances: the young doctors and nurses at Parkland Hospital; Dallas'' chief of the Secret Service; an unwitting cameraman who captured what became the most watched and examined film in history; the FBI agents who nearly had the gunman within their grasp; the brother of Lee Harvey Oswald, left to deal with his shattered family; and JFK''s security team, witnesses to both the president''s death and Vice President Lyndon Johnson''s rise to power over a nation whose innocence was forever altered. Written by Exclusive Media Group', '93 min', 'http://ia.media-imdb.com/images/M/MV5BMjE2NjkwNDE2MF5BMl5BanBnXkFtZTgwNDY5ODIxMDE@._V1_SX214_.jpg', '2 October 2013 (France)', 6, 'Parkland', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (321, 'In February 2012, an entire nation of basketball fans unexpectedly went ''Linsane.'' Stuck in the mire of a disappointing season, the New York Knicks did what no other NBA team had thought about doing. They gave backup point guard Jeremy Lin an opportunity to prove himself. He took full advantage, scoring more points in his first five NBA starts than any other player in the modern era, and created a legitimate public frenzy in the process. Prior to this now-legendary run, Lin had faced adversity in his career at every turn. He wasn''t offered a scholarship by any major university, nor was he drafted by any NBA team after a standout collegiate career at Harvard. Written by Sundance', '89 min', 'http://ia.media-imdb.com/images/M/MV5BMjAxNzU4ODM3Nl5BMl5BanBnXkFtZTgwNTIwMTEyMDE@._V1_SX214_.jpg', '4 October 2013 (USA)', 5.5, 'Linsanity', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (322, 'Two French Canadian ne''er-do-wells travel to New York City with a scheme to get rich quick selling Christmas trees. Easygoing charmer Rene (Paul Rudd) clashes with misanthropic ex-con Dennis (Paul Giamatti), whose wife Rene just stole. Still, this odd couple must make an honest go of it in this fresh buddy comedy co-starring Sally Hawkins, by the director of the indie breakout hit Junebug. Written by Anonymous', '107 min', 'http://ia.media-imdb.com/images/M/MV5BMjE2ODg4MDUzOF5BMl5BanBnXkFtZTgwMzk5MjkxMDE@._V1_SY317_CR0,0,214,317_.jpg', '10 September 2013 (USA)', 5.40000000000000036, 'All Is Bright', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (323, 'On May 13, 1985, Philadelphia police dropped two pounds of military explosives onto a city row house occupied by the radical group MOVE. The resulting fire was not fought for over an hour although firefighters were on the scene with water cannons in place. Five children and six adults were killed and sixty-one homes were destroyed by the six-alarm blaze, one of the largest in the city''s history. This dramatic tragedy unfolds through an extraordinary visual record previously withheld from the public. It is a graphic illustration of how prejudice, intolerance and fear can lead to unthinkable acts of violence. Written by Anonymous', '88 min', 'http://ia.media-imdb.com/images/M/MV5BOTE5NjkwMjE3Nl5BMl5BanBnXkFtZTgwNzI4NDgyMDE@._V1_SX214_.jpg', '2 October 2013 (USA)', 7, 'Let the Fire Burn', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (324, 'The story of the deadliest day on the world''s most dangerous mountain, when 11 climbers mysteriously perished on K2.', '95 min', 'http://ia.media-imdb.com/images/M/MV5BMjE0NTYxODMwNV5BMl5BanBnXkFtZTgwOTE5OTAyMDE@._V1_SX214_.jpg', '1 November 2013 (Sweden)', 5.70000000000000018, 'The Summit', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (325, 'Ken is an average guy who works at an average office job. But he starts to get pains in his stomach whenever he feels stressed out. Things get worse every time he tries to just hide his stress, by burying it inside. It all comes to a head when that "stress" is turned in to an actual little beast that exits his body via his butt and takes revenge on the things that stress him out. But it soon starts to threaten the one thing he loves, his wife. Written by Michael Hallows Eve', '85 min', 'http://ia.media-imdb.com/images/M/MV5BMTQzNTA5MTEwN15BMl5BanBnXkFtZTcwMDk1ODU5OQ@@._V1_SY317_CR0,0,214,317_.jpg', '29 August 2013 (USA)', 5.40000000000000036, 'Bad Milo', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (326, 'Captain Phillips is a multi-layered examination of the 2009 hijacking of the U.S. container ship Maersk Alabama by a crew of Somali pirates. It is - through director Paul Greengrass''s distinctive lens - simultaneously a pulse-pounding thriller, and a complex portrait of the myriad effects of globalization. The film focuses on the relationship between the Alabama''s commanding officer, Captain Richard Phillips (two time Academy Award®-winner Tom Hanks), and the Somali pirate captain, Muse (Barkhad Abdi), who takes him hostage. Phillips and Muse are set on an unstoppable collision course when Muse and his crew target Phillips'' unarmed ship; in the ensuing standoff, 145 miles off the Somali coast, both men will find themselves at the mercy of forces beyond their control. Written by Sony Pictures Entertainment', '134 min', 'http://ia.media-imdb.com/images/M/MV5BMTQzNzExMDg3Ml5BMl5BanBnXkFtZTgwODU1NzEzMDE@._V1_SX214_.jpg', '11 October 2013 (USA)', 8.09999999999999964, 'Captain Phillips', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (331, 'The orphan Mandy Lane is a beautiful, virgin and pure teenager raised by her aunt, desired by her schoolmates and a close friend of the outcast Emmet. After the death of their high school mate in a pool party, Mandy befriends Chloe, Marlin, Red, Bird and Jake. Red invites the group for a weekend party in the isolated ranch of his family, with all the boys disputing who would succeed in having sex with Mandy Lane. They meet the henchman Garth that takes care of the ranch and he asks the group to go easy on the drugs and booze. In the middle of the night, a stranger wearing a hood attacks Marlin in the barn; when Jake seeks her out, he faces the killer, beginning a night of bloodshed and terror. Written by Claudio Carvalho, Rio de Janeiro, Brazil', '90 min', 'http://ia.media-imdb.com/images/M/MV5BMzM0MjU1MzUzMF5BMl5BanBnXkFtZTcwMjcwNDQyOQ@@._V1_SY317_CR0,0,214,317_.jpg', '6 September 2013 (USA)', 5.59999999999999964, 'All the Boys Love Mandy Lane', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (332, 'CBGB follows the story of Hilly Kristal''s New York club from its conceit as a venue for Country, Bluegrass and Blues (CBGB) to what it ultimately became: the birthplace of underground rock ''n roll and punk. When Kristal had difficulty booking country bands in his club on the Bowery he opened his doors to other kinds of rock music. Kristal had one demand of the acts he booked; they could only play original music. No top 40''s, no covers. It was the credo he lived by, support the artist at whatever the cost. Hilly Kristal ironically became known as the godfather of punk giving a chance to such bands as Blondie, Television, Ramones, Talking Heads, Dead Boys and The Police. Written by anonymous', '101 min', 'http://ia.media-imdb.com/images/M/MV5BMTg1NDcxODY0OV5BMl5BanBnXkFtZTgwOTgwMzQxMDE@._V1_SY317_CR0,0,214,317_.jpg', '11 October 2013 (USA)', 6, 'CBGB', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (333, 'In the late 1800''s, a beautiful former prostitute (January Jones: "Mad Men") is trying to build an honest life with her husband in the rugged plains of New Mexico. When she catches the eye of a sadistic and powerful religious leader (Jason Isaacs: Harry Potter series), her life is violently turned upside down. She embarks on a bloody course of vengeance with the assistance of a renegade sheriff (Ed Harris: Pollock, The Hours, A Beautiful Mind, Apollo 13) who has pretty violent tendencies of his own. Written by ARC Entertainment', '95 min', 'http://ia.media-imdb.com/images/M/MV5BMjM1NzUyNjE0MF5BMl5BanBnXkFtZTgwNTIwMzkyMDE@._V1_SX214_.jpg', '11 October 2013 (USA)', 6.09999999999999964, 'Sweetwater', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (334, 'Devastated by the death of her younger sister, Lily Morel seeks solace at the spiritualist community of Cassadaga. But instead of finding closure, she contacts something else - the vengeful ghost of a murdered young woman. With her life crumbling all-around her, Lily races to unravel the mysterious circumstances surrounding the woman''s death - a task that will bring her face-to-face with a sadistic serial killer known only as "Geppetto". Written by Bruce Wood', '108 min', 'http://ia.media-imdb.com/images/M/MV5BMTUwNjk4OTI0MF5BMl5BanBnXkFtZTgwNDMzMzUzMDE@._V1_SX214_.jpg', '11 October 2013 (USA)', 5.09999999999999964, 'Cassadaga', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (335, 'A reimagining of the classic horror tale about Carrie White (Chloë Grace Moretz), a shy girl outcast by her peers and sheltered by her deeply religious mother (Julianne Moore), who unleashes telekinetic terror on her small town after being pushed too far at her senior prom. Based on the best-selling novel by Stephen King, Carrie is directed by Kimberly Peirce with a screenplay by Lawrence D. Cohen and Roberto Aguirre-Sacasa. Written by Sony Pictures Entertainment', '100 min', 'http://ia.media-imdb.com/images/M/MV5BMTc1MDIyOTkxN15BMl5BanBnXkFtZTgwMTU1NzEzMDE@._V1_SY317_CR0,0,214,317_.jpg', '18 October 2013 (USA)', 6.40000000000000036, 'Carrie', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (336, 'The story begins as WikiLeaks founder Julian Assange (Benedict Cumberbatch) and his colleague Daniel Domscheit-Berg (Daniel Brühl) team up to become underground watchdogs of the privileged and powerful. On a shoestring, they create a platform that allows whistle-blowers to anonymously leak covert data, shining a light on the dark recesses of government secrets and corporate crimes. Soon, they are breaking more hard news than the world''s most legendary media organizations combined. But when Assange and Berg gain access to the biggest trove of confidential intelligence documents in U.S. history, they battle each other and a defining question of our time: what are the costs of keeping secrets in a free society-and what are the costs of exposing them? Written by DreamWorks Pictures', '128 min', 'http://ia.media-imdb.com/images/M/MV5BMjY1MTY5NTg3M15BMl5BanBnXkFtZTgwMDQyMjgwMDE@._V1_SX214_.jpg', '18 October 2013 (USA)', 5.70000000000000018, 'The Fifth Estate', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (337, 'Based on an incredible true story of one man''s fight for survival and freedom. In the pre-Civil War United States, Solomon Northup (Chiwetel Ejiofor), a free black man from upstate New York, is abducted and sold into slavery. Facing cruelty (personified by a malevolent slave owner, portrayed by Michael Fassbender), as well as unexpected kindnesses, Solomon struggles not only to stay alive, but to retain his dignity. In the twelfth year of his unforgettable odyssey, Solomon''s chance meeting with a Canadian abolitionist (Brad Pitt) will forever alter his life. Written by Fox Searchlight', '134 min', 'http://ia.media-imdb.com/images/M/MV5BMjExMTEzODkyN15BMl5BanBnXkFtZTcwNTU4NTc4OQ@@._V1_SX214_.jpg', '8 November 2013 (USA)', 8.69999999999999929, '12 Years a Slave', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (338, 'Ray Breslin is the world''s foremost authority on structural security. After analyzing every high security prison and learning a vast array of survival skills so he can design escape-proof prisons, his skills are put to the test. He''s framed and incarcerated in a master prison he designed himself. He needs to escape and find the person who put him behind bars. Written by Anonymous', '115 min', 'http://ia.media-imdb.com/images/M/MV5BMTk3OTcxMTEyNl5BMl5BanBnXkFtZTcwMDQ4MjQ2OQ@@._V1_SY317_CR0,0,214,317_.jpg', '18 October 2013 (USA)', 7.20000000000000018, 'Escape Plan', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (339, 'Deep into a solo voyage in the Indian Ocean, an unnamed man (Redford) wakes to find his 39-foot yacht taking on water after a collision with a shipping container left floating on the high seas. With his navigation equipment and radio disabled, the man sails unknowingly into the path of a violent storm. Despite his success in patching the breached hull, his mariner''s intuition and a strength that belies his age, the man barely survives the tempest. Using only a sextant and nautical maps to chart his progress, he is forced to rely on ocean currents to carry him into a shipping lane in hopes of hailing a passing vessel. But with the sun unrelenting, sharks circling and his meager supplies dwindling, the ever-resourceful sailor soon finds himself staring his mortality in the face. Written by Roadside Attractions', '106 min', 'http://ia.media-imdb.com/images/M/MV5BMjI0MzIyMjU1N15BMl5BanBnXkFtZTgwOTk1MjQxMDE@._V1_SX214_.jpg', '7 November 2013 (Greece)', 7.59999999999999964, 'All Is Lost', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (340, 'A murder in 1944 draws together the great poets of the beat generation: Allen Ginsberg, Jack Kerouac and William Burroughs.', '104 min', 'http://ia.media-imdb.com/images/M/MV5BMjA4MzAxMTE1N15BMl5BanBnXkFtZTgwMDY2OTIxMDE@._V1_SX214_.jpg', '17 October 2013 (Italy)', 6.90000000000000036, 'Kill Your Darlings', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (373, 'An advertising executive is kidnapped and held hostage for 20 years in solitary confinement. When he is inexplicably released, he embarks on an obsessive mission to discover who orchestrated his punishment, only to find he is still trapped in a web of conspiracy and torment. Written by FilmDistrict', '104 min', 'http://ia.media-imdb.com/images/M/MV5BMTg4NTQ3MDc1MV5BMl5BanBnXkFtZTgwMTA0MTY1MDE@._V1_SX214_.jpg', '27 November 2013 (USA)', -1, 'Oldboy', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (341, 'A rich and successful lawyer named Counsellor is about to get married to his fiancée but soon meets up with the middle-man known as Westray who tells him his drug trafficking plan has taken a horrible twist and now he must protect himself and his soon bride-to-be lover as the truth of the drug business uncovers and targets become chosen. Written by Anonymous', '117 min', 'http://ia.media-imdb.com/images/M/MV5BMTc3ODk0MTY0N15BMl5BanBnXkFtZTgwOTU2MTEzMDE@._V1_SY317_CR0,0,214,317_.jpg', '25 October 2013 (USA)', 6, 'The Counselor', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (342, 'Eighty-six-year-old Irving Zisman is on a journey across America with the most unlikely companion: his eight-year-old grandson Billy, in "Jackass Presents: Bad Grandpa". This October, the signature Jackass characters Irving Zisman (Johnny Knoxville) and Billy (Jackson Nicoll) will take movie audiences along for the most insane hidden camera road trip ever captured on camera. Along the way Irving will introduce the young and impressionable Billy to people, places, and situations that give new meaning to the term "childrearing". The duo will encounter male strippers, disgruntled child beauty pageant contestants (and their equally disgruntled mothers), funeral home mourners, biker bar patrons, and a whole lot of unsuspecting citizens. Real people in unreal situations, making for one really messed up comedy. Written by Paramount Pictures PR', '92 min', 'http://ia.media-imdb.com/images/M/MV5BMTg4NjIwMTI5OV5BMl5BanBnXkFtZTgwNjU1MTMyMDE@._V1_SY317_CR1,0,214,317_.jpg', '25 October 2013 (USA)', 7, 'Jackass Presents: Bad Grandpa', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (343, 'Adele''s life is changed when she meets Emma, a young woman with blue hair, who will allow her to discover desire, to assert herself as a woman and as an adult. In front of others, Adele grows, seeks herself, loses herself, finds herself.', '179 min', 'http://ia.media-imdb.com/images/M/MV5BMTQ5NTg5ODk4OV5BMl5BanBnXkFtZTgwODc4MTMzMDE@._V1_SX214_.jpg', '28 November 2013 (Portugal)', 8, 'Blue Is the Warmest Color', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (344, 'When the CEO of France''s Phenix Bank collapses on the golf course, Machiavellian young executive Marc Tourneuil is crowned as his replacement. A whirlwind of ruthless ambition, power struggles, greed and deception ensues as Tourneuil''s brutal ascent is jeopardized by a hostile takeover attempt from a large American hedge fund led by Dittmar Rigule, erotic distractions from international supermodel Nassim, and adversaries with an agenda for destruction. Written by Cohen Media Group', '114 min', 'http://ia.media-imdb.com/images/M/MV5BMjE2NDU2MDc5N15BMl5BanBnXkFtZTgwNTYwMzYzMDE@._V1_SY317_CR2,0,214,317_.jpg', '1 May 2013 (Portugal)', 6.40000000000000036, 'O Capital', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (345, 'Spinning Plates is a documentary about three extraordinary restaurants and the incredible people who make them what they are. A cutting-edge restaurant named the seventh-best in the world whose chef must battle a life-threatening obstacle to pursue his passion. A 150-year-old family restaurant still standing only because of the unbreakable bond with its community. A fledgling Mexican restaurant whose owners are risking everything just to survive and provide for their young daughter. Their unforgettable stories of family, legacy, passion and survival come together to reveal how meaningful food can be, and the power it has to connect us to one another. Written by Anonymous', '93 min', 'http://ia.media-imdb.com/images/M/MV5BMzA0ODYwODIxNV5BMl5BanBnXkFtZTgwNDE1OTE0MDE@._V1_SX214_.jpg', '25 October 2013 (USA)', 7.29999999999999982, 'Spinning Plates', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (346, 'Supertanker captain Marco Silvestri is called back urgently to Paris. His sister Sandra is desperate - her husband has committed suicide, the family business has gone under, her daughter is spiralling downwards. Sandra holds powerful businessman Edouard Laporte responsible. Marco moves into the building where Laporte has installed his mistress and her son. But he hasn''t planned for Sandra''s secrets, which muddy the waters... Written by IFC Films', '83 min', 'http://ia.media-imdb.com/images/M/MV5BMTAxNzE5NzU0MDleQTJeQWpwZ15BbWU4MDY4MzU3NDAx._V1_SY317_CR0,0,214,317_.jpg', '7 August 2013 (France)', 6.20000000000000018, 'Bastards', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (347, 'The Earth was ravaged by the Formics, an alien race seemingly determined to destroy humanity. Seventy years later, the people of Earth remain banded together to prevent their own annihilation from this technologically superior alien species. Ender Wiggin, a quiet but brilliant boy, may become the savior of the human race. He is separated from his beloved sister and his terrifying brother and brought to battle school in orbit around earth. He will be tested and honed into an empathetic killer who begins to despise what he does as he learns to fight in hopes of saving Earth and his family. Written by CrystalSinger45, Jesse Daniels, strouda56', '114 min', 'http://ia.media-imdb.com/images/M/MV5BMjAzMzI5OTgzMl5BMl5BanBnXkFtZTgwMTU5MTAwMDE@._V1_SX214_.jpg', '1 November 2013 (USA)', 7.20000000000000018, 'Ender''s Game', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (348, 'Billy (Michael Douglas), Paddy (Robert De Niro), Archie (Morgan Freeman) and Sam (Kevin Kline) have been best friends since childhood. So when Billy, the group''s sworn bachelor, finally proposes to his thirty-something (of course) girlfriend, the four head to Las Vegas with a plan to stop acting their age and relive their glory days. However, upon arriving, the four quickly realize that the decades have transformed Sin City and tested their friendship in ways they never imagined. The Rat Pack may have once played the Sands and Cirque du Soleil may now rule the Strip, but it''s these four who are taking over Vegas. Written by Production', '105 min', 'http://ia.media-imdb.com/images/M/MV5BMTQ2ODg2MTIyNF5BMl5BanBnXkFtZTgwMzU2NjgwMDE@._V1_SX214_.jpg', '1 November 2013 (USA)', 6.79999999999999982, 'Last Vegas', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (349, 'After years of fruitless warning of his farmyard brethren of the coming Thanksgiving doom, Reggie the Turkey finds himself spared as the annual Pardoned Turkey. However, Reggie''s easy life is disrupted by Jake, a fanatic turkey who drags him along with the insane idea of going back in time to make sure turkeys are not part of the first Thanksgiving. Through foolhardiness and luck, the pair manage to take an experiment time machine to do just that. Now in 1621 at the Plymouth colony, Reggie and Jake find themselves in the middle of a turkey clan''s struggle for survival. In doing so, their preconceptions of the world and themselves are challenged forever in a conflict from which the world will never be the same. Written by Kenneth Chisholm (kchishol@rogers.com)', '91 min', 'http://ia.media-imdb.com/images/M/MV5BNjE0NjIwMzAwOF5BMl5BanBnXkFtZTgwOTIyMzMzMDE@._V1_SY317_CR0,0,214,317_.jpg', '1 November 2013 (USA)', 5.09999999999999964, 'Free Birds', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (374, 'In a contemporary adaptation of Langston Hughes'' celebrated play, the holiday musical drama BLACK NATIVITY follows Langston (Jacob Latimore), a street-wise teen from Baltimore raised by a single mother, as he journeys to New York City to spend the Christmas holiday with his estranged relatives Reverend Cornell and Aretha Cobbs (Forest Whitaker and Angela Bassett). Unwilling to live by the imposing Reverend Cobbs'' rules, a frustrated Langston is determined to return home to his mother, Naima (Jennifer Hudson). Langston embarks on a surprising and inspirational journey and along with his new friends, and a little divine intervention, he discovers the true meaning of faith, healing, and family. Written by Fox Searchlight', '93 min', 'http://ia.media-imdb.com/images/M/MV5BMTg3OTkxNzkwMl5BMl5BanBnXkFtZTgwOTcyNTE2MDE@._V1_SX214_.jpg', '27 November 2013 (USA)', -1, 'Black Nativity', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (350, 'At the age of 21, Tim Lake (Domhnall Gleeson) discovers he can travel in time... The night after another unsatisfactory New Year party, Tim''s father (Bill Nighy) tells his son that the men in his family have always had the ability to travel through time. Tim can''t change history, but he can change what happens and has happened in his own life-so he decides to make his world a better place...by getting a girlfriend. Sadly, that turns out not to be as easy as you might think. Moving from the Cornwall coast to London to train as a lawyer, Tim finally meets the beautiful but insecure Mary (Rachel McAdams). They fall in love, then an unfortunate time-travel incident means he''s never met her at all. So they meet for the first time again-and again-but finally, after a lot of cunning time-traveling, he wins her heart. Tim then uses his power to create the perfect romantic proposal, to save his wedding from the worst best-man speeches, to save his best friend from professional disaster and to ... Written by Universal Pictures', '123 min', 'http://ia.media-imdb.com/images/M/MV5BMTA1ODUzMDA3NzFeQTJeQWpwZ15BbWU3MDgxMTYxNTk@._V1_SX214_.jpg', '8 November 2013 (USA)', 7.70000000000000018, 'About Time', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (351, 'Dallas 1985. Electrician and sometimes rodeo bull rider Ron Woodroof lives hard, which includes heavy smoking, drinking, drug use (primarily cocaine) and casual sex. He is a stereotypical redneck: racist and homophobic. While in the hospital on a work related injury, the doctors discover and inform him that he is HIV+, and that he will most-likely die within thirty days. Ron is initially in angry denial that he would have a disease that only "faggots" have, but upon quick reflection comes to the realization that the diagnosis is probably true. He begins to read whatever research is available about the disease, which at this time seems to be most effectively treated by the drug AZT. AZT, however, is only in the clinical trials stage within the US. Incredulous that he, as a dying man, cannot pay for any drug which may save or at least prolong his life, goes searching for it by whatever means possible. It eventually leads him to Mexico and a "Dr." Vass, an American physician whose ... Written by Huggo', '117 min', 'http://ia.media-imdb.com/images/M/MV5BMTYwMTA4MzgyNF5BMl5BanBnXkFtZTgwMjEyMjE0MDE@._V1_SX214_.jpg', '12 December 2013 (Portugal)', 8, 'Dallas Buyers Club', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (352, 'During the last two years of her life, Princess Diana embarks on a final rite of passage: a secret love affair with Pakistani heart surgeon Hasnat Khan.', '113 min', 'http://ia.media-imdb.com/images/M/MV5BMjA0NDg0Njg3N15BMl5BanBnXkFtZTgwMTMxMzMzMDE@._V1_SX214_.jpg', '26 September 2013 (Portugal)', 4.79999999999999982, 'Diana', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (353, 'In the year 2092, one hundred eighteen year old Nemo is recounting his life story to a reporter. He is less than clear, often times thinking that he is only thirty-four years of age. But his story becomes more confusing after he does focus on the fact of his current real age. He tells of his life at three primary points in his life: at age nine (when his parents divorced), age sixteen and age thirty-four. The confusing aspect of the story is that he tells of alternate life paths, often changing course with the flick of a decision at each of those ages. One life path has him ultimately married to Elise, a depressed woman who never got over the unrequited love she had for a guy named Stefano when she was a teenager and who asked Nemo to swear that when she died he would sprinkle her ashes on Mars. A second life path has him married to Jean. Their life is one of luxury but one also of utter boredom. And a third life path has him in a torrid romance with his step-sister Anna, the two who,... Written by Huggo', '141 min', 'http://ia.media-imdb.com/images/M/MV5BMTg4ODkzMDQ3Nl5BMl5BanBnXkFtZTgwNTEwMTkxMDE@._V1_SY317_CR0,0,214,317_.jpg', '26 September 2013 (USA)', 7.79999999999999982, 'Sr. Ninguém', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (354, 'Elise and Didier fall in love at first sight, in spite of their differences. He talks, she listens. He''s a romantic atheist, she''s a religious realist. When their daughter becomes seriously ill, their love is put on trial.', '111 min', 'http://ia.media-imdb.com/images/M/MV5BMTQzMzg2Nzg2MF5BMl5BanBnXkFtZTgwNjUzNzIzMDE@._V1_SX214_.jpg', '1 November 2013 (USA)', 7.70000000000000018, 'The Broken Circle Breakdown', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (355, 'Sudden fame and a self-destructive lifestyle were taking a toll on Jack Kerouac''s mind and body following the unparalleled success of the groundbreaking novel, On The Road. Once the handsome literary maverick and hero of the Beat Generation, Kerouac now sees only a vestige of his former self, ravaged by alcohol and drugs, aged beyond his years and tormented by self-doubt. Questioning his talent, his faith, and his mortality, Kerouac leaves New York for California, on a quest for redemption at an isolated, fog-banked cabin in the primitive landscape of the Big Sur woods. What ensues in those fateful 3 weeks of August, 1960, is both terrifying and revelatory. While Kerouac is able to find beauty and elation in his surroundings, the dichotomy of his psyche renders him unable to face his demons alone. He sets off on a visceral collision course of paranoia, sex, delirium tremens, misery and madness. His desperation culminates in an intense, hallucinatory breakdown, but the duality of his ... Written by Anonymous', '81 min', 'http://ia.media-imdb.com/images/M/MV5BMjI3MDU0MDY2MF5BMl5BanBnXkFtZTgwNDY3NjUzMDE@._V1_SX214_.jpg', '1 November 2013 (USA)', 5.40000000000000036, 'Big Sur', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (356, 'Thousands of years ago, a race of beings known as Dark Elves tried to send the universe into darkness by using a weapon known as the Aether. But warriors from Asgard stop them but their leader Malekith escapes to wait for another opportunity. The warriors find the Aether and since it can''t be destroyed, they try to hide it. In the present day, Jane Foster awaits the return of Thor but it''s been two years. He''s trying to bring peace to the nine realms. Jane discovers an anomaly similar to the one that brought Thor to Earth. She goes to investigate and finds a wormhole and is sucked into it. Thor wishes to return to Earth but his father, Odin refuses to let him. Thor learns from Heimdall, the one who can see into all of the realms that Jane disappeared. Thor then returns to Earth just as Jane returns. But when some policemen try to arrest her, some kind of energy repulses them. Thor then brings her to Asgard to find out what happened to her. When it happens again, they discovered that ... Written by rcs0411@yahoo.com', '112 min', 'http://ia.media-imdb.com/images/M/MV5BMTQyNzAwOTUxOF5BMl5BanBnXkFtZTcwMTE0OTc5OQ@@._V1_SY317_CR4,0,214,317_.jpg', '8 November 2013 (USA)', 7.70000000000000018, 'Thor: The Dark World', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (357, 'Based on the beloved bestselling book, THE BOOK THIEF tells the story of a spirited and courageous young girl who transforms the lives of everyone around her when she is sent to live with a foster family in World War II Germany. Written by 20th Century Fox', '131 min', 'http://ia.media-imdb.com/images/M/MV5BOTE3NzkyMjAyNF5BMl5BanBnXkFtZTgwMDc5MTE0MDE@._V1_SX214_.jpg', '23 January 2014 (Portugal)', 6.59999999999999964, 'The Book Thief', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (358, 'A documentary chronicling sports legend Lance Armstrong''s improbable rise and ultimate fall from grace.', '122 min', 'http://ia.media-imdb.com/images/M/MV5BMjA5NDMzNjg2M15BMl5BanBnXkFtZTgwNjQ4MzI1MDE@._V1_SX214_.jpg', '14 November 2013 (Portugal)', 6.29999999999999982, 'The Armstrong Lie', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (359, 'An American girl sent to the English countryside to stay with relatives finds herself fighting for her survival as the UK turns into a violent military state.', '101 min', 'http://ia.media-imdb.com/images/M/MV5BMTU4NTg4NzgzMF5BMl5BanBnXkFtZTgwOTU1NTMxMDE@._V1_SX214_.jpg', '4 October 2013 (UK)', 6.5, 'How I Live Now', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (360, 'Set in the most depressing corner of a postapocalyptic future, our heroine Kantmiss Evershot (Maiara Walsh) volunteers to take her manipulative younger sister''s place in the seventy-fifth annual "Starving Games." In doing so, she must leave behind her smoldering just-a-friend Dale (Brant Daugherty) and team up with the geeky baker''s son Peter Malarkey (Cody Allen Christian) in a fight for her life. But wait, there''s more! She could also win an old ham, a coupon for a foot-long sub at a six-inch price, and a partially eaten pickle! In The Starving Games, Friedberg and Seltzer''s sixth cinematic spoof of box-office hits, the prolific parody duo has its sights trained on the adventure blockbuster The Hunger Games! It''s all the laughs and half the calories as they sling dozens of cock-eyed, barbed arrows at sci-fi, action and fantasy films from The Avengers and Oz the Great and Powerful to pop culture characters and celebrities like Harry Potter and Taylor Swift. Written by Ketchup Entertainment', '83 min', 'http://ia.media-imdb.com/images/M/MV5BMTgwOTk2OTY4MV5BMl5BanBnXkFtZTgwMTU5MjE0MDE@._V1_SY317_CR5,0,214,317_.jpg', '31 October 2013 (Argentina)', 3.10000000000000009, 'The Starving Games', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (361, 'Fontayne is enlisted by Bernice- her estranged old friend and current parole officer - along with a disgraced cop to search for Bernice''s son, who went missing on the Mexican border.', '123 min', 'http://ia.media-imdb.com/images/M/MV5BMzU3MDIwODQyM15BMl5BanBnXkFtZTgwNzk4MTE1MDE@._V1_SY317_CR0,0,214,317_.jpg', '11 March 2013 (USA)', 6.29999999999999982, 'Go for Sisters', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (362, 'The best man at Scott (Long) and Kristin''s (Weixler) Arizona destination wedding, Lumpy (Labine) is the life of the party, until a long, indulgent night leads to his untimely death. Forced to cancel their honeymoon and fly back to Minneapolis to arrange for his funeral, Scott and Kristin meet Ramsey (Timlin) and learn that Lumpy isn''t quite who they thought he was. Written by Anonymous', '89 min', 'http://ia.media-imdb.com/images/M/MV5BOTY0OTAyOTU4NF5BMl5BanBnXkFtZTgwOTkxMTYwMDE@._V1_SX214_.jpg', '3 October 2013 (USA)', 6.29999999999999982, 'Best Man Down', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (363, '"NEBRASKA" is a father and son road trip, from Billings, Montana to Lincoln, Nebraska that gets waylaid at a small town in central Nebraska, where the father grew up and has scores to settle. Told with deadpan humor and a unique visual style, it''s ultimately the story of a son trying to get through to a father he doesn''t understand. Written by Anonymous', '115 min', 'http://ia.media-imdb.com/images/M/MV5BMTU2Mjk2NDkyMl5BMl5BanBnXkFtZTgwNTk0NzcyMDE@._V1_SX214_.jpg', '15 November 2013 (USA)', 8, 'Nebraska', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (364, 'When college friends reunite after 15 years over the Christmas holidays, they will discover just how easy it is for long-forgotten rivalries and romances to be ignited.', '123 min', 'http://ia.media-imdb.com/images/M/MV5BMjU0MTI1MDg5Ml5BMl5BanBnXkFtZTgwNzc2MTMzMDE@._V1_SX214_.jpg', '15 November 2013 (USA)', 6.40000000000000036, 'The Best Man Holiday', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (365, 'While traveling abroad, a guy falls for a Romanian beauty whose unreachable heart has its origins in her violent, charismatic ex.', '108 min', 'http://ia.media-imdb.com/images/M/MV5BMjA3MTcyNjk3NF5BMl5BanBnXkFtZTgwNjkzNzUzMDE@._V1_SX214_.jpg', '13 September 2013 (Norway)', 5.59999999999999964, 'Charlie Countryman', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (366, 'A documentary film about the impact of the newspaper comic strip Calvin & Hobbes, created by Bill Watterson.', '99 min', 'http://ia.media-imdb.com/images/M/MV5BOTEwNTE0NDYyM15BMl5BanBnXkFtZTgwMDczNjE0MDE@._V1_SY317_CR0,0,214,317_.jpg', '15 November 2013 (USA)', 5.40000000000000036, 'Dear Mr. Watterson', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (367, 'A version of the German legend in which a man who sells his soul to the devil in exchange for knowledge.', '140 min', 'http://ia.media-imdb.com/images/M/MV5BMTM4NDgwNjU4Ml5BMl5BanBnXkFtZTgwNzU2OTI1MDE@._V1_SY317_CR3,0,214,317_.jpg', '15 November 2013 (USA)', 6.70000000000000018, 'Fausto', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (368, 'A mix of live performances and behind-the-scenes footage from the televised benefit concert to raise relief funds for victims of Hurricane Sandy in 2012.', '105 min', 'http://ia.media-imdb.com/images/M/MV5BMTQxNTAzNTg1MV5BMl5BanBnXkFtZTgwODc3OTk1MDE@._V1_SX214_.jpg', '1 November 2013 (USA)', 6.40000000000000036, '12-12-12', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (369, 'A Thanksgiving get-together for the eccentric Turner clan goes from bad to worse when estranged daughter Nina makes a surprise visit home for the first time in 15 years. Nina clashes with her stepmother Deborah, and sister, Lindsay, while half-brother Jacob tries to keep a massive gambling debt a secret. Meanwhile, family patriarch Poppy has his own dramatic news to share. "Cold Turkey" is a black comedy about how - despite our best efforts - we all eventually turn into our parents. Starring Alicia Witt ("Friday Night Lights"), Cheryl Hines ("Curb Your Enthusiasm"), Sonya Walger ("Lost"), Victoria Tennant ("L.A. Story") and acclaimed writer-director Peter Bogdanovich ("The Last Picture Show"). Written by Anonymous', '', 'http://ia.media-imdb.com/images/M/MV5BMjI3NTc3MzQzNF5BMl5BanBnXkFtZTgwMzEyMDQ1MDE@._V1_SX214_.jpg', '15 November 2013 (USA)', 5.70000000000000018, 'Cold Turkey', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (370, 'Katniss Everdeen has returned home safe after winning the 74th Annual Hunger Games along with fellow tribute Peeta Mellark. Winning means that they must turn around and leave their family and close friends, embarking on a "Victor''s Tour" of the districts. Along the way Katniss senses that a rebellion is simmering, but the Capitol is still very much in control as President Snow prepares the 75th Annual Hunger Games (The Quarter Quell) - a competition that could change Panem forever. Written by Bianca Capetillo', '146 min', 'http://ia.media-imdb.com/images/M/MV5BMTAyMjQ3OTAxMzNeQTJeQWpwZ15BbWU4MDU0NzA1MzAx._V1_SX214_.jpg', '22 November 2013 (USA)', 7.40000000000000036, 'The Hunger Games: Catching Fire', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (371, 'An affable underachiever finds out he''s fathered 533 children through anonymous donations to a fertility clinic 20 years ago. Now he must decide whether or not to come forward when 142 of them file a lawsuit to reveal his identity.', '103 min', 'http://ia.media-imdb.com/images/M/MV5BMjIxNjc2MzMzMl5BMl5BanBnXkFtZTgwMjA5NjM0MDE@._V1_SX214_.jpg', '22 November 2013 (USA)', -1, 'Delivery Man', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (372, 'Anna, a fearless optimist, sets off on an epic journey - teaming up with rugged mountain man Kristoff and his loyal reindeer Sven - to find her sister Elsa, whose icy powers have trapped the kingdom of Arendelle in eternal winter. Encountering Everest-like conditions, mystical trolls and a hilarious snowman named Olaf, Anna and Kristoff battle the elements in a race to save the kingdom. From the outside Anna''s sister, Elsa looks poised, regal and reserved, but in reality, she lives in fear as she wrestles with a mighty secret-she was born with the power to create ice and snow. It''s a beautiful ability, but also extremely dangerous. Haunted by the moment her magic nearly killed her younger sister Anna, Elsa has isolated herself, spending every waking minute trying to suppress her growing powers. Her mounting emotions trigger the magic, accidentally setting off an eternal winter that she can''t stop. She fears she''s becoming a monster and that no one, not even her sister, can help her. Written by DeAlan Wilson for ComedyE.com', '108 min', 'http://ia.media-imdb.com/images/M/MV5BMTQ1MjQwMTE5OF5BMl5BanBnXkFtZTgwNjk3MTcyMDE@._V1_SX214_.jpg', '27 November 2013 (USA)', -1, 'Frozen', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (375, 'A chronicle of Nelson Mandela''s life journey from his childhood in a rural village through to his inauguration as the first democratically elected president of South Africa.', '146 min', 'http://ia.media-imdb.com/images/M/MV5BMTg1NTQ1NDczNV5BMl5BanBnXkFtZTcwNDQyMDU1OQ@@._V1_SX214_.jpg', '3 January 2014 (UK)', 6, 'Mandela: Long Walk to Freedom', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (377, 'Russell and his younger brother Rodney live in the economically-depressed Rust Belt, and have always dreamed of escaping and finding better lives. But when a cruel twist of fate lands Russell in prison, his brother is lured into one of the most violent and ruthless crime rings in the Northeast - a mistake that will almost cost him everything. Once released, Russell must choose between his own freedom, or risk it all to seek justice for his brother. Written by Production', '116 min', 'http://ia.media-imdb.com/images/M/MV5BMTc2MTQ4MDU4NV5BMl5BanBnXkFtZTgwOTU1ODgzMDE@._V1_SX214_.jpg', '6 December 2013 (USA)', 6.79999999999999982, 'Out of the Furnace', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (378, 'Follow a week in the life of a young folk singer as he navigates the Greenwich Village folk scene of 1961. Guitar in tow, huddled against the unforgiving New York winter, he is struggling to make it as a musician against seemingly insurmountable obstacles -- some of them of his own making. Written by Production', '105 min', 'http://ia.media-imdb.com/images/M/MV5BMjAxNjcyNDQxM15BMl5BanBnXkFtZTgwNzU2NDA0MDE@._V1_SX214_.jpg', '20 December 2013 (USA)', 7.70000000000000018, 'Inside Llewyn Davis', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (379, 'After successfully crossing over (and under) the Misty Mountains, Thorin and Company must seek aid from a powerful stranger before taking on the dangers of Mirkwood Forest--without their Wizard. If they reach the human settlement of Lake-town it will be time for the hobbit Bilbo Baggins to fulfill his contract with the dwarves. The party must complete the journey to Lonely Mountain and burglar Baggins must seek out the Secret Door that will give them access to the hoard of the dragon Smaug. And, where has Gandalf got off to? And what is his secret business to the south? Written by Otaku-sempai', '', 'http://ia.media-imdb.com/images/M/MV5BMzU0NDY0NDEzNV5BMl5BanBnXkFtZTgwOTIxNDU1MDE@._V1_SY317_CR0,0,214,317_.jpg', '13 December 2013 (USA)', -1, 'The Hobbit: The Desolation of Smaug', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (380, 'Madea gets coaxed into helping a friend pay her daughter a surprise visit in the country for Christmas, but the biggest surprise is what they''ll find when they arrive. As the small, rural town prepares for its annual Christmas Carnival, new secrets are revealed and old relationships are tested while Madea dishes her own brand of Christmas Spirit to all. Written by Lionsgate', '', 'http://ia.media-imdb.com/images/M/MV5BMjIwNjA3OTM4NF5BMl5BanBnXkFtZTgwOTA0MjM2MDE@._V1_SX214_.jpg', '13 December 2013 (USA)', -1, 'Tyler Perry''s A Madea Christmas', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (381, 'With the 70s behind him, San Diego''s top rated newsman, Ron Burgundy, returns to take New York''s first 24-hour news channel by storm.', '', 'http://ia.media-imdb.com/images/M/MV5BMjE5ODk0NjQzNV5BMl5BanBnXkFtZTgwODk4MDA1MDE@._V1_SX214_.jpg', '20 December 2013 (USA)', -1, 'Anchorman 2: The Legend Continues', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (382, 'A fictional film set in the alluring world of one of the most stunning scandals to rock our nation, American Hustle tells the story of brilliant con man Irving Rosenfeld (Christian Bale), who along with his equally cunning and seductive British partner Sydney Prosser (Amy Adams) is forced to work for a wild FBI agent Richie DiMaso (Bradley Cooper). DiMaso pushes them into a world of Jersey powerbrokers and mafia that''s as dangerous as it is enchanting. Jeremy Renner is Carmine Polito, the passionate, volatile, New Jersey political operator caught between the con-artists and Feds. Irving''s unpredictable wife Rosalyn (Jennifer Lawrence) could be the one to pull the thread that brings the entire world crashing down. Written by Sony Pictures Entertainment', '129 min', 'http://ia.media-imdb.com/images/M/MV5BNjkxMTc0MDc4N15BMl5BanBnXkFtZTgwODUyNTI1MDE@._V1_SX214_.jpg', '18 December 2013 (USA)', -1, 'American Hustle', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (383, 'When Walt Disney''s daughters begged him to make a movie of their favorite book, P.L. Travers'' "Mary Poppins," he made them a promise - one that he didn''t realize would take 20 years to keep. In his quest to obtain the rights, Walt comes up against a curmudgeonly, uncompromising writer who has absolutely no intention of letting her beloved magical nanny get mauled by the Hollywood machine. But, as the books stop selling and money grows short, Travers reluctantly agrees to go to Los Angeles to hear Disney''s plans for the adaptation. For those two short weeks in 1961, Walt Disney pulls out all the stops. Armed with imaginative storyboards and chirpy songs from the talented Sherman brothers, Walt launches an all-out onslaught on P.L. Travers, but the prickly author doesn''t budge. He soon begins to watch helplessly as Travers becomes increasingly immovable and the rights begin to move further away from his grasp. It is only when he reaches into his own childhood that Walt discovers the ... Written by Walt Disney Pictures', '125 min', 'http://ia.media-imdb.com/images/M/MV5BMTc0MTQ3NzE4Nl5BMl5BanBnXkFtZTcwMzA4NDM5OQ@@._V1_SX214_.jpg', '20 December 2013 (USA)', 7.20000000000000018, 'Saving Mr. Banks', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (384, 'For the first time in movie history, audiences will truly see and feel what it was like when dinosaurs ruled the Earth. "Walking with Dinosaurs" is the ultimate immersive experience, utilizing state of the art 3D to put audiences in the middle of a thrilling and epic prehistoric world, where an underdog dino triumphs to become a hero for the ages. Written by Anonymous', '', 'http://ia.media-imdb.com/images/M/MV5BMjE2OTc2MTk1Nl5BMl5BanBnXkFtZTgwNDg5NDU1MDE@._V1_SY317_CR0,0,214,317_.jpg', '20 December 2013 (USA)', -1, 'Walking with Dinosaurs 3D', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (385, 'A lonely writer develops an unlikely relationship with his newly purchased operating system that''s designed to meet his every need.', '120 min', 'http://ia.media-imdb.com/images/M/MV5BMjA1Nzk0OTM2OF5BMl5BanBnXkFtZTgwNjU2NjEwMDE@._V1_SY317_CR0,0,214,317_.jpg', '10 January 2014 (USA)', 7.09999999999999964, 'Her', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (386, 'Ben Stiller directs and stars in THE SECRET LIFE OF WALTER MITTY, James Thurber''s classic story of a day-dreamer who escapes his anonymous life by disappearing into a world of fantasies filled with heroism, romance and action. When his job along with that of his co-worker (Kristen Wiig) are threatened, Walter takes action in the real world embarking on a global journey that turns into an adventure more extraordinary than anything he could have ever imagined. Written by 20th Century Fox', '', 'http://ia.media-imdb.com/images/M/MV5BMTQzNzU5NzQ4OF5BMl5BanBnXkFtZTgwODk3MDgxMDE@._V1_SX214_.jpg', '25 December 2013 (USA)', 6.70000000000000018, 'The Secret Life of Walter Mitty', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (387, 'Based on the failed mission "Operation Red Wings" which tasked four members of SEAL Team 10 on June 28, 2005 to kill Taliban leader Ahmad Shah. They were quickly compromised and under attack, Marcus Luttrell being the only member to survive and evade capture. Written by Anonymous', '', 'http://ia.media-imdb.com/images/M/MV5BMjA0NTgwOTk5Ml5BMl5BanBnXkFtZTcwMjE3NDc5OQ@@._V1_SX214_.jpg', '10 January 2014 (USA)', 7.09999999999999964, 'Lone Survivor', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (388, 'In The Wolf of Wall Street DiCaprio plays Belfort, a Long Island penny stockbroker who served 20 months in prison for defrauding investors in a massive 1990s securities scheme that involved widespread corruption on Wall Street and in the corporate banking world, including shoe designer Steve Madden. Written by anonymous', '165 min', 'http://ia.media-imdb.com/images/M/MV5BMTQ5OTI2MTQ1MV5BMl5BanBnXkFtZTcwMjY0Njk2OQ@@._V1_SY317_CR1,0,214,317_.jpg', '25 December 2013 (USA)', -1, 'The Wolf of Wall Street', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (432, 'Circumstances force a young divorcée to move back in with her parents in suburban Connecticut, where an affair with a younger guy rejuvenates her passion for life', '95 min', 'http://ia.media-imdb.com/images/M/MV5BMzkzMDc0Nzg5OF5BMl5BanBnXkFtZTcwMDU0MzAyOA@@._V1_SY317_CR1,0,214,317_.jpg', '31 January 2013 (Russia)', 6, 'Hello I Must Be Going', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (389, 'A look at the lives of the strong-willed women of the Weston family, whose paths have diverged until a family crisis brings them back to the Oklahoma house they grew up in, and to the dysfunctional woman who raised them.', '130 min', 'http://ia.media-imdb.com/images/M/MV5BNzQ5ODE4NTcxNV5BMl5BanBnXkFtZTgwNjkyNDQ0MDE@._V1_SX214_.jpg', '25 December 2013 (USA)', 6.90000000000000036, 'August: Osage County', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (390, 'A band of samurai set out to avenge the death and dishonor of their master at the hands of a ruthless shogun.', '', 'http://ia.media-imdb.com/images/M/MV5BMTc0MjE2NzE0OV5BMl5BanBnXkFtZTgwNTU5MjE1MDE@._V1_SX214_.jpg', '25 December 2013 (USA)', -1, '47 Ronin', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (391, 'A pair of aging boxing rivals are coaxed out of retirement to fight one final bout -- 30 years after their last match.', '113 min', 'http://ia.media-imdb.com/images/M/MV5BMTY3NTkxMTgzNV5BMl5BanBnXkFtZTgwNjg0MzE2MDE@._V1_SX214_.jpg', '25 December 2013 (USA)', -1, 'Grudge Match', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (392, 'An American girl, Isabella, sets out to make a documentary to understand what happened to her mother who murdered three clergy people. She was not convicted due to insanity and was sent to a mental hospital in Italy. Isabella meets with some priests in Italy who explain that her mother''s condition may not be medical, but could be an extra-human possession. Written by Joy', '83 min', 'http://ia.media-imdb.com/images/M/MV5BMTYwOTg1MTk0NF5BMl5BanBnXkFtZTcwMTA5NTI5Ng@@._V1_SY317_CR0,0,214,317_.jpg', '6 January 2012 (USA)', 4.09999999999999964, 'The Devil Inside', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (393, 'For over 20 years, Jimmy Testagross has lived his childhood dream: being a roadie for his childhood heroes, Blue Oyster Cult. But the band''s Arena-Rock glory days are a distant memory. County fairs and club gigs pay the bills. And Jimmy has become a casualty of these leaner times. With no place to go, no job prospects, and no real skills outside of being a roadie, Jimmy needs to regroup. So he returns to his childhood home in Queens, Ny. There, he revisits old relationships: his ailing, widower mom, a high school crush, a former nemesis and, most importantly, his relationship with himself. Jimmy, the middle-aged man-child, has never grown up. He still carries the resentments and frustrations of his youth, and has allowed them to fester and define who and what he is. Confronted with his mother''s illness, Jimmy has a choice: let go of the past and take responsibility for both himself and the woman who raised and now needs him. Or continue to live a life of lies and frustration. Written by Gerald Cuesta', '95 min', 'http://ia.media-imdb.com/images/M/MV5BMTA3MDQxNDc4MjheQTJeQWpwZ15BbWU3MDcxNjEzMDc@._V1_SX214_.jpg', '6 January 2012 (USA)', 5.59999999999999964, 'Roadie', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (394, 'After watching their best friend get murdered, a group of teens struggle to expose a local hero as the vicious killer and keep from becoming his next victims.', '96 min', 'http://ia.media-imdb.com/images/M/MV5BNzY1MjAzNTgzM15BMl5BanBnXkFtZTcwMzU5NzYxNw@@._V1_SY317_CR0,0,214,317_.jpg', '22 March 2012 (Kuwait)', 4.29999999999999982, 'Beneath the Darkness', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (395, 'In the rural area around the Anatolian town of Keskin, the local prosecutor, police commissar, and doctor lead a search for a victim of a murder to whom a suspect named Kenan and his mentally challenged brother confessed. However, the search is proving more difficult than expected as Kenan is fuzzy as to the body''s exact location. As the group continues looking, its members can''t help but chat among themselves about both trivia and their deepest concerns in an investigation that is proving more trying than any of them expected. Written by Kenneth Chisholm (kchishol@rogers.com)', '150 min', 'http://ia.media-imdb.com/images/M/MV5BMzg3OTMyODQ1M15BMl5BanBnXkFtZTcwNjMwMTEwNw@@._V1_SX214_.jpg', '3 May 2012 (Portugal)', 7.59999999999999964, 'Era Uma Vez na Anatólia', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (396, 'Upon hearing the song "Norwegian Wood," Toru (Matsuyama) remembers back to his life in the 1960s, when his friend Kizuki killed himself and he grew close to Naoko, Kizuki''s girlfriend. As the two try, in very different ways, to contend with their grief, Toru forms a bond with another woman, Midori. Written by Anonymous', '133 min', 'http://ia.media-imdb.com/images/M/MV5BODQ3NTM0Nzg3OV5BMl5BanBnXkFtZTcwMTE3MDMxNw@@._V1_SX214_.jpg', '11 December 2010 (Japan)', 6.29999999999999982, 'Norwegian Wood', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (397, 'Chris Faraday once smuggled illegal items or contraband into the country on freighters. He left that life behind, got married has a family and went legit. But when his brother-in-law got involved with Briggs, a drug dealer and when he blew a deal, Briggs demands restitution which he can''t deliver. So Chris offers to find a way to pay him but the he threatens Chris'' family if he doesn''t deliver. So he gets on a freighter destined for Panama and he sets out to bring back some counterfeit currency. Briggs "goes to see" Chris'' family. When Chris learns of this he asks his friend Sebastian to take care of them which he does. He tells Chris that it would be better to bring drugs instead of the cash. Written by rcs0411@yahoo.com', '109 min', 'http://ia.media-imdb.com/images/M/MV5BMjE3NzY5NTg0OF5BMl5BanBnXkFtZTcwODk4MzgxNw@@._V1_SX214_.jpg', '13 January 2012 (USA)', 6.40000000000000036, 'Contraband', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (398, '"Joyful Noise" is the story of a small town choir out to win a national competition despite overwhelming odds. A story of faith and determination by the choir leaders (Queen Latifah and Dolly Parton) and the young talent who give their all to win God''s praise and beat the competition for the grand prize. Written by Farrell Paura Productions', '118 min', 'http://ia.media-imdb.com/images/M/MV5BMjEwNjAzMzUyN15BMl5BanBnXkFtZTcwMDUxNDQxNw@@._V1_SY317_CR0,0,214,317_.jpg', '13 January 2012 (USA)', 5.20000000000000018, 'Joyful Noise', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (399, 'Elderly and a virtual prisoner in her own home due to her concerned staff and daughter Carol, Margaret Thatcher, Britain''s first woman prime minister, looks back on her life as she clears out her late husband Denis''s clothes for the Oxfam shop. Denis is seen as being her rock as she first enters parliament and then runs for the leadership of the Conservative Party, culminating in her eventual premiereship. Now his ghost joins her to comment on her successes and failures, sometimes to her annoyance, generally to her comfort until ultimately, as the clothes are sent to the charity shop, Denis departs from Margret''s life forever. Written by don @ minifie-1', '105 min', 'http://ia.media-imdb.com/images/M/MV5BODEzNDUyMDE3NF5BMl5BanBnXkFtZTcwMTgzOTg3Ng@@._V1_SX214_.jpg', '13 January 2012 (USA)', 6.29999999999999982, 'The Iron Lady', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (400, 'Belle is a girl who is dissatisfied with life in a small provincial French town, constantly trying to fend off the misplaced "affections" of conceited Gaston. The Beast is a prince who was placed under a spell because he could not love. A wrong turn taken by Maurice, Belle''s father, causes the two to meet. Written by Tim Pickett <quetzal@yoyo.cc.monash.edu.au>', '84 min', 'http://ia.media-imdb.com/images/M/MV5BMTc0MzM1Njk1OV5BMl5BanBnXkFtZTcwNjQxMTkwNw@@._V1_SX214_.jpg', '22 November 1991 (USA)', 8, 'Beauty and the Beast', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (401, 'Beth, a bookish teenager, befriends Emilia, an aspiring novelist who has just arrived in town. Emilia soon begins an affair with Beth''s father that threatens to have devastating consequences.', '90 min', 'http://ia.media-imdb.com/images/M/MV5BMjI3ODY3OTczNF5BMl5BanBnXkFtZTcwODkxNTE0Ng@@._V1_SX214_.jpg', '14 October 2011 (UK)', 6.09999999999999964, 'Albatross', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (435, 'Four socially troubled 18-year-olds from the south of England go on holiday to Malia.', '97 min', 'http://ia.media-imdb.com/images/M/MV5BMTM3NjcxMDg3NF5BMl5BanBnXkFtZTcwMTMzMDQxNw@@._V1_SX214_.jpg', '17 August 2011 (UK)', 6.70000000000000018, 'The Inbetweeners Movie', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (402, 'After a nuclear attack, seven dwellers of an apartment building seek refugee in a bunker in the basement of the building where the super, Mickey, lives. He rations water and supplies among the group formed by Eva and her boyfriend Sam; the gays Bobby and Josh and his brother Adrien; Marilyn and her daughter Wendi; and Delvin. When five invaders break into their shelter wearing protective clothing and breathing apparatuses, they abduct Wendi but the survivors succeed in killing two of the men. Josh wears the only clothing that was not damaged and discovers a strange research center where he finds Wendi contained in some kind of stasis device along with other children apparently collected by the unknown men in suits. He is discovered and ends up shoots at three men and returns to the shelter. Soon the group learns that the invaders have welded their access door from outside and they are trapped inside the bunker. Marilyn and Sam get crazy and the tense situation and the lack of water ... Written by Claudio Carvalho, Rio de Janeiro, Brazil', '112 min', 'http://ia.media-imdb.com/images/M/MV5BMjMwNjcxODY5OV5BMl5BanBnXkFtZTcwMDA1OTg4Ng@@._V1_SX214_.jpg', '6 September 2012 (Portugal)', 5.79999999999999982, 'Os Humanos', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (403, 'A young pickpocket in the New York subways, living a fast, free, lifestyle is confronted by a woman whom he had a one night affair with, she informs him that she is now pregnant with his child, he must now choose between continuing the lifestyle he lead or take responsibility for his actions. Written by Anonymous', '89 min', 'http://ia.media-imdb.com/images/M/MV5BMTcyMzY5MjMxMl5BMl5BanBnXkFtZTcwOTM5MjY2Ng@@._V1_SX214_.jpg', '9 November 2011 (USA)', 6, 'Loosies', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (404, 'Eva Khatchadourian is trying to piece together her life following the "incident". Once a successful travel writer, she is forced to take whatever job comes her way, which of late is as a clerk in a travel agency. She lives a solitary life as people who know about her situation openly shun her, even to the point of violent actions toward her. She, in turn, fosters that solitary life because of the incident, the aftermath of which has turned her into a meek and scared woman. That incident involved her son Kevin Khatchadourian, who is now approaching his eighteenth birthday. Eva and Kevin have always had a troubled relationship, even when he was an infant. Whatever troubles he saw, Franklin, Eva''s complacent husband, just attributed it to Kevin being a typical boy. The incident may be seen by both Kevin and Eva as his ultimate act in defiance against his mother. Written by Huggo', '112 min', 'http://ia.media-imdb.com/images/M/MV5BMjE0NDE0MjYxNF5BMl5BanBnXkFtZTcwNjM2NTY5Ng@@._V1_SY317_CR1,0,214,317_.jpg', '3 May 2012 (Portugal)', 7.5, 'We Need to Talk About Kevin', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (405, 'A young band heads to the woods in order to focus on writing new songs. Hoping to emerge with new music that will score them their big break, they instead find themselves in the middle of a nightmare beyond comprehension.', '83 min', 'http://ia.media-imdb.com/images/M/MV5BNTQ3MDMwNjQ3OV5BMl5BanBnXkFtZTcwNjA4MzQyNw@@._V1_SX214_.jpg', '16 April 2010 (USA)', 2.60000000000000009, 'Don''t Go in the Woods', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (406, 'Mankind discover the existence of the Vampire and Lycan species and they begin a war to annihilate the races. When Selene meets with Michael in the harbor, they are hit by a grenade and Selene passes out. Twelve years later, Selene awakes from a cryogenic sleep in the Antigen laboratory and meets the Vampire David. She learns that she had been the subject of the scientist Dr. Jacob Lane and the Vampire and Lycan species have been practically eradicated from Earth. But Selene is still connected to Michael and has visions that she believes that belongs to Michael''s sight. However she has a surprise and finds that she has a powerful daughter named Eve that has been raised in the laboratory. Now Selene and David have to protect Eve against the Lycans that intend to use her to inoculate their species against silver. Written by Claudio Carvalho, Rio de Janeiro, Brazil', '88 min', 'http://ia.media-imdb.com/images/M/MV5BMjAxMjc0ODk0OF5BMl5BanBnXkFtZTcwMTc5NDQwNw@@._V1_SY317_CR0,0,214,317_.jpg', '20 January 2012 (USA)', 6.29999999999999982, 'Underworld: Awakening', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (407, 'Freelance covert operative Mallory Kane is hired out by her handler to various global entities to perform jobs which governments can''t authorize and heads of state would rather not know about. After a mission to rescue a hostage in Barcelona, Mallory is quickly dispatched on another mission to Dublin. When the operation goes awry and Mallory finds she has been double crossed, she needs to use all of her skills, tricks and abilities to escape an international manhunt, make it back to the United States, protect her family, and exact revenge on those that have betrayed her. Written by Anonymous', '93 min', 'http://ia.media-imdb.com/images/M/MV5BMjI2MjIxOTUwN15BMl5BanBnXkFtZTcwNDM5NjcxNw@@._V1_SX214_.jpg', '20 January 2012 (USA)', 5.79999999999999982, 'Haywire', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (408, 'The citizens of Rome are hungry. Coriolanus, the hero of Rome, a great soldier and a man of inflexible self-belief despises the people. His extreme views ignite a mass riot. Rome is bloody. Manipulated and out-maneuvered by politicians and even his own mother Volumnia, Coriolanus is banished from Rome. He offers his life or his services to his sworn enemy Tullus Aufidius. Written by Icon Entertainment', '123 min', 'http://ia.media-imdb.com/images/M/MV5BMTcyMjAwMjA2N15BMl5BanBnXkFtZTcwOTI0MjA0Ng@@._V1_SY317_CR0,0,214,317_.jpg', '22 March 2012 (Portugal)', 6.09999999999999964, 'Coriolanus', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (409, 'Italy, 1944. As the war takes its toll on Allied forces in Europe, a squadron of black pilots known as the Tuskegee Airmen are finally given the chance to prove themselves in the sky - even as they battle discrimination on the ground. It''s a tribute to the unsung heroes who rose above extraordinary challenges and ultimately soared into history. Written by 20th Century Fox', '125 min', 'http://ia.media-imdb.com/images/M/MV5BNDQ5MTg2NzI4OF5BMl5BanBnXkFtZTcwMDM2NzQzNg@@._V1_SY317_CR0,0,214,317_.jpg', '20 January 2012 (USA)', 5.79999999999999982, 'Red Tails', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (410, 'In 1937 China, during the second Sino-Japanese war, a mortician, John (Christian Bale) arrives at a Catholic church in Nanjing to prepare a priest for burial. Upon arrival he finds himself the lone adult among a group of convent girl students and prostitutes from a nearby brothel. When he finds himself in the unwanted position of protector of both groups from the horrors of the invading Japanese army, he discovers the meaning of sacrifice and honor. Written by msmith5484', '146 min', 'http://ia.media-imdb.com/images/M/MV5BMjE3OTUzODA3Ml5BMl5BanBnXkFtZTcwNDk5NTUyNw@@._V1_SY317_CR0,0,214,317_.jpg', '2 August 2012 (Portugal)', 7.5, 'As Flores da Guerra', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (411, 'At 23, Laura Guerro and her friend Suzu enter the Miss Baja pageant. Both qualify, and while Laura waits at a nightclub for Suzu to break away so they can go shopping, a heavily-armed drug gang murders drug enforcement officials there. Laura escapes unharmed but can''t find Suzu, so the next day she looks for her; her dogged behavior brings her to the cartel''s attention, and they force her to assist them as they menace her father and younger brother. Lino, the gang''s leader, decides Laura should finish the pageant although her only interest is escape. Every day drags her deeper and corruption is pervasive. What alternative is there to death or prison? Written by <jhailey@hotmail.com>', '113 min', 'http://ia.media-imdb.com/images/M/MV5BMjIyMTY1NTg1Nl5BMl5BanBnXkFtZTcwMjU1OTIyNw@@._V1_SX214_.jpg', '9 September 2011 (Mexico)', 6.40000000000000036, 'Miss Bala', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (412, 'In Crazy Horse, he pulls back the curtain on Le Crazy Horse de Paris, a landmark that has prided itself as "the best nude dancing show in the world" since 1951. Le Crazy Horse sets itself apart from the average strip club by adhering to exacting standards in choreography, lights and physiques. The erotic revue is composed of songs and sequences that blend traits of old-fashioned burlesque, Bob Fosse and Cirque du Soleil, designed not only for the enjoyment of men, but also couples. Written by TIFF', '134 min', 'http://ia.media-imdb.com/images/M/MV5BMjA0NzE0MDM2NF5BMl5BanBnXkFtZTcwMTIwMDUyNw@@._V1_SX214_.jpg', '27 October 2011 (Portugal)', 6.20000000000000018, 'Crazy Horse', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (413, 'Towards the end of the Korean War an uneasy ceasefire is ordered, but out on the Eastern front line of the Aerok Hills fierce fighting continues. A race to capture a strategic point to determine a new border between the two Koreas is the ultimate prize. A bullet is then found in the body of dead company commander of the South Korean army. The bullet that killed the company commander belongs to the South Korean army. Lieutenant of the Defense Security Command Kang Eun-Pyo is ordered to go out into the Eastern front line and investigate the murder. When Kang Eun-Pyo arrives in the Aerok Hills he is surprised to find his old friend Kim Soo-Hyeok commanding troops in the Aerok Hills. Kang Eun-Pyo believed Kim Soo-Hyeok was dead. In their younger years, Kim Soo-Hyeok was a meek student, but he eventually became the leader of Aerok company as a lieutenant. The situation in the Aerok company raises many flags in the eyes of Kang Eun-Pyo. Soldiers wear North Korean uniforms inside due to the ... Written by Stanislav S, Sochi, Russia', '133 min', 'http://ia.media-imdb.com/images/M/MV5BMzM1NzM2NzM0NF5BMl5BanBnXkFtZTcwMzY0NDUyNw@@._V1_SY317_CR0,0,214,317_.jpg', '20 July 2011 (South Korea)', 7.09999999999999964, 'The Front Line', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (414, 'If Carol Channing didn''t exist, no one could have made her up. One in a billion, Carol , at 89, remains an unstoppable, megawatt dynamo. Broadway diva extraordinaire is just the icing. Carol Channing hovered at the pinnacle of the entertainment world from the late-1950''s through the 1960''s and beyond, living life sensationally large. As Carol has observed, ''...if you''re lucky enough to have two hit shows, the world passes through your dressing room''. At 89, she remains irrepressible. Written by Anonymous', '87 min', 'http://ia.media-imdb.com/images/M/MV5BMTk2NTEzMjc0MV5BMl5BanBnXkFtZTcwODAxMTgxNw@@._V1_SX214_.jpg', '20 January 2012 (USA)', 6.90000000000000036, 'Carol Channing: Larger Than Life', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (415, 'Using archival footage of and interviews about fashion designer and icon Halston (1932-1990), Whitney Smith looks at the 1970s in Manhattan. Smith is interested in the parties and the excess, which contrast with Halston''s minimalist lines. There is a rough chronology for Halston: from milliner to couture to an unsuccessful attempt to bring his designs to the customers of J.C. Penney. The principal focus is on the world of Studio 54 and Halston''s part in it. Written by <jhailey@hotmail.com>', '85 min', 'http://ia.media-imdb.com/images/M/MV5BOTg5ODQ1MzI0OV5BMl5BanBnXkFtZTcwMzA2NTUxNw@@._V1_SX214_.jpg', '23 September 2011 (UK)', 5.29999999999999982, 'Ultrasuede: In Search of Halston', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (416, 'In Alaska, a team of oil workers board a flight home; however, they cross a storm and the airplane crashes. Only seven workers survive in the wilderness and John Ottway, who is a huntsman that kills wolves to protect the workers, assumes leadership of the group. Shortly after they learn that they are surrounded by a pack of wolves and Ottway advises that they should seek protection in the woods. But while they walk through the heavy snow, they are chased and attacked by the carnivorous mammals. Written by Claudio Carvalho, Rio de Janeiro, Brazil', '117 min', 'http://ia.media-imdb.com/images/M/MV5BNDY4MTQwMzc1MV5BMl5BanBnXkFtZTcwNzcwNTM5Ng@@._V1_SX214_.jpg', '27 January 2012 (USA)', 6.79999999999999982, 'The Grey', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (417, 'After losing her job, Jersey girl Stephanie Plum is broke. Needing a job she is told that her cousin, a bail bondsman, needs someone to help out in the office. But the only job openings he has are for skip tracers. She learns that Joe Morelli, a guy she knew intimately years ago, is one of the "skips". She eventually finds him but wasn''t really prepared so he gets away. Another bounty hunter, Ranger, tries to teach her. Eventually she finds Morelli again, but he claims he is innocent of the crime he is accused of and he is trying to prove his innocence. Eventually Stephanie thinks he''s telling the truth so she stakes out the person who can help him. She only finds herself in trouble and Morelli saves her. She tries to find someone who can prove his innocence, but the problem is that shortly after meeting with them they''re killed or attacked. Written by rcs0411@yahoo.com', '91 min', 'http://ia.media-imdb.com/images/M/MV5BMTU2NzMxMDU1NF5BMl5BanBnXkFtZTcwNzYxNTA2Ng@@._V1_SX214_.jpg', '27 January 2012 (USA)', 5.09999999999999964, 'One for the Money', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (418, 'In 19th century Dublin, Albert Nobbs, an eccentric man in the latter part of middle age, works as a waiter in Morrison''s Hotel run by the stingy and controlling Marge Baker. Albert is hard working and saves his money so that one day he will be able to eke out a better life for himself by owning his own business rather than work at the hotel. Beyond his work colleagues, he is all alone in the world. One day, a man named Hubert Page is hired by Mrs. Baker to paint one of the rooms in the hotel. She forces Hubert to share Albert''s bed for the one night he is required to stay to complete the work, much to Albert''s horror. Hubert discovers the reason Albert did not want to share a room with him. But rather than the issue being a problem, Hubert shows Albert that he can follow a slightly different life path than the one he envisioned for himself - one closer to the life that Hubert leads with his wife Cathleen - which includes getting married and having a wife to support him emotionally. ... Written by Huggo', '113 min', 'http://ia.media-imdb.com/images/M/MV5BMTM1MjU1NTYzMV5BMl5BanBnXkFtZTcwODk2NzAwNw@@._V1_SX214_.jpg', '23 February 2012 (Portugal)', 6.5, 'Albert Nobbs', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (419, 'An ex-cop turned con threatens to jump to his death from a Manhattan hotel rooftop. The nearest New York Police officer immediately responds to a screaming woman and calls dispatch. More Officers arrive with SWAT and tactical command along with fire-fighters. The police then dispatches a female police psychologist personally requested to talk him down from the ledge. However, things aren''t as straightforward and clearcut as they appear to be. Written by Anonymous', '102 min', 'http://ia.media-imdb.com/images/M/MV5BMTc5MTE4MzY2N15BMl5BanBnXkFtZTcwNjMwNDc3Ng@@._V1_SX214_.jpg', '27 January 2012 (USA)', 6.5, 'Man on a Ledge', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (420, 'Roméo and Juliette are two young actors. They fall in love at first sight, move in together and make a baby. A love story and the founding of a home like millions of others. Except that their little boy, Adam, behaves abnormally. The young parents try hard to persuade themselves that everything is okay but, with the passing of time, they cannot delude themselves anymore : their son has problem. Their fears are unfortunately confirmed : Adam suffers from a malignant brain tumor. From now on, war is declared. A war against illness. A war against Death. A war against despair. Written by Guy Bellinger', '100 min', 'http://ia.media-imdb.com/images/M/MV5BMTU1NjI1Mjg3Ml5BMl5BanBnXkFtZTcwMDk0ODAxNw@@._V1_SX214_.jpg', '23 February 2012 (Portugal)', 6.90000000000000036, 'Declaração de Guerra', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (421, 'Young Christians Beth and Steve, a gospel singer and her cowboy boyfriend, leave Texas to preach door-to-door in Scotland . When, after initial abuse, they are welcomed with joy and elation to Tressock, the border fiefdom of Sir Lachlan Morrison, they assume their hosts simply want to hear more about Jesus. How innocent and wrong they are. Written by Anonymous', '96 min', 'http://ia.media-imdb.com/images/M/MV5BMTkyNzkyODE5N15BMl5BanBnXkFtZTcwNjUxNzIxNw@@._V1_SX214_.jpg', '27 January 2012 (USA)', 4, 'The Wicker Tree', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (422, 'Layered romantic drama The Words follows young writer Rory Jansen who finally achieves long sought after literary success after publishing the next great American novel. There''s only one catch - he didn''t write it. As the past comes back to haunt him and his literary star continues to rise, Jansen is forced to confront the steep price that must be paid for stealing another man''s work, and for placing ambition and success above life''s most fundamental three words. Written by Anonymous', '102 min', 'http://ia.media-imdb.com/images/M/MV5BMTM2NjgyMjI3OV5BMl5BanBnXkFtZTcwMDkxMjIyOA@@._V1_SX214_.jpg', '7 September 2012 (USA)', 6.90000000000000036, 'The Words', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (425, 'After his family is kidnapped during their sailing trip in Spain, a young Wall Street trader is confronted by the people responsible: intelligence agents looking to recover a mysterious briefcase.', '93 min', 'http://ia.media-imdb.com/images/M/MV5BMTQzODQ4NjAxMF5BMl5BanBnXkFtZTcwMzAwNjM0Nw@@._V1_SY317_CR0,0,214,317_.jpg', '7 September 2012 (USA)', 4.79999999999999982, 'The Cold Light of Day', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (428, 'On the night of one of their old high school friend''s wedding three irresponsible and capricious bridesmaids reunite for one last bachelorette bacchanal in the Big Apple. They unintentionally create a mess of their best friend Becky''s wedding dress, before she marries her sweetheart Dale. They attempt to repair the situation by spending the evening before and morning of the wedding desperate to get the dress to Becky on time before the wedding starts, whilst discovering themselves and what they truly want from their lives along the way. Written by Angel Youles', '87 min', 'http://ia.media-imdb.com/images/M/MV5BNzk3MjA1NzE5OV5BMl5BanBnXkFtZTcwNTQ0NTcxOA@@._V1_SX214_.jpg', '6 September 2012 (Russia)', 5.20000000000000018, 'Bachelorette', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (474, 'Robert Miller is a successful financial businessman with a loving wife and a smart daughter ready to take over the family business. Professional secrets involving illegal fraudulent activities start coming out at the same time that Robert''s personal secrets take a turn for the worse and threaten to derail everything he has achieved. Written by napierslogs', '107 min', 'http://ia.media-imdb.com/images/M/MV5BODU5ODYyNzM1MF5BMl5BanBnXkFtZTcwNDEwNTQwOA@@._V1_SX214_.jpg', '14 September 2012 (USA)', 6.70000000000000018, 'Arbitrage', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (439, 'It''s 1997 and New York City is in a state of intense flux when documentary filmmaker Erik Rothman (Thure Lindhardt) first meets Paul Lucy (Zachary Booth), a handsome but closeted lawyer in the publishing field. What begins as a highly charged first encounter soon becomes something much more, and a relationship quickly develops. As the two men start building a home and life together, each continues to privately battle their own compulsions and addictions. A film about sex, friendship, intimacy and most of all, love, Keep the Lights On takes an honest look at the nature of relationships in our times. Written by Anonymous', '101 min', 'http://ia.media-imdb.com/images/M/MV5BNDU0MDM1MTU0MV5BMl5BanBnXkFtZTcwNjI0MDgxOA@@._V1_SY317_CR0,0,214,317_.jpg', '27 July 2012 (Taiwan)', 6, 'Keep the Lights On', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (443, 'The action now takes place miles away from the original location and partly in broad daylight, giving the film an entirely fresh yet disturbing new reality. The infection has left the building. In a clever twist that draws together the plots of the first two movies, this third part of the saga also works as a decoder to uncover information hidden in the first two films and leaves the door open for the final installment, the future ''[REC] 4 Apocalypse.'' Written by www.dreadcentral.com', '80 min', 'http://ia.media-imdb.com/images/M/MV5BNDM3OTUzMTA1OF5BMl5BanBnXkFtZTcwNTkwMTE3Nw@@._V1_SY317_CR4,0,214,317_.jpg', '11 October 2012 (Portugal)', 5.09999999999999964, '[REC]³ Genesis', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (446, 'A struggling musician takes an overnight long-distance drive in order to fight his estranged wife for custody of their young daughter.', '94 min', 'http://ia.media-imdb.com/images/M/MV5BMjMxOTg2OTExOF5BMl5BanBnXkFtZTcwMDA0MjYyOA@@._V1_SX214_.jpg', '19 September 2012 (France)', 5.59999999999999964, 'For Ellen', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (448, 'Set in a dystopian future where corporate brands have created a disillusioned population, one man''s effort to unlock the truth behind the conspiracy will lead to an epic battle with hidden forces that control the world.', '106 min', 'http://ia.media-imdb.com/images/M/MV5BMTk1NjI3NzQ5NF5BMl5BanBnXkFtZTcwNjMyNjM5Nw@@._V1_SX214_.jpg', '7 September 2012 (USA)', 4.5, 'Branded', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (451, 'Raised in the Tennessee mountains, Wayne White started his career as a cartoonist in NYC. He quickly found success as one of the creators of the Pee-wee''s Playhouse TV show which soon led to more work design some of the most arresting and iconic images in pop culture. Recently his word paintings featuring pithy and and often sarcastic text statements finely crafted onto vintage landscape paintings have made him a darling of the fine art world. The movie chronicles the vaulted highs and crushing lows of an artist struggling to find peace and balance between his professional work and his personal art. This is especially complicated for a man who struggles with the virtues he most often mocks in his art...Vanity, ego and fame. Written by Neil Berkeley', '88 min', 'http://ia.media-imdb.com/images/M/MV5BMTQwNTM2OTM4NV5BMl5BanBnXkFtZTcwNjUzMjQ4Nw@@._V1_SX214_.jpg', '10 March 2012 (USA)', 7, 'Beauty Is Embarrassing', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (453, 'A documentary on the modeling industry''s ''supply chain'' between Siberia, Japan, and the U.S., told through the experiences of the scouts, agencies, and a 13-year-old model.', '78 min', 'http://ia.media-imdb.com/images/M/MV5BMjAyNjAyODcwNV5BMl5BanBnXkFtZTcwNDY4ODQzOA@@._V1_SY317_CR3,0,214,317_.jpg', '10 February 2012 (Ireland)', 6.5, 'Girl Model', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (456, 'In an attic full of discarded junk, a pretty doll called Buttercup lives in an old trunk together with her friends, the marionette Sir Handsome, the lovable Teddy Bear, a Mechanical Mouse and the plasticine creature, Laurent. When Buttercup is snatched and taken off to the Land of Evil, her pals set out on a wondrous and daring adventure to rescue her from the all-powerful Head of State. Written by Karlovy Vary International Film Festival', '80 min', 'http://ia.media-imdb.com/images/M/MV5BMzg5NjUyODQ5MV5BMl5BanBnXkFtZTcwMTA2OTkzNw@@._V1_SX214_.jpg', '5 March 2009 (Czech Republic)', 6.20000000000000018, 'Toys in the Attic', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (470, 'Returning from Navy service in World War II, Freddie Quell drifts through a series of breakdowns. Finally he stumbles upon a cult which engages in exercises to clear emotions and he becomes deeply involved with them. Written by Alan Young, edit Hal Issen', '144 min', 'http://ia.media-imdb.com/images/M/MV5BMTgxMjY1OTk4MV5BMl5BanBnXkFtZTcwOTQ3NDMxOQ@@._V1_SY317_CR6,0,214,317_.jpg', '21 September 2012 (USA)', 7.09999999999999964, 'The Master', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (471, 'Alice awakes at home with her daughter Becky and her husband. But soon she realizes that she is actually in an Umbrella Corporation''s underground facility. Out of the blue, the computer security system shuts-down and Alice flees to the central control room of the facility. She meets Ada Wong, who works with Albert Wesker, and she learns that a five-man team has been sent by Wesker to rescue them. However, the Red Queen sends Jill Valentine and Rain to hunt them down. Written by Claudio Carvalho, Rio de Janeiro, Brazil', '96 min', 'http://ia.media-imdb.com/images/M/MV5BMTA2NTkwNjUxNTZeQTJeQWpwZ15BbWU3MDE2OTMxMTg@._V1_SX214_.jpg', '14 September 2012 (USA)', 5.20000000000000018, 'Resident Evil: Retaliação', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (472, 'A clown fish named Marlin lives in the Great Barrier Reef loses his son, Nemo. After he ventures into the open sea, despite his father''s constant warnings about many of the ocean''s dangers. Nemo is abducted by a boat and netted up and sent to a dentist''s office in Sydney. So, while Marlin ventures off to try to retrieve Nemo, Marlin meets a fish named Dory, a blue tang suffering from short-term memory loss. The companions travel a great distance, encountering various dangerous sea creatures such as sharks, anglerfish and jellyfish, in order to rescue Nemo from the dentist''s office, which is situated by Sydney Harbor. While the two are doing this, Nemo and the other sea animals in the dentist''s fish tank plot a way to return to Sydney Harbor to live their lives free again. Written by Anonymous', '100 min', 'http://ia.media-imdb.com/images/M/MV5BMTY1MTg1NDAxOV5BMl5BanBnXkFtZTcwMjg1MDI5Nw@@._V1_SY317_CR0,0,214,317_.jpg', '30 May 2003 (USA)', 8.09999999999999964, 'Finding Nemo', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (473, 'Thirty-five year old Jesse Fisher, an admissions officer at a New York City post-secondary institution he who loves English and literature, has somewhat lost his passion in life, which includes recently being unceremoniously dumped by his latest girlfriend, who could no longer be the person to prop him up emotionally. He has a chance to find that passion again when he is invited to the retirement dinner of his second favorite Ohio University college professor, Peter Hoberg, as his time there was when his life held the most passion. Jesse''s encounters with five people there may determine if he does find that passion again. They are: Hoberg, who is resisting the notion of retirement; Judith Fairfield, Jesse''s favorite professor, although for a different reason than his like of Hoberg; Nat, a free spirit who navigates life at the institution on his own terms; undergraduate student Dean, who Jesse sees as a younger more destructive version of himself; and nineteen year old undergraduate ... Written by Huggo', '97 min', 'http://ia.media-imdb.com/images/M/MV5BMTY4Njk3MjE2N15BMl5BanBnXkFtZTcwNzg5OTIyOA@@._V1_SY317_CR0,0,214,317_.jpg', '5 October 2012 (UK)', 6.70000000000000018, 'Liberal Arts', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (475, 'The night before their high school reunion, a group of friends realize they still haven''t quite grown up in some ways.', '100 min', 'http://ia.media-imdb.com/images/M/MV5BNTY3NTY3ODAzOF5BMl5BanBnXkFtZTcwMTI4MDQyOA@@._V1_SX214_.jpg', '13 December 2012 (Russia)', 6, '10 Years', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (486, 'When Camille accidentally becomes pregnant, 16 of her friends and classmates decide to follow suit, throwing their town and school into chaos.', '86 min', 'http://ia.media-imdb.com/images/M/MV5BMjMxMzAxNDcyNV5BMl5BanBnXkFtZTcwODM4MDQyOA@@._V1_SY317_CR0,0,214,317_.jpg', '21 September 2012 (USA)', 5.79999999999999982, '17 Raparigas', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (476, 'In New Orleans, the notorious bank thief and family man Will Montgomery steals $10m with his partners Vincent, Riley Jeffers and Hoyt. However, he has an argument with Vincent in the runaway and Hoyt leaves Will behind. He tries to flee but the FBI agent Tim Harlend organizes a manhunt and Will is captured, but he burns the stolen money to get rid of the evidences against him. Eight years later, Will leaves the prison and he goes to the house of his teenage daughter Alison Loeb, who has issues against him. Alison leaves Will alone in a coffee shop and takes a cab to go to a session with her shrink. However, a couple of minutes later, Will receives a phone call from Vincent, who is presumed dead, telling that he has abducted Alison and will kill her unless he receives the $10m of the last robbery. Now Will has twelve hours to find a way to rescue his daughter from the hands of the psychopath Vincent. Written by Claudio Carvalho, Rio de Janeiro, Brazil', '96 min', 'http://ia.media-imdb.com/images/M/MV5BNzY0ODM1NzU0OV5BMl5BanBnXkFtZTcwNTExNjIyOA@@._V1_SX214_.jpg', '6 September 2012 (United Arab Emirates)', 5.40000000000000036, 'Stolen', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (477, 'Walter is a professional killer and has messed up a job. He has to leave the city and takes up an offer of crime boss Berger to protect Berger''s house in a remote region of the Carpathian Mountains. At his side: old friend Mickey. By accident Berger''s young wife Sybille is killed and Walter and Mickey hide her body because they fear Berger''s vengeance. What seemed to be a nice holiday trip with little work for Walter and Mickey soon becomes a fight for survival for all parties involved. Written by Anonymous', '95 min', 'http://ia.media-imdb.com/images/M/MV5BMTQzODE4MTcxOF5BMl5BanBnXkFtZTcwMjE4NjMxMw@@._V1_SY317_CR5,0,214,317_.jpg', '30 September 2010 (Germany)', 6, 'Snowman''s Land', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (478, 'The future America is an irradiated waste land. On its East Coast, running from Boston to Washington DC, lies Mega City One - a vast, violent metropolis where criminals rule the chaotic streets. The only force of order lies with the urban cops called "Judges" who possess the combined powers of judge, jury and instant executioner. Known and feared throughout the city, Dredd is the ultimate Judge, challenged with ridding the city of its latest scourge - a dangerous drug epidemic that has users of "Slo-Mo" experiencing reality at a fraction of its normal speed. During a routine day on the job, Dredd is assigned to train and evaluate Cassandra Anderson, a rookie with powerful psychic abilities thanks to a genetic mutation. A heinous crime calls them to a neighborhood where fellow Judges rarely dare to venture - a 200 storey vertical slum controlled by prostitute turned drug lord Ma-Ma and her ruthless clan. When they capture one of the clan''s inner circle, Ma-Ma overtakes the compound''s ... Written by Production', '95 min', 'http://ia.media-imdb.com/images/M/MV5BODkyNDQzMzUzOF5BMl5BanBnXkFtZTcwODYyMDEyOA@@._V1_SX214_.jpg', '21 September 2012 (USA)', 7, 'Dredd', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (479, 'In South Central Los Angeles, street cops Brian and Mike are partners - balls-out cowboys patrolling the streets as Latino gangs are in a power struggle with Blacks. Brian and Mike get lucky a couple of times, making big drug and human-trafficking busts, so a Mexican cartel orders their deaths. We meet Mike''s pregnant wife (whom he married out of high school) and watch Brian''s search for a soul mate. There are internal squabbles within the ranks of the LAPD and lots of squad-car conversation. Can the lads escape the cartel''s murderous reach? Written by <jhailey@hotmail.com>', '109 min', 'http://ia.media-imdb.com/images/M/MV5BMjMxNjU0ODU5Ml5BMl5BanBnXkFtZTcwNjI4MzAyOA@@._V1_SX214_.jpg', '21 September 2012 (USA)', 7.59999999999999964, 'End of Watch', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (480, 'Newly divorced Sarah and her daughter Elissa find the house of their dreams in a small, upscale, rural town. But when startling and unexplainable events begin to happen, Sarah and Elissa learn the town is in the shadows of a chilling secret. Written by Relativity', '101 min', 'http://ia.media-imdb.com/images/M/MV5BMjIxNTUwNTU4N15BMl5BanBnXkFtZTcwNTE0MTI3Nw@@._V1_SX214_.jpg', '21 September 2012 (USA)', 5.40000000000000036, 'House at the End of the Street', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (481, 'Gus is a baseball scout. The team he works for thinks he should retire. He asks them to let him do one more scouting job to prove himself. His friend, Pete, asks Gus''s estranged daughter, Mickey, if she could go with him to make sure he''s OK as his eyes are failing. The doctor tells Gus he should get his eyes treated but he insists on doing his scouting assignment, which takes him to North Carolina. Mickey decides to put her work on hold to go with him and she wants him to explain why he pushed her away. Whilst there he runs into Johnny, a scout from another team who was a promising player Gus once scouted. Johnny and Mickey take an interest in each other. Written by rcs0411@yahoo.com', '111 min', 'http://ia.media-imdb.com/images/M/MV5BMTUwNjMyMzQ3M15BMl5BanBnXkFtZTcwMjcwNDMyOA@@._V1_SY317_CR0,0,214,317_.jpg', '21 September 2012 (USA)', 6.70000000000000018, 'Trouble with the Curve', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (482, 'Based on the novel written by Stephen Chbosky, this is about 15-year-old Charlie (Logan Lerman), an endearing and naive outsider, coping with first love (Emma Watson), the suicide of his best friend, and his own mental illness while struggling to find a group of people with whom he belongs. The introvert freshman is taken under the wings of two seniors, Sam and Patrick, who welcome him to the real world. Written by Anonymous', '102 min', 'http://ia.media-imdb.com/images/M/MV5BMzIxOTQyODU1OV5BMl5BanBnXkFtZTcwMDQ4Mjg4Nw@@._V1_SY317_CR0,0,214,317_.jpg', '12 October 2012 (USA)', 8, 'The Perks of Being a Wallflower', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (483, 'In the early years of the AIDS epidemic, the disease was considered a death sentence affecting communities, like the LGBT ones, whom many in power felt deserved it. This film tells the story of how militant activists like ACT-UP and TAG pushed for a meaningful response to this serious public health problem. As the activists struggled against political indifference, religious hostility, corporate greed and apparently skewed scientific research priorities with determination and sheer audacity, they produced a political wave that would lead to not only an effective treatment regime, but would advance LGBT rights beyond anyone''s expectations. Written by Kenneth Chisholm (kchishol@rogers.com)', '110 min', 'http://ia.media-imdb.com/images/M/MV5BMTg2NTEyNTE3NF5BMl5BanBnXkFtZTcwNjY3NzM0OA@@._V1_SY317_CR0,0,214,317_.jpg', '8 November 2013 (UK)', 7.29999999999999982, 'How to Survive a Plague', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (484, 'For decades, Diana Vreeland was one of the leading authorities in fashion through eccentric self-taught skill and a bold stylistic audacity. This film guides you through this fashion pioneer''s long career from her youth in Paris until she became a leading magazine fashion columnist and editor. In this medium, Vreeland challenged its preconceptions to present a new definition of beauty and vivaciousness where nice clothes were just the beginning for something deeper. Even when that vocation ended, Vreeland managed to gain a new museum profession to present clothing''s history in her own inimitable way. Written by Kenneth Chisholm (kchishol@rogers.com)', '86 min', 'http://ia.media-imdb.com/images/M/MV5BMzM5NTY3Mzg2NF5BMl5BanBnXkFtZTcwMzczOTU0OA@@._V1_SX214_.jpg', '21 September 2012 (UK)', 6.5, 'Diana Vreeland: The Eye Has to Travel', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (485, 'A drama centered on a troubled young woman who moves to San Francisco, where she gets involved in pornography and aligns herself with a cocaine-addicted lawyer.', '98 min', 'http://ia.media-imdb.com/images/M/MV5BMTM4MTA3MTk0MF5BMl5BanBnXkFtZTcwNDI0NjAyOA@@._V1_SY317_CR0,0,214,317_.jpg', '21 December 2012 (Turkey)', 4.70000000000000018, 'About Cherry', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (488, 'When a fiercely competitive 30 year old rower fails to make the Olympic boat for the second time, she takes a coaching job at a school but struggles to adjust to life off the race course.', '89 min', 'http://ia.media-imdb.com/images/M/MV5BMTM1MzI2OTA5MV5BMl5BanBnXkFtZTcwMjkxMjIyOA@@._V1_SX214_.jpg', '21 September 2012 (USA)', 4.90000000000000036, 'Backwards', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (489, 'A woman''s idyllic life is shattered when her husband is killed in a senseless act of violence. As she prepares to take matters into her own hands, two unexpected encounters begin to change everything.', '92 min', 'http://ia.media-imdb.com/images/M/MV5BMjcyNjY1NzYzOV5BMl5BanBnXkFtZTcwMzQyOTUzOA@@._V1_SY317_CR0,0,214,317_.jpg', '21 September 2012 (USA)', 6.5, 'Unconditional', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (490, 'In the year 2044, a man working for a group of killers called "Loopers" (they work for the mob and kill people who are sent blindfolded back in time from the year 2074 by their bosses) recognizes a victim as himself. He hesitates resulting in the escape of his older self. Written by malachmcfreak', '119 min', 'http://ia.media-imdb.com/images/M/MV5BMTY3NTY0MjEwNV5BMl5BanBnXkFtZTcwNTE3NDA1OA@@._V1_SY317_CR15,0,214,317_.jpg', '28 September 2012 (USA)', 7.5, 'Looper', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (491, 'In 1895, Dracula builds a resort in Transylvania, hidden from the humans, to raise his beloved daughter Mavis in a safe environment. In the present days, the place is the Hotel Transylvania, where monsters bring their families to spend vacation far from the frightening humans. Dracula invites his friends - Frankenstein and his wife Eunice; Wayne and Wanda, the werewolves; Griffin, the invisible man; Murray, the mummy; the Bigfoot, among others - to celebrate the 118th birthday of Mavis. When the party is ready to start, the 21-year-old Jonathan is walking through the forest and stumbles at the hotel. Dracula sees Jonathan and disguises him as a monster to hide Jonathan from the guests. But Mavis also sees Jonathan and Dracula forces him to pose of a monster. Soon Mavis believes that Jonathan is the "zing" of her life despite the advices of her father about the humans. Written by Claudio Carvalho, Rio de Janeiro, Brazil', '91 min', 'http://ia.media-imdb.com/images/M/MV5BMTM3NjQyODI3M15BMl5BanBnXkFtZTcwMDM4NjM0OA@@._V1_SX214_.jpg', '28 September 2012 (USA)', 7, 'Hotel Transylvania', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (492, 'Two determined mothers with children who are failing in an inner city school in Pittsburgh join forces to take back the school, and turn it into a place of learning. But before they can change the school for the better, they must first battle the parents, the school board, and the teachers union. Because this is for their children, they won''t back down from this enormous challenge. Written by Douglas Young (the-movie-guy)', '121 min', 'http://ia.media-imdb.com/images/M/MV5BMTg2NzUyMzYxOF5BMl5BanBnXkFtZTcwOTc4NzY5Nw@@._V1_SY317_CR0,0,214,317_.jpg', '28 September 2012 (USA)', 5.90000000000000036, 'Won''t Back Down', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (493, 'The Barden Bellas are a collegiate, all-girls a cappella singing group thriving on female pop songs and their perfect looks. After a disastrous failing at last year''s finals, they are forced to regroup. Among the new recruits is freshman Beca, an independent, aspiring DJ with no interest in the college life. But after she meets Jesse, from the rival all-male a cappella group, Beca has a new outlook and takes it upon herself to help the Bellas find their new look and sound and get back into the competition. Written by napierslogs', '112 min', 'http://ia.media-imdb.com/images/M/MV5BMTcyMTMzNzE5N15BMl5BanBnXkFtZTcwNzg5NjM5Nw@@._V1_SX214_.jpg', '5 October 2012 (USA)', 7.09999999999999964, 'Pitch Perfect', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (494, 'The incredible story of the 1992 Lithuanian basketball team, whose athletes struggled under Soviet rule, became symbols of Lithuania''s independence movement, and - with help from the Grateful Dead - triumphed at the Barcelona Olympics.', '89 min', 'http://ia.media-imdb.com/images/M/MV5BODg5MzQ3NTA5OV5BMl5BanBnXkFtZTcwNTYxMTEzOA@@._V1_SX214_.jpg', '28 September 2012 (USA)', 7.79999999999999982, 'The Other Dream Team', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (495, 'Once a mercenary of Queen Elizabeth I fighting Spaniards in Africa, Solomon met the Devil''s Reaper and discovered he was bound for hell. Barely escaping, he soon renounced violence to atone for his past sins, seeking out redemption in a life of peace. That is until the followers of sorcerer Malachi kidnap a Puritan girl, Meredith Crowthorn, and brutally slaughter her family before his very eyes, forcing Solomon to take up arms and return to his violent ways once more to rescue her. Written by corsos, corrected by Pike84', '104 min', 'http://ia.media-imdb.com/images/M/MV5BMTU5NDMwOTkxMV5BMl5BanBnXkFtZTcwMTg5OTM1OA@@._V1_SY317_CR13,0,214,317_.jpg', '18 March 2010 (Portugal)', 6, 'Solomon Kane', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (496, 'This Thai crime noir tells the story of Tul, a hitman who wakes up from a coma to realize that he''s now seeing everything upside down. Tul wants to quit but is instead recruited to join a secret organization that gets rid of crooked politicians untouched by the law. Written by CJ', '105 min', 'http://ia.media-imdb.com/images/M/MV5BMTYwMDA5MTU1MF5BMl5BanBnXkFtZTcwNTMyNDA1OA@@._V1_SY317_CR5,0,214,317_.jpg', '28 September 2012 (USA)', 6.09999999999999964, 'Headshot', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (497, 'The Waiting Room is a character-driven documentary film that uses extraordinary access to go behind the doors of an American public hospital struggling to care for a community of largely uninsured patients. The film - using a blend of cinema verité and characters'' voice over - offers a raw, intimate, and even uplifting look at how patients, executive staff and caregivers each cope with disease, bureaucracy and hard choices. It is a film about fighting for survival when the odds are stacked against you. Written by Anonymous', '81 min', 'http://ia.media-imdb.com/images/M/MV5BMTQxMDYwMDM2OF5BMl5BanBnXkFtZTcwMzI3MzcyOA@@._V1_SX214_.jpg', '19 June 2012 (USA)', 6.59999999999999964, 'The Waiting Room', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (498, 'Bringing Up Bobby is the story of a European con-artist and her son Bobby, who find themselves in Oklahoma in an effort to escape her past and build a better future. Olive and Bobby blithely charm their way from one adventure to another until Olive''s criminal past catches up with her. Consequently, she must make a choice: continue with a life of crime or leave the person she loves most in an effort to give Bobby a proper chance in life. Written by FJ', '93 min', 'http://ia.media-imdb.com/images/M/MV5BMTAyNzEzMDMzNDNeQTJeQWpwZ15BbWU3MDU5MDY2MDc@._V1_SX214_.jpg', '2011 (UK)', 4.90000000000000036, 'Bringing Up Bobby', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (499, 'In London, lawyer Arthur Kipps still grieves the death of his beloved wife Stella on the delivery of their son Joseph four years ago. His employer gives him a last chance to keep his job, and he is assigned to travel to the remote village of Cryphin Gifford to examine the documentation of the Eel Marsh House that belonged to the recently deceased Mrs. Drablow. Arthur befriends Daily on the train and the man offers a ride to him to the Gifford Arms inn. Arthur has a cold reception and the owner of the inn tells that he did not receive the request of reservation and there is no available room. The next morning, Arthur meets solicitor Jerome who advises him to return to London. However, Arthur goes to the isolated manor and soon he finds that Eel Marsh House is haunted by the vengeful ghost of a woman dressed in black. He also learns that the woman lost her son drowned in the marsh and she seeks revenge, taking the children of the scared locals. Written by Claudio Carvalho, Rio de Janeiro, Brazil', '95 min', 'http://ia.media-imdb.com/images/M/MV5BMjEwMzIxOTg3N15BMl5BanBnXkFtZTcwMjI4ODUzNw@@._V1_SX214_.jpg', '3 February 2012 (USA)', 6.40000000000000036, 'The Woman in Black', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (500, 'The shy, lonely and outcast teenager Andrew Detmer is bullied and has no friends at high-school and lives with his abusive and alcoholic father Richard Detmer and his terminal mother Karen. Matt buys a camera to film his everyday. His cousin Matt Garetty drives him to school and invites Andrew to go to a party at night. They meet their schoolmate Steve Montgomery in the party and they overhear a noise and find a hole in a field. They decide to explore the underground and they acquire powers. Soon the trio learns how to control their telekinetic abilities and Andrew becomes the most powerful. But he easily loses his temper and becomes dangerous while Matt tries to control him. When his mother needs a medicine and Andrew does not have enough money to buy it, his darker side overcomes and he becomes a menace. Written by Claudio Carvalho, Rio de Janeiro, Brazil', '84 min', 'http://ia.media-imdb.com/images/M/MV5BMjEzMjYzMDQ0MV5BMl5BanBnXkFtZTcwNzE1OTM5Ng@@._V1_SX214_.jpg', '3 February 2012 (USA)', 7, 'Chronicle', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (501, 'An animal-loving volunteer and a small-town news reporter are joined by a native Alaskan boy to rally an entire community - and eventually rival world superpowers - to save a family of majestic gray whales trapped by rapidly forming ice in the Arctic Circle. Written by Universal Pictures', '107 min', 'http://ia.media-imdb.com/images/M/MV5BMjEzNTg5MjA5NV5BMl5BanBnXkFtZTcwNjk0MTk5Ng@@._V1_SX214_.jpg', '3 February 2012 (USA)', 6.29999999999999982, 'Big Miracle', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (502, 'During the final days at the Yankee Pedlar Inn, two employees determined to reveal the hotel''s haunted past begin to experience disturbing events as old guests check in for a stay.', '101 min', 'http://ia.media-imdb.com/images/M/MV5BNDYwMTUxNjk5NV5BMl5BanBnXkFtZTcwMTM5NDc5Ng@@._V1_SX214_.jpg', '1 August 2013 (Portugal)', 5.5, 'The Innkeepers', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (503, 'Nearly a year after a botched job, a hitman takes a new assignment with the promise of a big payoff for three killings. What starts off as an easy task soon unravels, sending the killer into the heart of darkness.', '95 min', 'http://ia.media-imdb.com/images/M/MV5BNzM3NzU2NzUzMV5BMl5BanBnXkFtZTcwNjY2OTUxNw@@._V1_SX214_.jpg', '8 March 2012 (Portugal)', 6.20000000000000018, 'Kill List', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (504, 'In 1998, an auction of the estate of the Duke and Duchess of Windsor causes great excitement. For one woman, Wally Winthrop, it has much more meaning. Wally becomes obsessed by their historic love story. As she learns more about the sacrifices involved, Wally gains her own courage to find happiness. Written by Anonymous', '119 min', 'http://ia.media-imdb.com/images/M/MV5BMTQyMzMyMjkwM15BMl5BanBnXkFtZTcwNzIyODkxNw@@._V1_SY317_CR0,0,214,317_.jpg', '20 January 2012 (UK)', 5.59999999999999964, 'W.E.', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (505, 'Wind power... It''s green... It''s good... It reduces our dependency on foreign oil... That''s what the people of Meredith, in upstate New York first thought when a wind developer looked to supplement this farm town''s failing economy with a farm of their own -- that of 40 industrial wind turbines. Attracted at first to the financial incentives, residents grow increasingly alarmed as they discover side effects they never dreamed of, as well as the potential for disturbing financial scams. With wind development growing rapidly at 39% annually in the US, WINDFALL is an eye-opener for anyone concerned about the future of renewable energy. Written by Anonymous', '83 min', 'http://ia.media-imdb.com/images/M/MV5BMTU5MTAwNjI3NV5BMl5BanBnXkFtZTcwOTExNTUzNw@@._V1_SX214_.jpg', '7 May 2010 (USA)', 4.59999999999999964, 'Windfall', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (506, 'Matt Weston (Ryan Reynolds) is a CIA rookie who is manning a safe house in Cape Town, South Africa, when Tobin Frost (Denzel Washington) the CIA''s most wanted rogue agent is captured and taken to the safe house. During Frost''s interrogation, the safe house is overtaken by mercenaries who want Frost. Weston and Frost escape and must stay out of the gunmen''s sight until they can get to another safe house. Written by Douglas Young (the-movie-guy)', '115 min', 'http://ia.media-imdb.com/images/M/MV5BMjI5ODkyMjA2Nl5BMl5BanBnXkFtZTcwNTcyNTgzNw@@._V1_SX214_.jpg', '10 February 2012 (USA)', 6.70000000000000018, 'Safe House', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (507, 'The 17-year-old Sean Anderson receives a coded signal and his stepfather Hank helps him to decipher the message. They find that Sean''s grandfather Alexander Anderson has found the mysterious island in the Pacific described by Jules Verne and two other writers in their novels. The stubborn Sean wants to travel to the coordinates and Hank decides to buy the tickets and travel with the teenager to a small island nearby the location. They rent an old helicopter owned by the locals Gabato and his teenage daughter Kailani and the group heads to the unknown spot. Along their journey, they cross a hurricane and crash in the island. They find a beautiful and dangerous place, surrounded by forests, volcanoes with lava of gold and menacing life forms. The meet also the old Alexander and Hank discovers that the island is sinking. Now their only chance to survive is to find the legendary Nautilus. Written by Claudio Carvalho, Rio de Janeiro, Brazil', '94 min', 'http://ia.media-imdb.com/images/M/MV5BMjA5MTE1MjQyNV5BMl5BanBnXkFtZTcwODI4NDMwNw@@._V1_SX214_.jpg', '10 February 2012 (USA)', 5.70000000000000018, 'Journey 2: The Mysterious Island', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (508, 'Leo and Paige are a couple who just got married. After an accident, Paige is left unconscious, and when she awakes she doesn''t remember Leo. Her parents, whom she hasn''t seen since she and Leo got together, come and visit her. She can''t believe that she hasn''t seen them for such a long time. Leo wants to bring her home with him but her parents want her to go with them. She goes with Leo but when she doesn''t recognize anything, she goes to her parents. And she wonders why did she cut off contact with her family. She also runs into her ex and wonders why they broke up. Leo tries to win her back by courting her again. Written by rcs0411@yahoo.com', '104 min', 'http://ia.media-imdb.com/images/M/MV5BMjE1OTU5MjU0N15BMl5BanBnXkFtZTcwMzI3OTU5Ng@@._V1_SX214_.jpg', '10 February 2012 (USA)', 6.70000000000000018, 'The Vow', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (509, 'The evil Trade Federation, led by Nute Gunray is planning to take over the peaceful world of Naboo. Jedi Knights Qui-Gon Jinn and Obi-Wan Kenobi are sent to confront the leaders. But not everything goes to plan. The two Jedi escape, and along with their new Gungan friend, Jar Jar Binks head to Naboo to warn Queen Amidala, but droids have already started to capture Naboo and the Queen is not safe there. Eventually, they land on Tatooine, where they become friends with a young boy known as Anakin Skywalker. Qui-Gon is curious about the boy, and sees a bright future for him. The group must now find a way of getting to Coruscant and to finally solve this trade dispute, but there is someone else hiding in the shadows. Are the Sith really extinct? Is the Queen really who she says she is? And what''s so special about this young boy? Written by simon', '136 min', 'http://ia.media-imdb.com/images/M/MV5BMTQ4NjEwNDA2Nl5BMl5BanBnXkFtZTcwNDUyNDQzNw@@._V1_SX214_.jpg', '19 May 1999 (USA)', 6.5, 'Star Wars: Episode I - The Phantom Menace', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (510, 'Dave Brown is a Los Angeles police officer who works out of the Rampart Division. Dave is misogynistic, racist, brutally violent, egotistical and a womanizer, although he defends himself against many of these accusations as he says that his hate is equal opportunity. However unlawful, he uses intimidation and brutal force to defend his ideals. The most notorious of his actions is purportedly murdering a suspected serial date rapist, which is why he has been given the nickname "Date Rape Dave". He lives with two of his ex-wives - sisters Barbara and Catherine - in an effort to keep family together, namely his two daughters, Helen and Margaret, who each have a different sister as their mother. Dave still maintains a sexual relationship with both sisters - whenever the mood suits any of them - while he openly has other sexual relationships. His life is put under a microscope after he is caught on video brutally beating a person with who he got into an automobile crash. This situation is ... Written by Huggo', '108 min', 'http://ia.media-imdb.com/images/M/MV5BMTk4MjAxNzU2MV5BMl5BanBnXkFtZTcwMDA5NTAwNw@@._V1_SY317_CR0,0,214,317_.jpg', '7 June 2012 (Portugal)', 5.79999999999999982, 'Rampart', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (511, 'IN DARKNESS tells the true story of Leopold Socha who risks his own life to save a dozen people from certain death. Initially only interested in his own good, the thief and burglar hides Jewish refugees for 14 months in the sewers of the Nazi-occupied town of Lvov (former Poland). Written by Anonymous', '145 min', 'http://ia.media-imdb.com/images/M/MV5BMTk3NDg2OTU3N15BMl5BanBnXkFtZTcwMDM3ODkwNw@@._V1_SY317_CR1,0,214,317_.jpg', '5 January 2012 (Poland)', 7.09999999999999964, 'In Darkness', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (512, 'An odd epidemic appears across the globe: people suddenly lose one of their senses. At first, it''s an outbreak of loss of smell. It''s often presaged by a destructive temper tantrum. In this mix are a scientist and a chef - she''s Susan, one of a team trying to understand the epidemic; he''s Michael, charming and engaging. Susan and Michael begin a relationship in the middle of increasing chaos, as the loss of other senses plagues more people and as civil authorities try to maintain order. Susan''s voice-over reflections provide insight. Is love possible in such a changed world? Can anything make perfect sense? Written by <jhailey@hotmail.com>', '92 min', 'http://ia.media-imdb.com/images/M/MV5BMTk3MjYwMjkzOF5BMl5BanBnXkFtZTcwMTE1NjIxNw@@._V1_SX214_.jpg', '10 October 2013 (Portugal)', 7, 'Perfect Sense', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (513, '1889. German philosopher Friedrich Nietzsche witnessed the whipping of a horse while traveling in Turin, Italy. He tossed his arms around the horse''s neck to protect it then collapsed to the ground. In less than one month, Nietzsche would be diagnosed with a serious mental illness that would make him bed-ridden and speechless for the next eleven years until his death. But whatever did happen to the horse? This film, which is Tarr''s last, follows up this question in a fictionalized story of what occurred. The man who whipped the horse is a rural farmer who makes his living taking on carting jobs into the city with his horse-drawn cart. The horse is old and in very poor health, but does its best to obey its master''s commands. The farmer and his daughter must come to the understanding that it will be unable to go on sustaining their livelihoods. The dying of the horse is the foundation of this tragic tale. Written by Anonymous', '146 min', 'http://ia.media-imdb.com/images/M/MV5BMTMyNzg1MzM2Ml5BMl5BanBnXkFtZTcwMzQ5NjcxNw@@._V1_SX214_.jpg', '14 June 2012 (Portugal)', 7.5, 'O Cavalo de Turim', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (514, 'Cuba, 1948. Chico is a young piano player with big dreams. Rita is a beautiful singer with an extraordinary voice. Music and romantic desire unites them, but their journey - in the tradition of the Latin ballad, the bolero - brings heartache and torment. From Havana to New York, Paris, Hollywood and Las Vegas, two passionate individuals battle impossible odds to unite in music and love. Written by Anonymous', '94 min', 'http://ia.media-imdb.com/images/M/MV5BOTcwMzk5MzYwN15BMl5BanBnXkFtZTcwMDQ5OTUzNw@@._V1_SY317_CR0,0,214,317_.jpg', '19 November 2010 (UK)', 7, 'Chico e Rita', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (515, 'Back from a tour of duty, Kelli can''t wait to rejoin her old life in the rust belt town she''s always lived in. She''s ready to experience the old feelings of everyday life- the carpet under her bare feet, a cold beer in front of the television, the smell of her baby''s head. Slowly, though, she realizes that her everyday life doesn''t resemble the one she left. Struggling to find her place in her family and the rust-belt town she no longer recognizes, what can she reclaim of her share of the way of life she''s been fighting to protect? Written by NMH', '97 min', 'http://ia.media-imdb.com/images/M/MV5BMTY5MTM4NzUwMl5BMl5BanBnXkFtZTcwMzMwNTIyNw@@._V1_SX214_.jpg', '10 February 2012 (USA)', 5.79999999999999982, 'Return', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (516, 'Johnny Blaze, a man who made a deal with the Devil who called himself Mephistopheles at the time (now Roarke), is on the run trying to make sure no-one is harmed by his alter ego, The Ghost Rider. He is approached by a Monk named Moreau who tells him that he can help be him free of the Rider, but first, he needs Johnny''s help to protect a boy, whom Roarke has plans for, to help him take human form. Written by rcs0411@yahoo.com', '96 min', 'http://ia.media-imdb.com/images/M/MV5BMTkwNDM5MDEzOF5BMl5BanBnXkFtZTcwNDEyNTUxNw@@._V1_SX214_.jpg', '17 February 2012 (USA)', 4.29999999999999982, 'Ghost Rider: Spirit of Vengeance', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (517, 'Two CIA agents, Tuck and Frank who are also best friends, have been benched because someone''s after them. Tuck is divorced with a son whom he''s not close to and Frank is a ladies man. Tuck decides to try and find someone so he places his profile on a dating website. Lauren, a woman also looking for a guy sees tuck''s profile and goes with him. She later bumps into Frank and he hits on her and she goes out with him. she''s intrigued by both of them. When they learn that they''re dating the same girl, they agree to let her choose. But both can''t help but use their skills to keep tabs on her and each other. And also sabotage each others dates with her. Written by rcs0411@yahoo.com', '97 min', 'http://ia.media-imdb.com/images/M/MV5BMTYyOTQ4MDE2MV5BMl5BanBnXkFtZTcwOTE0MTgwNw@@._V1_SY317_CR0,0,214,317_.jpg', '17 February 2012 (USA)', 6.20000000000000018, 'This Means War', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (518, 'A documentary that follows the Manassas Tigers football team, a severely underfunded and underprivileged football team -- who were even hired out as a practice team for more successful schools -- as they reverse their fortunes, thanks to coach Bill Courtney. Written by Kevin Jagernauth', '113 min', 'http://ia.media-imdb.com/images/M/MV5BOTE1ODE2NDc5Ml5BMl5BanBnXkFtZTcwNDU1NjQxOA@@._V1_SY317_CR0,0,214,317_.jpg', '3 August 2012 (UK)', 7.5, 'Undefeated', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (519, '14-year-old Arrietty and the rest of the Clock family live in peaceful anonymity as they make their own home from items that they borrow from the house''s human inhabitants. However, life changes for the Clocks when a human boy discovers Arrietty. Written by ANN', '94 min', 'http://ia.media-imdb.com/images/M/MV5BMTAxNjk3OTYyODReQTJeQWpwZ15BbWU3MDgyODY2OTY@._V1_SX214_.jpg', '17 February 2012 (USA)', 7.59999999999999964, 'The Secret World of Arrietty', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (520, 'A dishonest insurance salesman''s life quickly disintegrates during a Wisconsin winter when he teams up with a psychopath to steal a rare violin at the home of a reclusive farmer.', '93 min', 'http://ia.media-imdb.com/images/M/MV5BOTExNDMxMzAyOV5BMl5BanBnXkFtZTcwNjQ1OTIyNw@@._V1_SX214_.jpg', '25 January 2011 (USA)', 6.09999999999999964, 'Thin Ice', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (521, 'In the isolated, frozen town of Barrow, Alaska, Iñupiaq teenagers Qalli and Aivaaq have grown up like brothers in a tight-knit community defined as much by ancient traditions as by hip-hop and snowmobiles. Early one morning, on a seal hunt with their friend James, a tussle turns violent, and James is killed. Panic stricken, terrified, and with no one to blame but themselves, Qalli and Aivaaq lie and declare the death a tragic accident. As Barrow roils with grief and his protective father becomes suspicious, Qalli stumbles through guilt-filled days, wrestling with his part in the death. For the first time in his life, he''s treading alone on existential ice. Written by Anonymous', '96 min', 'http://ia.media-imdb.com/images/M/MV5BMzkzNzQyMDgzM15BMl5BanBnXkFtZTcwNjY0ODQyNw@@._V1_SY317_CR0,0,214,317_.jpg', '14 December 2011 (France)', 6, 'On the Ice', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (522, 'The young Limburg cattle farmer Jacky Vanmarsenille is approached by an unscrupulous veterinarian to make a shady deal with a notorious West-Flemish beef trader. But the assassination of a federal policeman, and an unexpected confrontation with a mysterious secret from Jacky''s past, set in motion a chain of events with farreaching consequences. BULLHEAD is an exciting tragedy about fate, lost innocence and friendship, about crime and punishment, but also about conflicting desires and the irreversibility of a man''s destiny. Written by Anonymous', '129 min', 'http://ia.media-imdb.com/images/M/MV5BMjIyODk5MjQ3OF5BMl5BanBnXkFtZTcwNjQwNDUzNw@@._V1_SY317_CR0,0,214,317_.jpg', '17 February 2012 (USA)', 7.29999999999999982, 'Bullhead', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (523, 'A drama focused on five months in the life of pedophile who keeps a 10-year-old boy locked in his basement.', '96 min', 'http://ia.media-imdb.com/images/M/MV5BMTA4OTMwNTE5ODZeQTJeQWpwZ15BbWU3MDk5MjIwNDc@._V1_SX214_.jpg', '15 February 2012 (USA)', 6.90000000000000036, 'Michael', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (524, 'A story set in the former Yugoslavia and centered on a guy who returns to Herzegovina from Germany with plenty of cash and hopes for a good new life.', '113 min', 'http://ia.media-imdb.com/images/M/MV5BMjI1MDQ4NzM5OV5BMl5BanBnXkFtZTcwMzE2NTkyNw@@._V1_SY317_CR5,0,214,317_.jpg', '17 February 2012 (USA)', 7, 'Cirkus Columbia', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (525, 'After George is downsized from his financial firm and Linda''s depressing documentary is cancelled, they can no longer afford their overpriced ''micro-loft'' in New York. They find themselves with just one option - to pack up their lives and head south to move in with George''s brother and his wife. George and Linda stumble upon Elysium, an idyllic community where the only rule is to be yourself. Written by Universal Pictures', '98 min', 'http://ia.media-imdb.com/images/M/MV5BMjA5NjIyOTY1Nl5BMl5BanBnXkFtZTcwMDY3NjQ0Nw@@._V1_SX214_.jpg', '24 February 2012 (USA)', 5.59999999999999964, 'Wanderlust', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (526, 'Businessman Wesley Deeds is jolted out of his scripted life when he meets Lindsey, a single mother who works on the cleaning crew in his office building.', '110 min', 'http://ia.media-imdb.com/images/M/MV5BMjI0ODcxMzk3N15BMl5BanBnXkFtZTcwNjAzMTMwNw@@._V1_SX214_.jpg', '24 February 2012 (USA)', 4.70000000000000018, 'Good Deeds', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (527, 'When her sister disappears, Jill is convinced the serial killer who kidnapped her two years ago has returned, and she sets out to once again face her abductor. Written by Anonymous', '94 min', 'http://ia.media-imdb.com/images/M/MV5BMTgzMTEyOTgyOF5BMl5BanBnXkFtZTcwOTY1ODkxNw@@._V1_SY317_CR0,0,214,317_.jpg', '24 February 2012 (USA)', 5.70000000000000018, 'Gone', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (528, 'An unprecedented blend of real-life heroism and original filmmaking, Act of Valor stars a group of active-duty Navy SEALs in a powerful story of contemporary global anti-terrorism. Inspired by true events, the film combines stunning combat sequences, up-to-the minute battlefield technology and heart-pumping emotion for the ultimate action adventure. Act of Valor takes audiences deep into the secretive world of the most elite, highly trained group of warriors in the modern world. When the rescue of a kidnapped CIA operative leads to the discovery of a deadly terrorist plot against the U.S., a team of SEALs is dispatched on a worldwide manhunt. As the valiant men of Bandito Platoon race to stop a coordinated attack that could kill and wound thousands of American civilians, they must balance their commitment to country, team and their families back home. Each time they accomplish their mission, a new piece of intelligence reveals another shocking twist to the deadly terror plot, which ... Written by Relativity Media', '110 min', 'http://ia.media-imdb.com/images/M/MV5BMTY3NDQxMDAzM15BMl5BanBnXkFtZTcwNzEyNjgzNw@@._V1_SX214_.jpg', '24 February 2012 (USA)', 6.29999999999999982, 'Act of Valor', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (529, 'This film''s center is a family in Albania. The main characters are Rudina, the oldest daughter, and Nik, the oldest son. Both have a pretty normal life. Rudina is an A-student in high-school and Nik very popular. He just fell in love with one of his fellow students. Their father earns the families income with a little bread delivery service. For that he uses a short cut through the neighbours ground, but the neighbour doesn''t necessarily like that. But the ground had actually belonged to Rudina''s and Nik''s family once. One day the conflict escalates and the neighbour gets killed by Rudina''s and Nik''s father and their uncle. Because only their uncle gets caught by the police and their father is able to hide, the old law of blood feud is against the family. They cannot leave their house. Only the women of the family are allowed to leave the house. So Rudina has to quit school and continue the bread delivery service of the father, so the family can survive. The situation is tense as ... Written by Anonymous', '109 min', 'http://ia.media-imdb.com/images/M/MV5BMTQxMDcxNjU5NV5BMl5BanBnXkFtZTcwNDI5MjgyNw@@._V1_SX214_.jpg', '17 September 2011 (Albania)', 6.70000000000000018, 'The Forgiveness of Blood', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (530, 'Dom works the night shift in a small hotel near the industrial sea port of Le Havre. One night, a woman arrives with no luggage and no shoes. Her name is Fiona and she tells Dom that she is a fairy that can grant him three wishes. Fiona makes two of his wishes come true then mysteriously disappears. Dom. who has fallen in love with her by then, searches for her everywhere. Written by Anonymous', '93 min', 'http://ia.media-imdb.com/images/M/MV5BMTk4Njg0NDg5OV5BMl5BanBnXkFtZTcwNTc2NjgyNw@@._V1_SY317_CR4,0,214,317_.jpg', '24 February 2012 (USA)', 6, 'The Fairy', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (531, 'Seven Australian teenage friends from a small town go on a camping trip to be with nature. During their trip, they see military aircraft fly overhead. What they didn''t know was their country was being invaded by another country. Returning home, they discover that they are at war. With no training, they band together to fight the enemy. Written by Douglas Young (the-movie-guy)', '103 min', 'http://ia.media-imdb.com/images/M/MV5BMTM4MDEyNDE1OV5BMl5BanBnXkFtZTcwOTA4NjA0Nw@@._V1_SY317_CR5,0,214,317_.jpg', '24 February 2012 (USA)', 6.09999999999999964, 'Guerreiros do Amanhã', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (541, 'When Bond''s latest assignment goes gravely wrong and agents around the world are exposed, MI6 is attacked forcing M to relocate the agency. These events cause her authority and position to be challenged by Gareth Mallory (Ralph Fiennes), the new Chairman of the Intelligence and Security Committee. With MI6 now compromised from both inside and out, M is left with one ally she can trust: Bond. 007 takes to the shadows - aided only by field agent, Eve (Naomie Harris) - following a trail to the mysterious Silva (Javier Bardem), whose lethal and hidden motives have yet to reveal themselves. Written by JoaoBond', '143 min', 'http://ia.media-imdb.com/images/M/MV5BMjM1MzMzOTA3MV5BMl5BanBnXkFtZTcwOTE3NzA1OA@@._V1_SX214_.jpg', '9 November 2012 (USA)', 7.79999999999999982, 'Skyfall', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (532, 'Wreck-It Ralph longs to be as beloved as his game''s perfect Good Guy, Fix-It Felix. Problem is, nobody loves a Bad Guy. But they do love heroes... so when a modern, first-person shooter game arrives featuring tough-as-nails Sergeant Calhoun, Ralph sees it as his ticket to heroism and happiness. He sneaks into the game with a simple plan -- win a medal -- but soon wrecks everything, and accidentally unleashes a deadly enemy that threatens every game in the arcade. Ralph''s only hope? Vanellope von Schweetz, a young troublemaking "glitch" from a candy-coated cart racing game who might just be the one to teach Ralph what it means to be a Good Guy. But will he realize he is good enough to become a hero before it''s "Game Over" for the entire arcade? Written by Walt Disney Studios Motion Pictures', '108 min', 'http://ia.media-imdb.com/images/M/MV5BNzMxNTExOTkyMF5BMl5BanBnXkFtZTcwMzEyNDc0OA@@._V1_SX214_.jpg', '2 November 2012 (USA)', 7.79999999999999982, 'Wreck-It Ralph', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (533, 'In Jungle Village, the leader of the Lion''s clan Gold Lion is summoned by the Governor and assigned to protect his gold that will be transported through the village. However he is betrayed and murdered by the greedy Silver Lion and Bronze Lion. Gold Lion''s favorite son Zen Yi, a.k.a. The X-Blade, seeks revenge and heads to Jungle Village, but he is defeated by Brass Body and rescued by the local Blacksmith Thaddeus. Meanwhile the Gemini Female and the Gemini Male protect the Governor''s gold, but they are vanquished by the army of Silver and Bronze Lion. The Blacksmith is abducted by the Lions and has his arms severed by Brass Body. However he is saved by the British Jack Knife, who is the emissary of the Emperor, and he manufactures iron arms for Thaddeus. Meanwhile the Governor sends the Jackal army to fight against the Lions and they hide the gold in the brothel of Madam Blossom. However, Madam Blossom and his girls form an army of black widows and together with Jack, Zen Yi and The... Written by Claudio Carvalho, Rio de Janeiro, Brazil', '95 min', 'http://ia.media-imdb.com/images/M/MV5BMTg5ODI3ODkzOV5BMl5BanBnXkFtZTcwMTQxNjUwOA@@._V1_SX214_.jpg', '2 November 2012 (USA)', 5.40000000000000036, 'The Man with the Iron Fists', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (534, 'Whip Whitaker is a commuter airline pilot. While on a flight from Orlando to Atlanta something goes wrong and the plane starts to fly erratically. With little choice Whip crashes the plane and saves almost all on board. When he wakes up in the hospital, his friend from the airline union introduces him to a lawyer who tells him there''s a chance he could face criminal charges because his blood test reveals that he is intoxicated with alcohol and cocaine. He denies being impaired, so while an investigation is underway, he is told to keep his act together. However, letting go of his addiction is not as easy as it seems... Written by Immanuel Ambhara', '138 min', 'http://ia.media-imdb.com/images/M/MV5BMTUxMjI1OTMxNl5BMl5BanBnXkFtZTcwNjc3NTY1OA@@._V1_SY317_CR0,0,214,317_.jpg', '2 November 2012 (USA)', 7.29999999999999982, 'Flight', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (535, 'Cheyenne, a wealthy former rock star (Penn), now bored and jaded in his retirement embarks on a quest to find his father''s persecutor, an ex-Nazi war criminal now hiding out in the U.S. Learning his father is close to death, he travels to New York in the hope of being reconciled with him during his final hours, only to arrive too late. Having been estranged for over 30 years, it is only now in death that he learns the true extent of his father''s humiliation in Auschwitz at the hands of former SS Officer Aloise Lange - an event he is determined to avenge. So begins a life-altering journey across the heartland of America to track down and confront his father''s nemesis. As his quest unfolds, Cheyenne is reawakened by the people he encounters and his journey is transformed into one of reconciliation and self discovery. As his date with destiny arrives and he tracks down Lange, Cheyenne must finally decide if it is redemption he seeks ....or revenge. Starring two time Academy Award winner ... Written by Anonymous', '118 min', 'http://ia.media-imdb.com/images/M/MV5BMTUzMDg5NjM3Nl5BMl5BanBnXkFtZTcwOTQ3NTI2OA@@._V1_SX214_.jpg', '25 April 2012 (Portugal)', 6.59999999999999964, 'Este é o Meu Lugar', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (536, 'After a classical string quartet''s 25 years of success, Peter, the cellist and oldest member, decides that he must retire when he learns he has Parkinson''s Disease. For the others, that announcement proves a catalyst for letting their hidden resentments come to the surface while the married members'' daughter has disruptive desires of her own. All this threatens to tear the group apart even as they are famous for playing Beethoven''s String Quartet No. 14, opus 131, a piece that is played non-stop no matter how life interferes. Written by Kenneth Chisholm (kchishol@rogers.com)', '105 min', 'http://ia.media-imdb.com/images/M/MV5BMTM3MDc3MzIzNV5BMl5BanBnXkFtZTcwNjkwNTU0OA@@._V1_SX214_.jpg', '10 October 2013 (Portugal)', 6.90000000000000036, 'A Late Quartet', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (537, 'When a family of raccoons discover worms living underneath the sod in Jeff and Nealy''s backyard, this pest problem begins a darkly comic and wild chain reaction of domestic tension, infidelity and murder.', '91 min', 'http://ia.media-imdb.com/images/M/MV5BMTQ1MDcyNDIyNl5BMl5BanBnXkFtZTcwNzc3MTc1OA@@._V1_SX214_.jpg', 'January 2011 (USA)', 6.09999999999999964, 'The Details', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (538, 'Jack and Diane, two teenage girls, meet in New York City and spend the night kissing ferociously. Diane''s charming innocence quickly begins to open Jack''s tough skinned heart. But, when Jack discovers that Diane is leaving the country in a week she tries to push her away. Diane must struggle to keep their love alive while hiding the secret that her newly awakened sexual desire is giving her werewolf-like visions. Written by filmsalt.com', '110 min', 'http://ia.media-imdb.com/images/M/MV5BMTQ5MDEyNDk5MF5BMl5BanBnXkFtZTcwNjMxODk2Nw@@._V1_SX214_.jpg', '20 April 2012 (USA)', 4.20000000000000018, 'Jack and Diane', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (539, 'In Manhattan, the vampires Goody and Stacy share an apartment and work and study in the night-shift. Goody was turned in vampire in 1840 by the evil Cisserus, who turned Stacy in the 90s, and they became best friends but Goody never told her real age to her friend. They only drink mice blood and refuse to drink human blood, and they go together to the Vampire Anonymous. Stacy falls in love with her classmate Joey, and soon she learns that he is the son of the vampire slayer Dr. Van Helsing. Meanwhile, Goody meets her former passion, Danny, in the hospital where his wife is terminal. When Stacy gets pregnant, Goody knows that the only way that the child can survive is killing Cisserus, since they would revert to their human ages. But nobody knows here her lair is. Written by Claudio Carvalho, Rio de Janeiro, Brazil', '92 min', 'http://ia.media-imdb.com/images/M/MV5BMTg0ODkwMzI0NV5BMl5BanBnXkFtZTcwMDc4OTc2OA@@._V1_SY317_CR6,0,214,317_.jpg', '2 November 2012 (USA)', 4.90000000000000036, 'Vamps', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (540, 'Eleven veterans returning from Iraq and Afghanistan join an expedition to climb the 20,000 foot Himalayan giant Mount Lobuche. With blind adventurer Erik Weihenmayer and a team of Everest summiteers as their guides, they set out on an emotional and gripping climb to reach the top in an attempt to heal the emotional and physical wounds of the longest war in U.S. history. Representing nearly every branch of the military, the veterans, and the Gold Star Mom who joins their trek, bring humor and deep emotion to this hero''s journey all captured with breathtaking, vertigo-inducing cinematography. Written by Khumbu Pictures, LLC', '92 min', 'http://ia.media-imdb.com/images/M/MV5BMjE4MDI2Nzg0Ml5BMl5BanBnXkFtZTcwMTQ2NjU2OA@@._V1_SY317_CR0,0,214,317_.jpg', 'April 2012 (USA)', 4.29999999999999982, 'High Ground', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (542, 'In 1865, as the American Civil War winds inexorably toward conclusion, U.S. president Abraham Lincoln endeavors to achieve passage of the landmark constitutional amendment which will forever ban slavery from the United States. However, his task is a race against time, for peace may come at any time, and if it comes before the amendment is passed, the returning southern states will stop it before it can become law. Lincoln must, by almost any means possible, obtain enough votes from a recalcitrant Congress before peace arrives and it is too late. Yet the president is torn, as an early peace would save thousands of lives. As the nation confronts its conscience over the freedom of its entire population, Lincoln faces his own crisis of conscience -- end slavery or end the war. Written by Jim Beaver <jumblejim@prodigy.net>', '150 min', 'http://ia.media-imdb.com/images/M/MV5BMTQzNzczMDUyNV5BMl5BanBnXkFtZTcwNjM2ODEzOA@@._V1_SY317_CR0,0,214,317_.jpg', '16 November 2012 (USA)', 7.5, 'Lincoln', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (543, 'Indifferent to the notion of inheriting his father''s estate, a Williamsburg guy passes the time with his friends, playing games of mock sincerity and irreverence.', '95 min', 'http://ia.media-imdb.com/images/M/MV5BMjA0OTA3ODU4M15BMl5BanBnXkFtZTcwNDY3NTM1OA@@._V1_SX214_.jpg', '21 January 2012 (USA)', 6.09999999999999964, 'The Comedy', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (544, 'In Shanghai, an aging socialite''s infatuation with her ex-boyfriend manifests itself as a risky game, where her former lover agrees to seduce, then abandon a naive young woman.', '110 min', 'http://ia.media-imdb.com/images/M/MV5BMTY0MDA5NDE4Ml5BMl5BanBnXkFtZTcwMjM3MjMxOA@@._V1_SY317_CR5,0,214,317_.jpg', '27 September 2012 (China)', 5.40000000000000036, 'Dangerous Liaisons', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (545, 'In 1767, the British Princess Caroline is betrothed to the mad King Christian VII of Denmark, but her life with the erratic monarch in the oppressive country becomes an isolating misery. However, Christian soon gains a fast companion with the German Dr. Johann Struensee, a quietly idealistic man of the Enlightenment. As the only one who can influence the King, Struensee is able to begin sweeping enlightened reforms of Denmark through Christian even as Caroline falls for the doctor. However, their secret affair proves a tragic mistake that their conservative enemies use to their advantage in a conflict that threatens to claim more than just the lovers as their victims. Written by Kenneth Chisholm (kchishol@rogers.com)', '137 min', 'http://ia.media-imdb.com/images/M/MV5BMTg3MDE4MTQ4NF5BMl5BanBnXkFtZTcwNDgwNDYyOA@@._V1_SX214_.jpg', '21 March 2013 (Portugal)', 7.5, 'A Royal Affair', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (546, 'Polar-opposite brothers Randy and Kirk never saw eye-to-eye, but their rivalry is taken to a new level when Randy hijacks Kirk''s son''s sleepover, taking the boys on a Scout Trip to remember.', '79 min', 'http://ia.media-imdb.com/images/M/MV5BMTM1NDE0NTI5OF5BMl5BanBnXkFtZTcwOTY1MTY0OA@@._V1_SY317_CR0,0,214,317_.jpg', '9 November 2012 (USA)', 3.79999999999999982, 'Nature Calls', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (547, 'After the accidental death of their six-year-old daughter, the Hughes family escape their busy upscale suburban life and head to their isolated cottage for some quality time. An evening with their friendly neighbors is suddenly interrupted when one mans obsession with perfection escalates into a violent struggle, forcing the families to go beyond what they ever thought they were capable of in order to survive. Written by Anonymous', '97 min', 'http://ia.media-imdb.com/images/M/MV5BMTU3ODczMTcwMF5BMl5BanBnXkFtZTcwMzg1MTA3OA@@._V1_SX214_.jpg', '9 November 2012 (USA)', 5.20000000000000018, 'In Their Skin', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (548, 'STARLET explores the unlikely cross-generational friendship between 21 year-old Jane (Dree Hemingway), and the elderly Sadie (Besedka Johnson), two women whose worlds collide in California''s San Fernando Valley. Jane, an aspiring actress, spends her time getting high with her dysfunctional roommates, Melissa and Mikey (Stella Maeve and James Ransone), while caring for her Chihuahua, Starlet. Sadie, a widow, passes her days alone, tending to her flower garden. After a confrontation between the women at Sadie''s yard sale, Jane uncovers a hidden stash of money inside a relic from Sadie''s past. Jane attempts to befriend the caustic older woman in an effort to solve her dilemma and secrets emerge as their relationship grows. Director Sean Baker continues in the naturalistic style of his previous films, the award-winning and Spirit Award nominees PRINCE OF BROADWAY and TAKE OUT, capturing the rhythms of everyday life with an authenticity rarely seen in cinema. Featuring a pair of ... Written by anonymous', '103 min', 'http://ia.media-imdb.com/images/M/MV5BMzI5NTI3MjYyNl5BMl5BanBnXkFtZTcwNTg1NjQ2OA@@._V1_SX214_.jpg', '2 May 2013 (Hong Kong)', 6.5, 'Starlet', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (549, 'The final Twilight Saga begins with Bella now a vampire learning to use her abilities. And happy to see her daughter, Renesmee is flourishing. But when someone sees Renesmee do something that makes them think that she was turned. This person goes to the Volturi, because it is a violation to turn a child. And the penalty is death for both who turned the child into a vampire and the child, cause they deem a turned child too dangerous. Alice gets a vision of the Volturi coming after them. So the Cullens try to convince them that Renesmee is not a threat. So they ask friends and family to come stand with them. But when someone who has it in for the Volturi shows up and tells them they should be ready for a fight. And they get ready. Written by rcs0411@yahoo.com', '115 min', 'http://ia.media-imdb.com/images/M/MV5BMTcyMzUyMzY1OF5BMl5BanBnXkFtZTcwNDQ4ODk1OA@@._V1_SX214_.jpg', '16 November 2012 (USA)', 5.5, 'The Twilight Saga: Breaking Dawn - Part 2', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (550, 'In 1874, in the Imperial Russia, the aristocratic Anna Karenina travels from Saint Petersburg to Moscow to save the marriage of her brother Prince Oblonsky, who had had a love affair with his housemaid. Anna Karenina has a cold marriage with her husband, Count Alexei Karenin, and they have a son. Anna meets the cavalry officer Count Vronsky at the train station and they feel attracted by each other. Soon she learns that Vronsky will propose Kitty, who is the younger sister of her sister-in-law Dolly. Anna satisfactorily resolves the infidelity case of her brother and Kitty invites her to stay for the ball. However, Anna Karenina and Vronsky dance in the ball, calling the attention of the conservative society. Soon they have a love affair that will lead Anna Karenina to a tragic fate. Written by Claudio Carvalho, Rio de Janeiro, Brazil', '129 min', 'http://ia.media-imdb.com/images/M/MV5BMTU0NDgxNDg0NV5BMl5BanBnXkFtZTcwMjE4MzkwOA@@._V1_SY317_CR0,0,214,317_.jpg', '6 December 2012 (Portugal)', 6.59999999999999964, 'Anna Karenina', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (562, 'Arkin escapes with his life from the vicious grips of "The Collector" during an entrapment party where he adds beautiful Elena to his "Collection." Instead of recovering from the trauma, Arkin is suddenly abducted from the hospital by mercenaries hired by Elena''s wealthy father. Arkin is blackmailed to team up with the mercenaries and track down The Collector''s booby trapped warehouse and save Elena. Written by Ryan Rodriguez', '82 min', 'http://ia.media-imdb.com/images/M/MV5BODQ0MDgzNDA0NV5BMl5BanBnXkFtZTcwNDM4MDQ1OA@@._V1_SX214_.jpg', '30 November 2012 (USA)', 6, 'The Collection', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (551, 'Against medical advice and without the knowledge of her husband Pat Solatano Sr., caring Dolores Solatano discharges her adult son, Pat Solatano Jr., from a Maryland mental health institution after his minimum eight month court ordered stint. The condition of the release includes Pat Jr. moving back in with his parents in their Philadelphia home. Although Pat Jr.''s institutionalization was due to him beating up the lover of his wife Nikki, he was diagnosed with bipolar disorder. Nikki has since left him and has received a restraining order against him. Although he is on medication (which he doesn''t take because of the way it makes him feel) and has mandatory therapy sessions, Pat Jr. feels like he can manage on the outside solely by healthy living and looking for the "silver linings" in his life. His goals are to get his old job back as a substitute teacher, but more importantly reunite with Nikki. He finds there are certain instances where he doesn''t cope well, however no less so ... Written by Huggo', '122 min', 'http://ia.media-imdb.com/images/M/MV5BMTM2MTI5NzA3MF5BMl5BanBnXkFtZTcwODExNTc0OA@@._V1_SX214_.jpg', '25 December 2012 (USA)', 7.90000000000000036, 'Silver Linings Playbook', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (552, 'A young immigrant falls in love with a NRI who wanted to marry any British person, not a typical brown Indian. But she falls in love with that young musician, but this love story ends with a breakup. Then that man, fed up with life with vast emotion joins Indian army bomb squad, where he flirts with death everyday. A young discovery channel journalist approaches his team to cover bomb squad story but falls in love with him. Written by dwa', '176 min', 'http://ia.media-imdb.com/images/M/MV5BMTUyMzM5OTM5NF5BMl5BanBnXkFtZTcwNTIwMjA3OA@@._V1_SX214_.jpg', '13 November 2012 (India)', 6.90000000000000036, 'Jab Tak Hai Jaan', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (553, 'Pete Cozy is having trouble resolving a happy marriage and family life with rising debt and a job he hates. When his new boss, Susan, a human dynamo, shows up, Pete is pulled into the maelstrom that is her life and made to work harder than he ever has before. Suddenly, money and opportunities come his way, but at what price? Written by CA', '92 min', 'http://ia.media-imdb.com/images/M/MV5BODI3NjkxNTEyN15BMl5BanBnXkFtZTcwNzEwOTE2OA@@._V1_SX214_.jpg', '25 January 2012 (USA)', 5.40000000000000036, 'Price Check', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (554, 'Tommy Cowley is a young father inflicted with chronic agoraphobia since his wife was brutally attacked by a gang of a twisted feral children. Trapped in the dilapidated suburbia of Edenstown, he finds himself terrorised by the same gang, who now seem intent on taking his baby daughter. Torn between the help of an understanding nurse and a vigilante priest, Tommy sets out to learn the nightmarish truth surrounding these hooded children. He also discovers that to be free of his fears, he must finally face the demons of his past and enter the one place that he fears the most - the abandoned tower block known as the Citadel. Written by Anonymous', '84 min', 'http://ia.media-imdb.com/images/M/MV5BMzIwMTQ2NTAyM15BMl5BanBnXkFtZTcwNDIzMjQ0OA@@._V1_SX214_.jpg', '1 March 2013 (UK)', 5.29999999999999982, 'Citadel', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (555, 'In Canada, a writer visits the Indian storyteller Pi Patel and asks him to tell his life story. Pi tells the story of his childhood in Pondicherry, India, and the origin of his nickname. One day, his father, a zoo owner, explains that the municipality is no longer supporting the zoo and he has hence decided to move to Canada, where the animals the family owns would also be sold. They board on a Japanese cargo ship with the animals and out of the blue, there is a storm, followed by a shipwrecking. Pi survives in a lifeboat with a zebra, an orangutan, a hyena and a male Bengal tiger nicknamed Richard Parker. They are adrift in the Pacific Ocean, with aggressive hyena and Rickard Parker getting hungry. Pi needs to find a way to survive. Written by Claudio Carvalho, Rio de Janeiro, Brazil', '127 min', 'http://ia.media-imdb.com/images/M/MV5BNTg2OTY2ODg5OF5BMl5BanBnXkFtZTcwODM5MTYxOA@@._V1_SX214_.jpg', '21 November 2012 (USA)', 8, 'Life of Pi', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (556, 'In Spokane, Washington, the population is awake by a North Korean invasion with paratroopers. The marine Jed Eckert and his brother Matt Eckert escape with a group of friends to an isolated cabin in the woods. They witness the cruel Captain Cho executing their father and they decide to form a resistance group named Wolverines fighting against the invaders. Written by Claudio Carvalho, Rio de Janeiro, Brazil', '93 min', 'http://ia.media-imdb.com/images/M/MV5BMjI0MDAwMzA1M15BMl5BanBnXkFtZTcwNzIxMjY3OA@@._V1_SY317_SX214_.jpg', '21 November 2012 (USA)', 5.29999999999999982, 'Red Dawn', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (557, 'When an evil spirit known as Pitch lays down the gauntlet to take over the world, the immortal Guardians must join forces for the first time to protect the hopes, beliefs, and imaginations of children all over the world. Written by DreamWorks Animation', '97 min', 'http://ia.media-imdb.com/images/M/MV5BMTkzMjgwMDg1M15BMl5BanBnXkFtZTcwMTgzNTI1OA@@._V1_SX214_.jpg', '21 November 2012 (USA)', 7.20000000000000018, 'Rise of the Guardians', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (558, 'In 1959, Alfred Hitchcock and his wife, Alma, are at the top of their creative game as filmmakers amid disquieting insinuations about it being time to retire. To recapture his youth''s artistic daring, Alfred decides his next film will adapt the lurid horror novel, Psycho, over everyone''s misgivings. Unfortunately, as Alfred self-finances and labors on this film, Alma finally loses patience with his roving eye and controlling habits with his actresses. When an ambitious friend lures her to collaborate on a work of their own, the resulting marital tension colors Alfred''s work even as the novel''s inspiration haunts his dreams. Written by Kenneth Chisholm (kchishol@rogers.com)', '98 min', 'http://ia.media-imdb.com/images/M/MV5BODAwNDI5NjIwN15BMl5BanBnXkFtZTcwNjc4ODc2OA@@._V1_SX214_.jpg', '14 December 2012 (USA)', 6.90000000000000036, 'Hitchcock', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (559, 'Put in charge of his young son, Alain leaves Belgium for Antibes to live with his sister and her husband as a family. Alain''s bond with Stephanie, a killer whale trainer, grows deeper after Stephanie suffers a horrible accident.', '120 min', 'http://ia.media-imdb.com/images/M/MV5BMTczMTU4NDUyMl5BMl5BanBnXkFtZTcwOTM5NDY0OA@@._V1_SY317_CR0,0,214,317_.jpg', '7 March 2013 (Portugal)', 7.5, 'Rust and Bone', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (560, 'In 1989, five black and Latino teenagers from Harlem were arrested and later convicted of raping a white woman in New York City''s Central Park. They spent between 6 and 13 years in prison before a serial rapist confessed that he alone had committed the crime, leading to their convictions being overturned. Set against a backdrop of a decaying city beset by violence and racial tension, THE CENTRAL PARK FIVE tells the story of that horrific crime, the rush to judgment by the police, a media clamoring for sensational stories and an outraged public, and the five lives upended by this miscarriage of justice. Written by CP5', '119 min', 'http://ia.media-imdb.com/images/M/MV5BMjMxMDMyNzI1M15BMl5BanBnXkFtZTcwOTIxMDQ2OA@@._V1_SX214_.jpg', '23 November 2012 (USA)', 7.59999999999999964, 'The Central Park Five', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (561, 'Three amateurs stickup a Mob protected card game, causing the local criminal economy to collapse. Brad Pitt plays the hitman hired to track them down and restore order. Killing Them Softly also features Richard Jenkins , James Gandolfini, Ray Liotta, Scoot McNairy, Ben Mendelsohn, and Vincent Curatola. Max Casella, Trevor Long, Slaine and Sam Shepard also make appearances. Written by Anonymous', '97 min', 'http://ia.media-imdb.com/images/M/MV5BODk3MDg2NDk5M15BMl5BanBnXkFtZTcwMjcxMjMzOA@@._V1_SY317_CR1,0,214,317_.jpg', '30 November 2012 (USA)', 6.29999999999999982, 'Killing Them Softly', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (563, 'John awakens from a coma to discover his wife and daughter were slaughtered in a brutal home invasion. Haunted by images of the attack, he vows to kill the man responsible: Luc Deveraux. While John tries to piece his reality back together, things get more complicated when he is pursued by a relentless UniSol named Magnus. Meanwhile, Deveraux and surviving UniSol Andrew Scott are preparing to battle anarchy and build a new order ruled by Unisols without government oversight. They are weeding out the weak and constantly testing their strongest warriors in brutal, life-and-death combat. Luc has emerged operating the Unisol Church of Eventualism, taking in wayward Unisols whom the government has been secretly operating as remote-controlled sleeper agents. His mission is to liberate these Unisols from the implanted memories and the lies the government has inserted in them. As John gets closer to Deveraux and the rogue army of genetically enhanced warriors, he discovers more about himself ... Written by Anonymous', '114 min', 'http://ia.media-imdb.com/images/M/MV5BMTM3ODMxMDY0MF5BMl5BanBnXkFtZTcwNDc3MTY0OA@@._V1_SY317_CR1,0,214,317_.jpg', '25 October 2012 (USA)', 5.09999999999999964, 'Universal Soldier: Day of Reckoning', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (564, 'The film opens with a car driving by the sea drive, which all of a sudden, screeches to a halt and turns randomly, to break the sidewalk, and fall into the sea. Next day, enter Inspector Surjan Singh Sekhawat, who is the investigating officer. A simultaneous plot reveals that he and his wife are coping with some personal loss of losing their only child, Karan. They have moved to their new home in Mumbai, where, his wife, Roshni is finishing with the unpacking. The doorbell rings, and she find out that it is an elderly lady, who introduces herself as Franny. She asks for some tea, and while Roshni is away into the kitchen, she rummages through the yet unpacked boxes, and finds a family photograph, where she addresses the dead child by his name, and seems happy. Meanwhile, Surjan encounters a sex worker named Rosie, who can shed some light upon the entire mystery. Written by debasree', '131 min', 'http://ia.media-imdb.com/images/M/MV5BNTg5NzI3NzQzNl5BMl5BanBnXkFtZTcwMjM3MDU2OA@@._V1_SY317_CR2,0,214,317_.jpg', '30 November 2012 (India)', 7.29999999999999982, 'Talaash', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (565, 'A sinful martial arts expert wants to start a new tranquil life, only to be hunted by a determined detective and his former master.', '115 min', 'http://ia.media-imdb.com/images/M/MV5BMTc4OTUxMDQ1NF5BMl5BanBnXkFtZTcwOTczMDI2OA@@._V1_SX214_.jpg', '31 October 2013 (Portugal)', 7, 'Dragon', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (566, 'A former Britpop rocker who now works on a farm gets caught driving drunk and faces deportation after living in Los Angeles for many years. His efforts to stay in the U.S. force him to confront the past and current demons in his life.', '94 min', 'http://ia.media-imdb.com/images/M/MV5BMTk3MzQxMjExNl5BMl5BanBnXkFtZTcwNTY0NTE2OA@@._V1_SY317_CR1,0,214,317_.jpg', '25 January 2012 (USA)', 5.40000000000000036, 'California Solo', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (567, 'A documentary on some of contemporary Mexico''s most iconic artists and performers.', '98 min', 'http://ia.media-imdb.com/images/M/MV5BMjI1NTQ4MjkwMl5BMl5BanBnXkFtZTcwMDE4NTQ2OA@@._V1_SX214_.jpg', '30 November 2012 (USA)', 5.90000000000000036, 'Hecho en México', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (568, 'Ginger Baker looks back on his musical career with Cream and Blind Faith; his introduction to Fela Kuti; his self-destructive patterns and losses of fortune; and his current life inside a fortified South African compound.', '100 min', 'http://ia.media-imdb.com/images/M/MV5BMjIwNDE5NjE2MV5BMl5BanBnXkFtZTcwNjY2ODc3OA@@._V1_SY317_CR0,0,214,317_.jpg', '17 May 2013 (UK)', 7, 'Beware of Mr. Baker', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (569, 'A deadly drought in 1942 takes its toll on central China''s Henan province during the war against Japan.', '145 min', 'http://ia.media-imdb.com/images/M/MV5BNjc2OTA3Mjc1Nl5BMl5BanBnXkFtZTcwMjQyNzU3OA@@._V1_SY317_CR6,0,214,317_.jpg', '29 November 2012 (China)', 6.79999999999999982, 'Back to 1942', NULL);
INSERT INTO movie (id, description, duration, image, launchdate, metascore, title, rate) VALUES (570, 'The hilarious, outrageous, and ultimately tragic true story of one filmmaker''s seduction into moral blindness in the glare of the media spotlight. What begins innocently is a film that seems nothing more than a "Behind-the-Scenes" tell-all, but Filmmaker David Giancola has larger issues in mind and the film quickly takes a dark turn. Giancola uses his tale as a modern parable about the dangers of celebrity and it''s debilitating effect upon our society. Back in 2005, he wanted to break out by making a "Movie that mocked B-Movies". He thought he could manipulate the media by casting Anna Nicole Smith. In the end the media manipulated him instead as his star and one of his producers died in a media feeding frenzy. The film bombed, but the story was one of the most reported events of 2007, behind only coverage of the Iraq war. The truth is always stranger and more unbelievable than fiction... Filmmaker Giancola spent over three years in editing from over 80 Hours of never-before seen ... Written by Susan Potter Publicity', '89 min', 'http://ia.media-imdb.com/images/M/MV5BMTkxOTk1NTIwNl5BMl5BanBnXkFtZTcwODAzNjQ1OA@@._V1._CR75,74.16667175292969,1014,1502.9999542236328_SX214_.jpg', '19 March 2012 (USA)', 2.79999999999999982, 'Addicted to Fame', NULL);
